CREATE VIEW v_approval_level AS
 SELECT al.id,
    al.out_posisi_id,
    al.out_struktural_id,
    al.out_fungsional_id,
    al.in_posisi_id,
    al.in_struktural_id,
    al.in_fungsional_id,
    al.level,
    al.wait_before,
    al.approval_type_id,
    at.nama AS nama_approval,
    pos_out.nama AS nama_posisi_out,
    pos_in.nama AS nama_posisi_in,
    st_out.nama AS nama_struktural_out,
    st_in.nama AS nama_struktural_in,
    fn_out.nama AS nama_fungsional_out,
    fn_in.nama AS nama_fungsional_in,
    pos_out.no_urut AS no_urut_posisi_out,
    st_out.eselon AS no_urut_struktural_out,
    al.out_group_id,
    al.in_group_id,
    gr_out.name AS nama_group_out,
    gr_in.name AS nama_group_in
   FROM (((((((((approval_level al
     LEFT JOIN approval_type at ON ((al.approval_type_id = at.id)))
     LEFT JOIN posisi pos_out ON ((al.out_posisi_id = pos_out.id)))
     LEFT JOIN posisi pos_in ON ((al.in_posisi_id = pos_in.id)))
     LEFT JOIN struktural st_out ON ((al.out_struktural_id = st_out.id)))
     LEFT JOIN struktural st_in ON ((al.in_struktural_id = st_in.id)))
     LEFT JOIN fungsional fn_out ON ((al.out_fungsional_id = fn_out.id)))
     LEFT JOIN fungsional fn_in ON ((al.in_fungsional_id = fn_in.id)))
     LEFT JOIN groups gr_out ON ((al.out_group_id = gr_out.id)))
     LEFT JOIN groups gr_in ON ((al.in_group_id = gr_in.id)))
  ORDER BY al.approval_type_id, st_out.eselon, pos_out.no_urut, fn_out.nama, al.level;


