<p align="center">INDIKATOR PUSAT UNGGULAN</p>
<p>Lembaga litbang yang akan ditetapkan menjadi Pusat Unggulan Iptek harus memenuhi kategori penilaian sebagai berikut:</p>
<p class="Default">&nbsp;<strong>a. Academic Excellence (capaian akademik) (35%) </strong></p>
<ol>
<li>Minimal 3 undangan untuk menjadi pembicara dalam konferensi internasional;</li>
<li>Minimal 5 undangan sebagai pemakalah internasional;</li>
<li>Minimal 3 kunjungan lembaga internasional ke Pusat Unggulan Iptek;</li>
<li>Minimal 20 publikasi ilmiah pertahun dalam jurnal ilmiah nasional terakreditasi;</li>
<li>Minimal 5 publikasi ilmiah pertahun dalam jurnal ilmiah internasional;</li>
<li>Minimal 1 paten terdaftar atau rezim HKI lainnya yang terkait teknologi (khusus untuk lembaga litbang yang telah ditetapkan sebagai Pusat Unggulan Iptek minimal 1 paten granted);</li>
<li>Minimal 2 lulusan S2/S3 per tahun berbasis riset;</li>
</ol>
<p class="Default"><strong>b. Komersialisasi dan Pemanfaatan Hasil Litbang (65%) </strong></p>
<ol>
<li>Minimal 3 kontrak riset pada tingkat nasional;</li>
<li>Minimal 1 kontrak riset pada tingkat internasional;</li>
<li>Minimal 15 kontrak (nonriset) yang terdiri dari: pelatihan, transfer teknologi, dan jasa konsultasi, baik dengan industri, masyarakat, ataupun pemerintah;</li>
<li>Minimal 1 produk berbasis sumberdaya lokal;</li>
<li>Minimal 1 produk yang dilisensikan dan atau dimanfaatkan nilainya oleh pengguna teknologi;</li>
<li>Minimal 1 kontrak bisnis dalam rangka komersialisasi produk hasil litbang dengan industri;</li>
<li>Minimal 1 unit bisnis yang melayani jasa sesuai dengan kompetensi inti lembaga.</li>
</ol>', '', 'Resume_Rapat_Tim_QC.pdf', 59, '2014-06-25 09:13:50.540401', 2, 9, 'Resume_Rapat_Tim_QC.pdf');
