<p>Pemodelan LSU-01 yang sudah dilakukan adalah pemodelan LSU-01 dengan teori first principle, identifikasi dan validasi persamaan keadaan menggunakan data dummy. Pada saat ini sedang memvalidasi persamaan keadaan menggunakan data hasil uji terbang. Data hasil uji terbang sangat banyak sehingga harus dipilih atau diseleksi yang sesuai dengan mode data masukan untuk uji terbang. Misal untuk masukan elevator mode 3-2-1-1 dan untuk aileron doublet dst.</p>
<p>Pemodelan LSU-05 Model persamaan keadaan LSU-05 dengan menggunakan teori first principle sudah didapat, identifikasi dan validasi persamaan menggunakan data dummy dengan mode masukan elevator 3-2-1-1 sudah dilakukan dan sudah diperoleh persamaan keadaan yang baru.</p>
<p>Selanjutnya kami menunggu data uji terbang LSU-05. Namun untuk memberi masukan ke sebuah plant maka plant tersebut harus sudah valid. Setahu saya untuk saat ini LSU-05 masih pengujian struktur, sehingga belum bisa dilakukan uji manuver untuk masukan tersebut. Jika struktur sudah valid maka tim Pemodelan perlu data-data masukan untuk surface control dengan mode sesuai dengan SOP uji terbang.</p>
<p>Begitulah berita singkat dari tim pemodelan LSU</p>', '', '', 58, '2015-07-02 08:04:48.001829', 2, 29, '');
