<p align="JUSTIFY"><span style="font-size: medium;"><em>Quality control </em></span><span style="font-family: Times New Roman,Times New Roman; font-size: medium;"><span style="font-family: Times New Roman,Times New Roman; font-size: medium;">merupakan salah satu tahap rangkaian kegiatan yang memegang peranan penting dalam riset dan rekayasa teknologi pesawat terbang. Pada tahap ini seluruh hasil riset dan rekayasa akan dinilai keabsahannya berdasarkan kaidah-kaidah ilmiah maupun standar mutu yang telah ditentukan. Hal ini dilakukan untuk mendapatkan hasil yang andal dan dapat mencegah terjadinya kegagalan pada tahap berikutnya baik yang disebabkan oleh faktor manusia, alat, bahan, maupun yang lain, sehingga tujuan atau misi pesawat terbang diharapkan dapat tercapai dengan sebaik-baiknya </span></span></p>
