<p>Atik Bintoro, Dede Rachmat, 2013:</p>
<p><span style="font-size: medium;">Pesawat nir awak LSU05 akan menjelajah sejauh 240 km, dengan tinggi jelajah dan lokasi yang relatif berbeda. Sistem propulsi motor bakar piston yang akan digunakan sebagai pembangkit tenaganya, perlu ditambahkan perangkat </span><em><span style="font-family: Times New Roman,Times New Roman; font-size: medium;"><span style="font-family: Times New Roman,Times New Roman; font-size: medium;">Electronic Fuel Injection (EFI) </span></span></em><span style="font-size: medium;">untuk mengendalikan kelangsungan pembakaran bahan bakar. Melalui metode analitis dan </span><em><span style="font-family: Times New Roman,Times New Roman; font-size: medium;"><span style="font-family: Times New Roman,Times New Roman; font-size: medium;">trade of </span></span></em><span style="font-size: medium;">diketahui bahwa perangkat </span><em><span style="font-family: Times New Roman,Times New Roman; font-size: medium;"><span style="font-family: Times New Roman,Times New Roman; font-size: medium;">EFI </span></span></em><span style="font-size: medium;">yang akan digunakan perlu berisi sensor dan aktuator yang terdiri dari sensor : temperatur, tekanan, kelembaban, dan kadar oksigen. Sedangkan aktuator dipakai untuk mengatur pompa stabilitas pasokan bahan bakar, oksigen, dan panas ruang bakar. Sehingga kemampuan torsi mesin 15 Nm pada putaran 6100 rpm, dapat terjaga untuk mengangkat berat pesawat 700 N, dengan baling-baling berdiameter 40 cm untuk torsi sebesar 12,7 Nm, serta putaran mesin 5600 rpm, dengan beban 700 N, diperlukan baling-baling berdiameter 34 cm. </span></p>', '', '07_01_Laporan_Karakteristik_propulsi_LSU05.pdf', 84, '2015-03-30 15:19:49.753136', 2, 27, '07_01_Laporan_Karakteristik_propulsi_LSU05.pdf');
