dan maksimal serta permintaan akan LSU 01 dapat dipenuhi untuk setiap misi', 'Jajang_Logbook_2016.pdf', 1, NULL, 3, 2016, '2016-03-07 09:26:52.822442', 1, 'Jajang_Logbook_2016.pdf', 1, 0);
<p>Lebih khusus lagi laporan ini akan membahas bagian keefektifan dari elevator. Gerakan elevator pada eksperimen 179 ini memiliki data defleksi yang cukup terbatas antara 0 dan -30, variasi flap 0, 10, 18, 30 dan 40. Khusus elevator efektiveness analisa dilakukan pada alpha-run karena hanya menyangkut gerakan longitudinal saja. Gerakan elevator akan menghasilkan moment pitch yang mampu untuk memberikan manuver gerakan pitch pada N219, oleh karena itu akan dianalisa apakah perubahan defleksi elevator ini akan menghasilkan perubahan nilai CM apa tidak.&nbsp;</p>
<p style="text-align: left;" align="right"><strong>&nbsp;</strong></p>', 'LAPORAN_analisa_efektifitas_elevator_eksperimen_179.pdf', 2, NULL, 6, 2014, '2014-06-27 08:35:39.815756', 1, 'LAPORAN_analisa_efektifitas_elevator_eksperimen_179.pdf', 1, 0);
<p>Pergerakan dari pesawat dipengaruhi oleh gaya dorong dari motor dan propeler, gaya hambat pesawat, gaya angkat, gaya gravitasi bumi, dan gaya akibat perubahan permukaan dari bidang kendali pesawat seperti elevator, rudder, aeleron dan flap. Selain itu lingkungan memberikan gangguan terhadap kesetimbangan pesawat seperti perubahan arah angin, perubahan ketinggian dan densitas udara.</p>
<p>Dalam rangka membangun sistem kendali yang cukup robust terhadap berbagai situasi yang dialami oleh pesawat perlu diturunkan persamaan gerak dinamika terbang pesawat. Secara analitik pergerakan pesawat disederhanakan ke dalam dua mode pergerakan yaitu longitudinal dan lateral. Setiap bentuk pesawat memiliki persamaan keadaanya yang khusus untuknya, dalam laporan kegiatan ini akan diambil salah satu pesawat nir awak yang telah dipakai oleh Pustekbang dalam beberapa misinya yaitu pesawat nir awak LSU 01.</p>', 'laporan_teknis_penurunan_persamaan_gerak_longitudinal_LSU_01.pdf', 2, NULL, 6, 2014, '2014-06-18 11:50:31.272117', 1, 'laporan_teknis_penurunan_persamaan_gerak_longitudinal_LSU_01.pdf', 1, 0);
