<p>LAPAN sebagai lembaga penelitian yang bergerak dibidang penerbangan dan antariksa memiliki kualifikasi yang memadai untuk turut mengembangkan dan menambah keragaman spesies pesawat tanpa awak. Oleh karena itu LAPAN diharapkan dapat memunculkan sebuah rancangan pesawat tanpa awak yang dibutuhkan. Dalam hal ini kebutuhan yang dimaksud adalah sebuah <em>platform</em> ringan tanpa awak yang misinya berupa kegiatam penelitian, observasi, patrol, pengawasan, dan <em>SAR</em>.</p>
<p>Secara khusus, pesawat ringan tanpa awak ini akan digunakan sebagai platform Synthetic Aperature Radar.</p>', 'TD_-_Group_Leader_Configuration.pdf', 1, NULL, 7, 2014, '2014-07-01 08:56:41.076539', 1, 'TD_-_Group_Leader_Configuration.pdf', 1, 0);
