<p style="text-align: justify;">Pengujian ini dilakukan untuk mengamati efek dari posisi HTP @ &alpha; run dengan beberapa variasi flap pada pesawat N219 dengan variasi flap. Variasi flap yang digunakan adalah pada sudut 0, 10, 18, 30 dan 40</p>
<ul>
<li style="text-align: justify;">Efek Ekor Vertikal</li>
</ul>
<p style="text-align: justify;">Ekor vertikal terletak di bagian belakang badan pesawat. Ekor vertikal ini berfungsi sebagai stabilitas arah vertikal akibat gangguan dari samping. Dalam pengujian di terowongan angin ini perlu dilakukan untuk mengetahui pengaruh ekor vertikal terhadap angin dari samping dengan melihat perubahan defleksi flap. Dari hasil terowongan angin terlihat bahwa efek ekor vertikal berpengaruh pada koefisien gaya dan momen. Dimana dengan bertambahnya defleksi flap koefisien gaya angkat (CL), koefisien gaya hambat (CD) dan momen pitching (CM) akan bertambah.</p>
<p>&nbsp;</p>', '1412130946_TN_TOT_N219_AERODINAMIKA_-_Pengolahan_Data_Uji_Terowongan_Angin_EXP#180_(Efek_HTP_&_VTP).pdf', 2, NULL, 7, 2014, '2014-07-07 12:03:37.798166', 1, '1412130946_TN_TOT_N219_AERODINAMIKA_-_Pengolahan_Data_Uji_Terowongan_Angin_EXP#180_(Efek_HTP_&_VTP).pdf', 1, 0);
