<p class="p3">Telah diselenggarakan Technical Meeting on Progress Pengembangan Pesawat Transport N219 pada tanggal 30 Mei 2014 di Kantor Lapan Pusat, Rawamangun Jakarta. Adapun susunan acara yaitu pemaparan progress yang sudah dilakukan oleh PT DI. Materi pemaparan meliputi Aerodinamika, Struktur Desain, Struktur Analisis, Sistem Analisis, Sistem Desain, Sertifikasi, Konfigurasi Manajemen, Produksi, dan Engineering Flight Simulator. Technical Meeting ini merupakan laporan progress yang pertama pada tahun 2014. Diharapkan setelah Technical Meeting ini berlangsung, semua jadwal dapat berjalan sesuai rencana.&nbsp;</p>', '1420613273_NOTULENSI_TECH.MEETING_sesi_2.pdf', 3, NULL, 7, 2014, '2014-07-18 10:27:10.486973', 1, '1420613273_NOTULENSI_TECH.MEETING_sesi_2.pdf', 1, 0);
<p>Pengujian model wind tunnel dilakukan di LAGG &ndash; BPPT di serpong, untuk pengujian power off dilakukan dalam beberapa polar. Model pesawat N219 untuk pengujian wind tunnel dibuat dengan skal 1:6,3.</p>
<p>Sebelum dilakukan analisa terhadap hasil dari pengujian Wind Tunnel, maka dilakukan dahulu pengambilan data/ploting dari data-data hasil pengujian dengan menggunakan software yang dibuat sendiri oleh PT Dirgantara Indonesia (Persero) untuk memudahkan para engineer mengambil data hasil pengujian.</p>
<p>Kemudian data yang diambil disusun dalam sebuah laporan dan baru dilakukan analisisnya.</p>
<p>Objektif dari serangkaian pengujian ini adalah untuk memvalidasi dan menginvestigasi pengaruh dari :</p>
<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Modifikasi dari wing body fairing (C4)</p>
<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Modifikasi dari nacelle(N4)</p>
<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Modifikasi dari gondola dan landing gear fairing (G3)</p>
<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Modifikasi dari landing gear (L3)</p>
<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Posisi dari Mid Tail Plane (H61 H62 H63)</p>', 'TN_Juni_-_Nugroho_Agung_Prasetyo.pdf', 1, NULL, 8, 2014, '2014-08-28 09:17:51.944403', 1, 'TN_Juni_-_Nugroho_Agung_Prasetyo.pdf', 1, 0);
<p>Avionik adalah peralatan elektronik penerbangan yang mencakup seluruh sistem elektronik yang dirancang untuk digunakan di pesawat terbang. Sistem Avionik yang akan digunakan tersebut harus sesuai dengan fungsi dan jenis pesawat yang akan dibuat, sehingga dari tipe pesawat tersebut dan regulasi yang diperuntukkan untuk tipe pesawat tersebut maka dapat diketahui komponen avionik apa saja yang akan dipasang pada pesawat yang akan dikembangkan.&nbsp; &nbsp;</p>', '1412213176_Laporan_Avionik_-_Yanuar_-_Maret.pdf', 1, NULL, 8, 2014, '2014-08-27 13:10:10.790526', 1, '1412213176_Laporan_Avionik_-_Yanuar_-_Maret.pdf', 1, 0);
