<p>Semua hasil pengujian yang diperoleh berupa koefisien aerodinamika non dimensional, dimana pengujian dilakukan untuk mengetahui efek &ndash; efek dari masing &ndash; masing konfigurasi. Dalam hal ini akan difokuskan untuk memperoleh efek gaya dan momen aerodinamik dari karakteristik ekor terhadap perubahan defleksi flap dengan memvariasikan sudut alpha.</p>
<p>Hasil pengujian menunjukkan efek karakteristik ekor terhadap perubahan defleksi flap berpengaruh pada karakteristik stabilitas yaitu untuk kondisi rolling, yawing dan pitching momen. Untuk efek downwash dengan memvariasikan sudut pasang horizontal tail maka yang berpengaruh adalah karakteristik aerodinamik dan stabilitas. Dilihat dari koefisien gaya angkat (lift) dengan posisi sudut pasang positif akan lebih bertambah dari sudut pasang nol derajat.</p>', '1412228371_Laporan_April_{Pengolahan_data_WTT_EXP_180}_[Dana_Herdiana,_Aerodinamika]_v1.pdf', 3, NULL, 7, 2014, '2014-07-01 08:30:22.963413', 1, '1412228371_Laporan_April_{Pengolahan_data_WTT_EXP_180}_[Dana_Herdiana,_Aerodinamika]_v1.pdf', 1, 0);
<p>Dalam melaksanakan setiap misi terbang diperlukan suatu sistem Avionik dan TTC (<em>Telemetry Telecomand dan Communication</em>) yang handal. Sistem tersebut tidak lapas dari teknologi RF (Radio Frekuensi) dan kontrol untuk autopilot &nbsp;karena UAV yang digunakan adalah bergerak dengan jangkauan tertentu, maka data-data yang dikirimkan dan diterima dari UAV ke ground control station atau sebaliknya harus menggunakan teknologi tanpa kabel, sehingga peran Radio Frekuensi ini muncul. Jangkauan sistem TTC long range sangat diperlukan untuk mengkover misi terbang dari LSU yang semakin jauh, selain itu diperlukan juga suatu GCS mobile yang dapat selalu siap digunakan kapan saja dengan support sistem yang terintegrasi baik itu untuk sistem TTC maupun pengolahan data payload</p>', 'Sistem_Avionik_LSU-05-Revisi.pdf', 2, NULL, 10, 2014, '2014-10-03 11:07:57.937617', 1, 'Sistem_Avionik_LSU-05-Revisi.pdf', 1, 0);
<p class="p0">Dalam&nbsp;uji&nbsp;terbang&nbsp;semua&nbsp;data-data&nbsp;sangat&nbsp;dibutuhkan,&nbsp;maka&nbsp;seorang&nbsp;flight&nbsp;test&nbsp;engineer&nbsp;perlu&nbsp;merancang&nbsp;bagaimana&nbsp;proses&nbsp;uji&nbsp;terbang&nbsp;tersebut&nbsp;dilaksanakan.&nbsp;Untuk&nbsp;pesawat&nbsp;terbang&nbsp;tanpa&nbsp;awak&nbsp;semua&nbsp;data-data&nbsp;yang&nbsp;didapat&nbsp;dari&nbsp;uji&nbsp;terbang&nbsp;harus&nbsp;dapat&nbsp;dimonitor&nbsp;oleh&nbsp;GCS&nbsp;(Ground&nbsp;Control&nbsp;System)&nbsp;di&nbsp;darat,&nbsp;untuk&nbsp;itu&nbsp;diperlukan&nbsp;suatu&nbsp;sistem&nbsp;komunikasi&nbsp;yang&nbsp;baik&nbsp;antara&nbsp;pesawat&nbsp;terbang&nbsp;tanpa&nbsp;awak&nbsp;dan&nbsp;GCS&nbsp;sehingga&nbsp;tidak&nbsp;terjadi&nbsp;adanya&nbsp;loss&nbsp;communication&nbsp;diantara&nbsp;keduanya.</p>', 'TN_Flight_Test.pdf', 1, NULL, 10, 2014, '2014-10-13 07:45:16.978219', 1, 'TN_Flight_Test.pdf', 1, 0);
