<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Sasaran dari Ilmu Mekanika Terbang ini adalah menetapkan karakteristik gerakan pesawat terbang terhadap titik massanya serta gerakan titik massa tersebut sepanjang lintas terbangnya. Kemudian merancang bagaimana memandu dan mengendalikan gerak pesawat terbang agar sesuai dengan keinginan rancang bangun dan operasional. Oleh sebab itu disiplin ini disebut The Motion of Flight atau Gerakan Terbang.</p>
<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Disiplin keilmuan dalam Mekanika Terbang terdiri dari sub disiplin : prestasi terbang, dinamika terbang, kendali terbang, serta navigasi dan panduan terbang. Prestasi terbang membahas gerak atau karakteristik pesawat pada lintas terbangnya. Dinamika terbang membahas karakteristik pergerakan atau perubahan sikap terbang pesawat relatif terhadap titik pusat massanya (Center of Gravity). Kendali terbang membahas tentang penstabilan, pengaturan sikap dan pemanduan pesawat. Sedangkan navigasi dan panduan terbang adalah perintah panduan dari navigator dan pemandu pesawat agar menghasilkan prestasi terbang yang diinginkan.&nbsp;&nbsp;</p>', 'TN_1_GCS.pdf', 1, NULL, 12, 2014, '2014-12-31 10:24:01.052744', 1, 'TN_1_GCS.pdf', 1, 0);
