<p class="p0">Dalam&nbsp;uji&nbsp;terbang&nbsp;semua&nbsp;data-data&nbsp;sangat&nbsp;dibutuhkan,&nbsp;maka&nbsp;seorang&nbsp;flight&nbsp;test&nbsp;engineer&nbsp;perlu&nbsp;merancang&nbsp;bagaimana&nbsp;proses&nbsp;uji&nbsp;terbang&nbsp;tersebut&nbsp;dilaksanakan.&nbsp;Untuk&nbsp;pesawat&nbsp;terbang&nbsp;tanpa&nbsp;awak&nbsp;semua&nbsp;data-data&nbsp;yang&nbsp;didapat&nbsp;dari&nbsp;uji&nbsp;terbang&nbsp;harus&nbsp;dapat&nbsp;dimonitor&nbsp;oleh&nbsp;GCS&nbsp;(Ground&nbsp;Control&nbsp;System)&nbsp;di&nbsp;darat,&nbsp;untuk&nbsp;itu&nbsp;diperlukan&nbsp;suatu&nbsp;sistem&nbsp;komunikasi&nbsp;yang&nbsp;baik&nbsp;antara&nbsp;pesawat&nbsp;terbang&nbsp;tanpa&nbsp;awak&nbsp;dan&nbsp;GCS&nbsp;sehingga&nbsp;tidak&nbsp;terjadi&nbsp;adanya&nbsp;loss&nbsp;communication&nbsp;diantara&nbsp;keduanya</p>', 'TN_Flight_Test_LSU-01.pdf', 1, NULL, 1, 2015, '2015-01-09 13:20:38.251067', 1, 'TN_Flight_Test_LSU-01.pdf', 1, 0);
<p>Pesawat yang diujikan adalah LSU-01 Skywalker 1900mm dan LSU-01 Skywalker 1900 FPV Glider EPO 1900mm. Perbedaan dari yang LSU-01 Skywalker 1900mm dengan yang tipe Glider ada di wing tip, untuk yang tipe glider EPO memiliki wing tip</p>', 'TN_Gunung_Merapi.pdf', 2, NULL, 1, 2015, '2015-01-09 13:24:21.835626', 1, 'TN_Gunung_Merapi.pdf', 1, 0);
<p>Dalam uji terbang semua data-data sangat dibutuhkan, maka seorang flight test engineer perlu merancang bagaimana proses uji terbang tersebut dilaksanakan. Untuk pesawat terbang tanpa awak semua data-data yang didapat dari uji terbang harus dapat dimonitor oleh GCS (Ground Control System) di darat, untuk itu diperlukan suatu sistem komunikasi yang baik antara pesawat terbang tanpa awak dan GCS sehingga tidak terjadi adanya loss communication diantara keduanya. Konfigurasi yang telah didesain akan diuji disini apakah dapat berjalan dengan baik atau tidak</p>', 'TD_First_Flight_Test_LSU-05.pdf', 3, NULL, 1, 2015, '2015-01-09 13:32:42.842702', 1, 'TD_First_Flight_Test_LSU-05.pdf', 1, 0);
<p>Pembahasan&nbsp; pada laporan ini yaitu membahas mengenai <em>Propeller Performance</em> yaitu kemampuan <em>propeller</em> untuk beroperasi pada ketinggian dan kecepatan pesawat pada saat terbang. Juga melakukan perhitungan <em>thrust</em> (gaya dorong) dengan membuat program perhitungan dengan propeller yang akan digunakan untuk pesawat N219 yaitu propeller dari Hartzell.</p>', 'Propulsion_Report_Awang_Rahmadi_Juli.pdf', 6, NULL, 1, 2015, '2015-01-09 17:02:30.244656', 1, 'Propulsion_Report_Awang_Rahmadi_Juli.pdf', 1, 0);

Dengan dilakukannya analisis beban aerodinamika, dapat diperoleh besarnya beban yang terjadi pada sayap tersebut untuk tiap bagiannya. Sehingga, dapat diperoleh distribusi beban yang selanjutnya dapat digunakan untuk mengoptimalkan design struktur dari sayap pesawat LSU-03.

Pada laporan ini akan dilakukan analisis beban aerodinamika pesawat LSU-03 dengan metode CFD. Sehingga dapat diperoleh distribusi beban yang terjadi pada sayap tersebut, yang selanjutnya akan digunakan untuk mengoptimasi design struktur dari sayap LSU-03.
', 'WP312_TN3.pdf', 1, NULL, 8, 2015, '2015-08-31 09:00:44.597142', 1, 'WP312_TN3.pdf', 1, 0);
<p>Propeller yang berputar akan menghasilkan beban aerodinamik dan giroskopik yang ditransfer ke struktur pesawat melalui poros <em>propeller</em>, bantalan, casing dan dudukan (<em>mounts</em>). Momen aerodinamik propeller disebabkan oleh perbedaan beban gaya dorong bilah <em>propeller</em>. Beban gaya dorong bilah bervariasi sebagai akibat dari sumbu kemiringan gaya dorong <em>propeller</em> dan/atau asimetri bidang aliran dimana <em>propeller</em> beroperasi. Momen disebabkan oleh perbedaan gaya dorong bilah yang selalu disertai dengan gaya segaris yang diberikan oleh perbedaan gaya hambat bilah.&nbsp;</p>', 'Propulsion_Report_Awang_Rahmadi_Oktober.pdf', 8, NULL, 1, 2015, '2015-01-27 08:02:01.658229', 1, 'Propulsion_Report_Awang_Rahmadi_Oktober.pdf', 1, 0);
