<p><strong>ABSTRAK </strong></p>
<p>Kestabilan gerak sebuah wahan terbang dapat diketahui dari letak pole-zero persamaan keadaan (<em>state space</em>). Dari analisis letak akar karakteristik (<em>pole</em>) diketahu bahwa LSU-01 mempunyai karakteristik stabil statis dan dinamik. Dilakukan validasi persamaan keadaan menggunakan <em>indentification system toolbox</em> Matlab untuk mendapatkan hasil yang sesuai dengan kenyataan. Terdapat dua masukan yang bisa digunakan untuk validasi persamaan keadaan yaitu data ditentukan (<em>dummy</em>) atau input data hasil uji terbang. Hasil analisis menggunakan data <em>dummy</em> diketahui bahwa validitas elemen-elemen matrik keadaan diatas 90 persen. Dari hasil yang didapat bisa dikatakan bahwa pembangunan program untuk identifikasi parameter cukup baik dan hasil yang diperoleh dapat digunakan sebagai acuan perancangan sistem kendali.</p>
<p>&nbsp;</p>
<p>Kata kunci : sistem identifikasi toolbox, longitudinal, lateral-direksional</p>
<p><strong><em>&nbsp;</em></strong></p>', 'EkoBP_Validasi_Persamaan_Keadaan_LSU-01_Menggunakan_Toolbox_Sistem_Identifikasi_Matlab_rev.pdf', 0, NULL, 3, 2015, '2015-03-06 15:35:35.652884', 2, 'EkoBP_Validasi_Persamaan_Keadaan_LSU-01_Menggunakan_Toolbox_Sistem_Identifikasi_Matlab_rev.pdf', 1, 0);
