<p>Metode yang dilakukan dalam kegiatan litbangyasa <em>hardware embedded system</em> ini adalah dengan cara <em>reverse engineering</em> terhadap sistem APM (Ardupilot Mega) yang terbukti mampu, praktis dan handal dalam melakukan misi kendali terbang dan autopilot LSU selama ini. Sistem <em>Embedded</em> APM karena sifatnya yang <em>Open Source</em> sudah mengalami perkembangan yang sangat pesat, dalam litbangyasa ini mengacu pada sistem <strong>APM versi 2.5</strong> sebagai ukuran dan komparasi hasil capaian nantinya.</p>
<p>Target yang ingin dicapai dalam tahun ini adalah fungsionalitas hasil rancangan sama dengan <em>hardware</em> APM2.5 dan belum memperhitungkan <em>Compactibilitas</em>, oleh karena itu rancangan yang dilakukan adalah merancang <em>hardware</em> secara modular.</p>', 'TN001HardwareEmbedded_rev1.pdf', 1, NULL, 3, 2015, '2015-03-16 15:38:47.683035', 1, 'TN001HardwareEmbedded_rev1.pdf', 1, 0);
<p>Dalam melaksanakan setiap misi terbang diperlukan suatu sistem Avionik dan TTC (<em>Telemetry Telecomand dan Communication</em>) yang handal. Sistem tersebut tidak lapas dari teknologi Data link communication atau jalur komunikasi tanpa kabel dan kontrol untuk autopilot&nbsp; karena UAV yang digunakan adalah bergerak dengan jangkauan tertentu, maka data-data yang dikirimkan dan diterima dari UAV ke ground control station atau sebaliknya harus menggunakan teknologi tanpa kabel, sehingga peran Radio Frekuensi ini muncul. Jangkauan sistem TTC long range sangat diperlukan untuk mengkover misi terbang dari LSU yang semakin jauh, selain itu diperlukan juga suatu GCS mobile yang dapat selalu siap digunakan kapan saja dengan support sistem yang terintegrasi baik itu untuk sistem TTC maupun pengolahan data payload</p>', 'TD_Data_Link_Comm.pdf', 1, NULL, 3, 2015, '2015-03-25 15:33:37.997572', 1, 'TD_Data_Link_Comm.pdf', 1, 0);
