terbang yang masuk dalam kategori main internal power pada system kelistrikan pesawat. Dengan demikian sistem pembangkit listrik (generator) pada pesawat harus mampu memberikan supply energi listrik secara continus dan normal sesuai standard yang telah ditentukan, karena menjadi standard keselamatanpenerbangan.Kegiatan yang dilakukan dalam analysis power generating system pesawat transport nasional adalah melakukan analysis system Integrated engine generator(IEG) untuk pesawat terbang.', 'Laporan_N219_(2).pdf', 2, NULL, 5, 2015, '2015-05-04 11:35:43.262687', 1, 'Laporan_N219_(2).pdf', 1, 0);
Tactical Vehicle tipe LSU-05. Dalam Technical Note 2 dilaporkan tentang technical drawing wiring system flight control circuit yang digunakan untuk memudahkan proses instalasi system kelistrikan pada pesawat LSU 05.Flight Control Circuit adalah line distribusi daya listrik yang berfungsimensupply arus listrik ke semua actuator flight control yang terpasang pada pesawat. System kelistrikan flight control circuit pesawat LSU 05 dirancang menggunakan sistem tegangan arus searah (DC) 12 Volt karena semua komponen/ beban yang terpasang pada pesawat baik berupa instrument avionik, dan actuator menggunakan tegangan 12 volt (dc).', 'Laporan_Lsu_05_(2).pdf', 2, NULL, 5, 2015, '2015-05-04 11:53:21.52508', 1, 'Laporan_Lsu_05_(2).pdf', 1, 0);
Surveillance Tactical Vehicle tipe LSU 02/03. Dalam Technical Note 2 dilaporkan tentang analisis dc power supply untuk flight control system LSU 02/03. Actuator adalah penggerak bidang kendali terbang pesawat ( flight control system ) berupa motor servo. Sistem kelistrikan pada bidang kendali pesawat LSU 02/03 dirancang menggunakan sistem tegangan arus searah (DC) 12 Volt karena semua bebanyang terpasang pada pesawat berupa actuator (servo) menggunakan tegangan 12 vdc. Sistem bidang kendali (flight control system) yang terinstal pada LSU 02/03 terdiri dari servo elevator, rudder, aileron, throttle dan landing gear.Kegiatan yang dilakukan dalam analysis dc power supply flight control system LSU 02/03 adalah membuat schematic drawing untuk instalasi actuator bidang kendali yang memperlihatkan diagram
lingkaran arus dari sebuah rangkaian listrik (circuit)yang terpasang dipesawat.', 'Laporan_Lsu_02-03_(2).pdf', 2, NULL, 5, 2015, '2015-05-04 12:04:11.160878', 1, 'Laporan_Lsu_02-03_(2).pdf', 1, 0);
