Pusat Teknologi Penerbangan Khususnya Bidang Teknologi Aerostruktur, merupakan pusat baru dan bidang baru yang mempunyai tugas pokok dan fungsi yang baru dalam dunia penerbangan (baik pesawat berawak maupun pesawat tanpa awak). Padahal untuk menerbangkan suatu wahana tanpa awak beserta seluruh sistemnya, diperlukan beberapa persyaratan uji kelayakan bagi seluruh sistem wahana tersebut. Uji kelayakan tersebut dilakukan untuk mengetahui kehandalan seluruh sistem terhadap pengaruh-pengaruh lingkungan internal maupun eksternal dengan pengukuran-pengukuran yang dilakukan secara simultan. Oleh karena itu diperlukan suatu studi awal untuk menguasai permasalahan yang terkait dengan metodologi dan teknik pengujian getaran struktur pesawat UAV tersebut. Techninac Report ini merupakan studi literatur yang diambil dari beberapa sumber (tulisan para pakar yang sudah ahli dalam bidangnya) yang menjelaskan rincian penyelidikan secara eksperimental suatu pesawat tanpa awak (UAV) yang terbuat dari bahan komposit super ringan.', 'TR3.pdf', 5, NULL, 5, 2015, '2015-05-28 11:29:50.636414', 1, 'TR3.pdf', 1, 0);
