Tujuan operasional diturunkan dari tujuan dan rencana taktis. Rencana operasional lebih sempit dengan jangka waktu yang lebih pendek dan banyak melibatkan manajemen tingkat bawah. Rencana Tunggal untuk aktivitas tidak berulang, contoh: program, proyek, dan anggaran.Rencana Standing untuk aktivitas yang berulang, contoh: kebijakan, prosedur standar, dan aturan.
Langkah-Langkah Membuat Rencana Operasional
Perencanaan operasional umumnya merupakan turunan, terjemahan dari tujuan umum satker dalam rentang waktu tertentu (selama satu tahun) berikut rencana strategis yang sudah ditetapkan oleh manajemen. Walau demikian perencanaan operasional dapat juga digunakan oleh individu untuk keperluan pribadinya, bahkan dianjurkan agar pekerjaannya terarah dan terorganisir dengan baik.

