INSERT INTO berita VALUES (37, 'Petunjuk teknis perekayasaan 2013', '<p>Berikut kami lampirkan petunjuk teknis perekayasaan agar dijadikan acuan dalam melaksanakan kegiatan litbangyasa di Pustekbang 2015.</p>', '', '6._JUKNIS_PEREKAYASA_rev_2013.pdf', 56, '2015-03-26 08:03:44.779331', 2, 25, '6._JUKNIS_PEREKAYASA_rev_2013.pdf');
INSERT INTO berita VALUES (38, 'Petunjuk teknis perekayasaan 2013', '<p>Kami kirimkan Juknis Perekayasaan, agar dapat dijadikan acuan dalam melaksanakan kegiatan di Program Diseminasi LSU Pustekbang 2015.</p>', '', '6._JUKNIS_PEREKAYASA_rev_2013.pdf', 59, '2015-03-26 08:10:38.361583', 2, 26, '6._JUKNIS_PEREKAYASA_rev_2013.pdf');
INSERT INTO berita VALUES (39, 'PEMBINAAN PENELITIAN DAN PENULISAN KTI', '<p><span style="font-family: Times New Roman; font-size: medium;">Karya hasil litbang telah banyak dimiliki oleh Pusat Teknologi Penerbangan (Pustekbang), Lembaga Penerbangan dan Antariksa Nasional (LAPAN), diantaranya meliputi mulai dari disain engineering sampai dengan prototip teknologi pesawat terbang. Tentunya hasil litbang ini perlu didokumentasikan dan dipublikasikan ke masyarakat, baik ke masyarakat umum maupun ke masyarakat ilmiah, salah satunya dalam bentuk Karya Tulis Ilmiah hasil litbang (KTI). Untuk mendapatkan jumlah maupun kualitas KTI yang diperlukan masyarakat ilmiah, minimal harus memenuhi syarat ilmiah, yaitu Logis, obyektif, sistematis, andal tak terbantah, dirancang, dapat dibuktikan kembali, dan mempunyai kontribusi dalam pengembangan iptek pesawat terbang. Oleh karena itu untuk memenuhi hal ini diperlukan pembinaan penelitian dan penulisan KTI hasil litbang di lingkungan Pustekbang. </span></p>', '', 'Pembinaan_peneliti.pdf', 84, '2015-03-30 15:01:29.978241', 2, 27, 'Pembinaan_peneliti.pdf');
