INSERT INTO berita VALUES (40, 'INFLUENCE OF DYNAMIC LOAD', '<p><span style="font-size: medium;"><span style="font-family: Times New Roman;">LSU03 UAV is Unmanned Aerial Vehicle series from research program of Lembaga Penerbangan dan Antariksa Nasional (LAPAN) which Indonesian Institute Nation of Space and Aeronautic. This research programs are like i.e.: aerodynamic factor, aero structure, avionic, and propulsion technology. This UAV due to a flight vehicle which has not pilot in the body&rsquo;s and has mission as flight vehicle white GPS, camera or and others payload, but it&rsquo;s has autonomous control since flying vehicle or will be controlled by pilot in ground segment[1]. This vehicle has primary structure component like nose, wing span, and twin boom, which make this UAV can fulfill mission come true. Beside this, the LSU03 UAV has power propulsion resource due to piston engine, and it&lsquo;s makes to rotates propeller for find thrust and flying. The operation of LSU03 UAV has high cycle frequency of takeoff and landing for maintenance and or refueling [2]. Therefore this UAV must have a robust structure, primary support structure of wing span. Because, this structure can take dynamic load when comes to at first time in landing point. This dynamic load can be made this structure is damage before lifetime&rsquo;s. The damage structure by dynamic load can be prevented by used the robust structure of wing support structure. The structure like this can be made since design analysis and research activity about this. If the structure was given and excited, this wing support structure of LSU03 UAV necessary reanalysis about influence dynamic load for fulfill structure validation, before this vehicle will be flying tested. </span></span></p>', '', '02_Laporan_KTI_Bersama.pdf', 84, '2015-03-30 15:12:21.021671', 2, 27, '02_Laporan_KTI_Bersama.pdf');
