INSERT INTO note VALUES (16, 67, 'judul', '<p>Communication system on telemetry payload rocket competition has been built&nbsp; in order to transfer data between &nbsp;payload and the ground station. The transmitter and receiver frequencies were set up into 432.0325MHZ, 433.0325 MHZ, 434.0325 MHZ, and 435.0325 MHZ with their 20 dBm ouput power. Link budget analysis of this show that the system would have 33 km maximum distance communication with the link margin value was 18 dB which 99% communication availability. It is quite enough for payload rocket competition at pamengpeuk Garut West Java due to trajectory rocket predicted only as far as 1 km or below.</p>', 'siptekgankomurindoagushendra.pdf', 1, NULL, 6, 2014, '2014-06-18 11:47:52.376926', 1, 'siptekgankomurindoagushendra.pdf', 1, 0);
