INSERT INTO note VALUES (47, 26, 'Analisa Elevator Efektiveness Wind Tunnel Test Exp #179', '<p>Laporan kegiatan training on the job atau TOT N219 kali ini memasuki tahap analisa hasil uji terowongan model N219. Pada tahap analisa kegiatan dibagi menjadi analisa secara aerodinamika terkait koefesien drag dan Lift pada setiap part N219 seperti landing gear effect, elevator effect, aileron effect dan sebagainya serta analisa pada sisi stability dan kendali baik longitudinal dan lateral dari N219.&nbsp;</p>
INSERT INTO note VALUES (48, 67, 'Monitoring Bencana Banjir di Jakarta Menggunakan UAV', '<p>LSU 01 dapat digunakan sebagai wahana monitoring bencana seperti banjir di Jakarta pada tahun 2013. LSU 01 telah melakukan pemotretan udara pada lokasi banjir seperti kampung pulo dan pluit. Diharapkan ke depan wahana ini bisa lebih ditingkatkan penggunaannya bagi kesejahteraan dan keselamatan bangsa Indonesia di seluruh pelosok tanah air.</p>', 'paper_pemanfaatan_LSU_01_di_media_dirgantara.pdf', 3, NULL, 6, 2014, '2014-06-27 10:07:06.797104', 1, 'paper_pemanfaatan_LSU_01_di_media_dirgantara.pdf', 1, 0);
INSERT INTO note VALUES (51, 67, 'simulasi dan analisa autopilot longitudinal LSU 01 dengan simulink Matlab', '<p>telah dilakukan simulasi autopilot Longitudinal LSU 01 dengan simulink matlab dengan dua metode kendali loop tertutup. hasilnya dibandingkan dengan loop terbuka. menunjukkan kedua metode cukup efektif memperbaiki respon sistem menuju stabil, dan overshoot yang drastis turun.</p>', 'paper_Simulasi_autopilot_LSU_01.pdf', 4, NULL, 6, 2014, '2014-06-30 09:41:08.097386', 1, 'paper_Simulasi_autopilot_LSU_01.pdf', 1, 0);
