INSERT INTO note VALUES (17, 67, 'judul', '<p>Wahana terbang UAV menjadi topik penelitian yang cukup intensif di dunia seperti aspek kendali, desain struktur, sampai pada tahap implementasi baik untuk kebutuhan sipil maupun militer. Salah satu aspek penting dalam perancangan kendali adalah penurunan model persamaan gerak dinamika terbang UAV. Gerak UAV tidak terlepas dari hukum-hukum fisika yang telah baku seperti hukum newton dalam gerak yang mengalami percepatan.</p>
INSERT INTO note VALUES (18, 26, 'judul', '<p>Pengembangan pesawat baru N219 diperuntukkan bagi penerbangan dengan 19<br />penumpang, khususnya di daerah dengan landasan terbang /runway &plusmn;500 meter.<br />Pesawat ini sangat cocok untuk terbang di daerah perintis seperti daerah Indonesia<br />timur. Produksi pesawat ini akan melibatkan Pusat Teknologi Penerbangan sebagai<br />bagian dari penelitian dan pengembangan yang bekerjasama dengan PT<br />Dirgantara Indonesia.<br />Sebuah pesawat terbang akan melewati beberapa tahap/fase sebelum ia di<br />produksi yaitu konseptual desain, preeliminary desain, dan detail desain. Selain itu<br />perlu adanya kerjasama tim yang fokus untuk mendukung terlaksananya desain<br />seperti bidang konfigurasi, bidang performance, bidang stability dan kontrol, serta<br />bidang wind tunnel test eksperiment.<br />Setelah konfigurasi menentukan konfigurasi perlu dilakukan wind tunnel test pada<br />model pesawat yang akan dibuat untuk dianalisa apakah konfigurasi tersebut<br />sudah yang terbaik dari sisi stability dan performancenya. Data wind tunnel N219<br />pada eksperimen 179 dan 180 akan menjadi bahan kajian untuk laporan kegiatan<br />kali ini.</p>', 'laporan_1_TOT_N219_agus_hendra_wahyudi.pdf', 1, NULL, 6, 2014, '2014-06-18 11:54:38.673694', 1, 'laporan_1_TOT_N219_agus_hendra_wahyudi.pdf', 1, 0);
