INSERT INTO note VALUES (32, 270, 'judul', '<p>Teknologi Penerbangan LAPAN&nbsp; sebagai pusat baru akan melaksanakan kegiatan yang fokus pada berbagai kaitan dengan Teknologi Penerbangan, dengan cita2 menjadi centre of excellent aviation Indonesia. Untuk bisa mencapai cita2 tsb semua kegiatannya&nbsp; mendapatkan pengakuan dari lembaga sertifikasi dalam bidang penerbangan adalah dari organisasi rangcang bangun ( Design Organization Approval / DOA )&nbsp;</p>', 'Laporan_Diskusi_DOA_PTDI_-_Pustekbang_Lapan.pdf', 2, NULL, 6, 2014, '2014-06-19 15:21:32.757286', 1, 'Laporan_Diskusi_DOA_PTDI_-_Pustekbang_Lapan.pdf', 1, 0);
