INSERT INTO note VALUES (1168, 576, 'Pengolahan Database Visual Bandara dengan Raster XT 4', 'Bandara adalah salah satu komponen penting dalam dunia penerbangan. Didalam Enginering Flight simulator bandara juga tidak dapat ditinggalkan. Akan tetapi bandara dalam EFS bukan bandara sesungguhnya, melainkan bandara dalam bentuk sebuah database visual. Visual database ini memiliki perbedaan dibandingkan visual gambar pada umumnya. Karena berupa gambar yang terdeklarasi oleh variabel tertentu untuk diperintah bergerak atau sesuai kondisi oleh simulator. Pelatihan pembuatan database visual ini dilakukan oleh trainer resmi dari Presagis Raster XT 4 , California. PElatihan tersebut dilakukan di PT Dirgantara Indonesia selama 1  pekan.', 'tn1.pdf', 1, NULL, 8, 2015, '2015-08-14 09:26:41.454945', 1, 'tn1.pdf', 1, 0);
INSERT INTO note VALUES (58, 92, 'Laporan Tim Konfigurasi ', '<p>Kebutuhan terhadap pesawat ringan tanpa awak meningkatkan minat berbagai pihak untuk mengembangkan pesawat tanpa awak. Di Indonesia pengembangan pesawat tanpa awak masih dalam tahap awal kematangannya sehingga masih terdapat banyak ruang untuk berkembang. Beberapa pesawat tanpa awak yang telah ada masih memiliki batasan yang cukup signifikan dalam jangkauan terbang, <em>endurance</em> serta berat <em>payload</em> yang mampu dibawanya. Sehingga minat terhadap produk dalam negeri untuk keperluan sipil maupun militer dinilai masih kurang.</p>
INSERT INTO note VALUES (59, 35, 'Pembuatan Aileron Vane LE Rib 2, 3, 4 dan Aileron Vane Rib 2, 3, 4', '<p>Pada kegiatan di atas digunakan software catia V5R22 yang telah dilengkapi dengan feature Aerospace Sheet Metal Design sebagai alat bantu dalam merancang komponen / part yang akan digunakan pada pesawat N219 dalam hal ini adalah Aileron Vane LE Rib. Dimana part ini merupakan bagian dari flapron sebagi control surface dari wing.<br />Part ini mempunyai nomor L116ND50061-102 yang telah ditentukan sebelumnya oleh tim Structure Design.</p>', 'Laporan_ToT_N219_PT.DI_bulan_Maret.pdf', 1, NULL, 7, 2014, '2014-07-01 14:16:10.429643', 1, 'Laporan_ToT_N219_PT.DI_bulan_Maret.pdf', 1, 0);
