INSERT INTO note VALUES (53, 457, 'Pemilihan Engine dan Propeller Pesawat Nirawak LSU-05', '<p>Salah satu tahap penting dari Perancangan Pesawat Terbang baik dengan awak maupun nirawak adalah memilih <em>engine</em> yang akan digunakan, agar dapat memenuhi persyaratan yang telah ditentukan sebelumnya. Studi perbandingan <em>engine</em> yang tersedia di pasaran dilakukan untuk mendapatkan mesin yang tepat sesuai dengan kebutuhan dari <em>Design Requirements and Objectives</em> (DRO) suatu perancangan pesawat.</p>', '1412130895_Technical_Report_Engine_and_Propeller_Selection_LSU-05_rev1.pdf', 1, NULL, 7, 2014, '2014-07-01 08:19:58.832955', 1, '1412130895_Technical_Report_Engine_and_Propeller_Selection_LSU-05_rev1.pdf', 1, 0);
INSERT INTO note VALUES (54, 457, 'Uji Eksperimental Mesin Piston dan Propeller LSU-05', '<p><em><span lang="IN">Piston engine/ </span></em><span lang="IN">mesin piston merupakan mesin pendorong utama bagi macam-macam pesawat model maupun pesawat tanpa awak, yang menghasilkan gaya dorong oleh karena terjadi pembakaran pada ruang bakar menggunakan piston. Mesin piston yang diuji adalah mesin dengan kapasitas (<em>cc</em>) kecil. Prinsip kerja mesin sama seperti mesin mobil dan motor hanya untuk pesawat ini menggunakan <em>propeller</em> untuk mengasilkan gaya dorong.</span></p>
