INSERT INTO note VALUES (52, 309, 'Laporan TOT bulan maret', '<p>Kegiatan ToT ini dilaksanakan di PT DI dengan menspesialisasikan kepakaran masing-masing. Kepakaran tersebut bermacam-macam diantaranya adalah kepakaran untuk spesialisasi aerodinamika. Dalam spesialisasi aerodinamika hal yang perlu dipelajari adalah mengenal karakteristik aerodinamik dari pesawat yang dirancang. Untuk mengawali pengenalan tersebut maka kegiatan ToT diawali dengan mengenalkan Design Requirment and Objective (DR&amp;O) dari pesawat tersebut. Yang kemudian di lanjutkan dengan mengenal tahapan-tahapan performance. Kegiatan dalam bulan ini adalah mengenal DR&amp;O, fundamental aerodynamic, performance dan cara memploting data hasil terowongan angin.</p>', '1412228337_Laporan_Maret_[Dana_Herdiana,_Aerodinamika].pdf', 1, NULL, 7, 2014, '2014-07-01 07:58:17.318975', 1, '1412228337_Laporan_Maret_[Dana_Herdiana,_Aerodinamika].pdf', 1, 0);
INSERT INTO note VALUES (55, 309, 'Laporan TOT bulan April 1', '<p>Di Indonesian Low Speed Tunnel (ILST) telah dilakukan pengujian model pesawat N219 dengan skala 1 : 6,3 power off saja untuk exp 179. Pengujian dilakukan untuk memperoleh seluruh data &ndash; data gaya dan momen aerodinamik.</p>
