INSERT INTO note VALUES (60, 35, 'Pembuatan Aileron Vane Rib 2, 3, 4 Pembuatan part Aileron Upper Skin Vane Editing part Flap Vane LE Rib 3-12 dan Flap Vane Rib 3-12', '<p>Pada kegiatan di atas masih digunakan software catia V5R22 dimana pada pembuatan Aileron Vane Rib 2, 3, 4 melanjutkan kegiatan sebelumnya.<br />Untuk part Vane Upper Skin tidak digunakan feature aerospace sheet metal design jadi dalam pembuatan part ini ada feature :<br />1. Mechanical Design : Sketcher &ndash; Wireframe and Surface Design<br />2. Shape : Generative Shape Design<br />Sedangkan untuk Editing part Flap Vane LE Rib dan Flap Vane masih menggunakan feature aerospace sheet metal design.</p>', 'Laporan_ToT_N219_PT.DI_bulan_April_2014.pdf', 2, NULL, 7, 2014, '2014-07-01 14:17:27.833356', 1, 'Laporan_ToT_N219_PT.DI_bulan_April_2014.pdf', 1, 0);
