INSERT INTO note VALUES (83, 7, 'Laporan Training Terjun Bebas Olahraga (TBO) Febri', '<p>Dalam upaya meningkatkan kualitas SDM dalam hal ini Penerbang yang mampu mengoperasikan Emergency Parachute,&nbsp; maka dilaksanakanlah Training Terjun Bebas Olahraga (TBO) yang dilaksanakan di Pusdiklat Paskhas, Lanud Sulaiman, Bandung dari tanggal 16-25 Juni 2014. Training ini bertujuan agar Penerbang LAPAN mengetahui bagaimana cara kerja parasut dan menguasai teknik-teknik dasar penerjunan, sehingga memiliki pengetahuan yang cukup dalam melaksanakan tugas pokok dan fungsi sebagai seorang Penerbang yang nantinya akan diproyeksikan menjadi seorang Test Pilot.</p>', 'Laporan_Training_Terjun_Bebas_Olahraga_Febri.pdf', 1, NULL, 7, 2014, '2014-07-04 12:23:59.025942', 1, 'Laporan_Training_Terjun_Bebas_Olahraga_Febri.pdf', 1, 0);
INSERT INTO note VALUES (67, 324, 'Analisis Kekuatan Wing body fairing Pesawat N219', '<p>Struktur <em>wing body fairing </em>merupakan salah satu struktur komposit pada pesawat N219. Struktur ini berfungsi untuk menutupi celah antara badan dan sayap pesawat agar menghasilkan <em>drag </em>yang kecil. Oleh karena itu struktur ini dibuat sedemikian rupa untuk mendapatkan bentuk yang <em>smooth</em> dan aerodinamis. Sedangkan dalam proses manufakturnya, struktur ini akan dikerjakan secara <em>dry laminate</em> dengan menggunakan material <em>prepreg</em>.</p>
INSERT INTO note VALUES (61, 313, 'Analysis Electrical system', '<p>Pesawat N219 merupakan pesawat yang termasuk kedalam pesawat komuter yang menggunakan dua generator dalam operasinya untuk menghasilkan daya maksimum yang sesuai dengan kebutuhan daya pada saat pesawat beroperasi, sesuai dengan kelasnya maka requirement power elektrik direkomendasikan berdasarkan regulasi CASR part 23.</p>', '1412147403_Encung_Sumarna_Electrical_System-1.pdf', 1, NULL, 7, 2014, '2014-07-01 14:29:40.059768', 1, '1412147403_Encung_Sumarna_Electrical_System-1.pdf', 1, 0);
INSERT INTO note VALUES (62, 313, 'Electrical Power Generation and Distribution System', '<p style="text-align: justify;">Sistem tenaga listrik yang dibangkitkan oleh Generator DC melalui engine kiri (LHE)dan kanan (RHE) akan menghasilkan tenaga pada nominal 28 Volt DC untuk layanan umum, dengan cara dua mesin didorong starter generator. 115 Volt AC listrik akan disediakan untuk sirkuit tertentu melalui dua inverter statis, tetapi pada N219 tidak menggunakan power AC sehingga tidak membutuhkan inverter. Dengan listrik DC 28 300 Amphere dianggap sudah mencukupi.</p>', '1412147454_Encung_Sumarna_Electrical_System-2.pdf', 2, NULL, 7, 2014, '2014-07-01 14:34:04.641539', 1, '1412147454_Encung_Sumarna_Electrical_System-2.pdf', 1, 0);
INSERT INTO note VALUES (142, 349, 'Kerangka kerja pengembangan Embeded System autopilot secara mandiri', '', '1412148306_Kerangka_Kerja_Perancangan_dan_Pembuatan_Autopilot_Mandiri_berbasis_APM.pdf', 1, NULL, 7, 2014, '2014-07-08 09:22:07.414206', 1, '1412148306_Kerangka_Kerja_Perancangan_dan_Pembuatan_Autopilot_Mandiri_berbasis_APM.pdf', 1, 0);
INSERT INTO note VALUES (63, 313, 'Electrical Load Assesment and Power source Capacity', '<p style="text-align: justify;">Electrical Load Analysis (ELA) dan analysis power source capacity adalah untuk memperkirakan kapasitas sistem (termasuk sumber pembangkit, konverter, kontaktor, busbar dll) dibutuhkan untuk memasok kombinasi terburuk dari beban listrik. Hal ini dicapai dengan mengevaluasi permintaan rata-rata dan tuntutan maksimal di bawah semua kondisi penerbangan yang berlaku.</p>', '1412147478_Encung_Sumarna_Electrical_System-3.pdf', 3, NULL, 7, 2014, '2014-07-01 14:36:45.758079', 1, '1412147478_Encung_Sumarna_Electrical_System-3.pdf', 1, 0);
