INSERT INTO note VALUES (100, 309, 'Laporan bulan mei', '<p>Dalam pengolahan downwash ini, data diolah dari hasil pengujian terowongan angin yang berupa data kondisi pesawat tidak ada ekor, dan kondisi pesawat dengan ekor horizontal yang divariasikan sudut pasangnya. Variasi sudut pasang ekor horizontal yang diuji adalah -5, 0, dan 5 derajat terhadap sumbu x pesawat. Dari data &ndash; data tersebut dapat diperoleh besarnya sudut downwash yang diakibatkan oleh sayap terhadap ekor horizontal</p>', '1412228387_Laporan_Mei_-_Perhitungan_Downwash_[Dana_Herdiana,_Aerodinamika].pdf', 4, NULL, 7, 2014, '2014-07-07 12:13:15.948065', 1, '1412228387_Laporan_Mei_-_Perhitungan_Downwash_[Dana_Herdiana,_Aerodinamika].pdf', 1, 0);
