INSERT INTO note VALUES (102, 335, 'Propulsion_Report_Awang_Rahmadi_Maret', '<p>Di bidang bagian propulsi (<em>Propulsion System</em>) hal yang dipelajari terlebih dahulu yaitu dimulai dari desain proses yang mana dimulai dari <em>conceptual design</em> lalu <em>preliminery design</em> kemudian <em>detail design</em>. Pada <em>conceptual design</em> mengacu pada DR&amp;O (<em>Design Requirement and Objective</em>) dan CASR (<em>Civil Aviation Safety Regulation</em>) terutama CASR 23. Pembahasan lainnya yaitu mengenai <em>Engine Performance</em>. Pembahasan selanjutnya mengenai atmosfer (<em>Standard Atmosphere</em>). Juga membahas mengenai dasar-dasar <em>propeller</em>.</p>', '1412730832_Propulsion_Report_Awang_Rahmadi_Maret.pdf', 1, NULL, 7, 2014, '2014-07-07 12:21:02.600328', 1, '1412730832_Propulsion_Report_Awang_Rahmadi_Maret.pdf', 1, 0);
INSERT INTO note VALUES (104, 335, 'Propulsion_Report_Awang_Rahmadi_April', '<p>Salah satu komponen penting pada <em>engine</em> pesawat N-219 adalah <em>propeller</em>, mekanisme pergerakan <em>propeller</em> yang diterapkan pada pesawat ini menggunakan mekanisme <em>Constant Speed Propeller</em>. <em>Trade off Study Design Process</em> suatu tahapan yang harus dilalui dalam pembuatan pesawat. <em>Analysis performance</em> untuk <em>engine Pratt &amp; Whitney</em> jenis PT6A-42 dengan menggunakan <em>software</em> yang khusus untuk menghitung performansi mesin ini.</p>', '1412730964_Propulsion_Report_Awang_Rahmadi_April.pdf', 2, NULL, 7, 2014, '2014-07-07 12:22:28.60968', 1, '1412730964_Propulsion_Report_Awang_Rahmadi_April.pdf', 1, 0);
