INSERT INTO note VALUES (126, 330, 'Laporan Design Concept Lighting System_Maret', '<p>Lighting system pada N219 mencakup baik internal, eksternal dan emergency<br />lighting. Berdasarkan regulasi CASR ( Civil Aviation Safety Regulation ) Part 23, untuk<br />eksterior lighting, teknologi lampu berupa LED ( Light Emitting Diode), HID (High<br />Intensity Discharge) dan Electroluminescence merupakan teknologi yang sesuai<br />dengan standar regulasi tersebut. Semua komponen harus sesuai dengan kualifikasi<br />RTCA D0-160.</p>', '1412151158_Maret-Design_Concept_Lighting_System_Report_Imas_TS.pdf', 1, NULL, 7, 2014, '2014-07-07 14:33:42.711486', 1, '1412151158_Maret-Design_Concept_Lighting_System_Report_Imas_TS.pdf', 1, 0);
