INSERT INTO note VALUES (177, 554, 'Pengukuran Kinerja Triwulan II Pustekbang 2014 ', '<p>Telah disusun laporan Pengukuran Kinerja pada Triwulan II Pustekbang tahun 2014. Laporan ini merupakan capaian progress Rencana Aksi yang telah ditetapkan pada awal tahun 2014 untuk satker Pustekbang yang disampaikan ke Biro Renor melalui aplikasi Siforen Monev (Sistem Informasi Perencanaan, Monitoring dan Evaluasi). Progress secara keseluruhan telah menunjukkan adanya peningkatan dan beberapa indikator kinerja utama sedang dalam proses. Anggaran yang telah terserap pada Triwulan II ini adalah sebesar 13,39 %.&nbsp;</p>', '1420613285_Pengukuran_Kinerja_Triw_II_2014.pdf', 4, NULL, 7, 2014, '2014-07-18 10:40:13.751015', 1, '1420613285_Pengukuran_Kinerja_Triw_II_2014.pdf', 1, 0);
INSERT INTO note VALUES (178, 554, 'Laporan Tahunan Pustekbang 2013', '<p>Telah disusun Laporan Tahunan Pustekbang tahun 2013. Laporan ini merupakan rangkuman Laporan dari masing-masing Program yang telah dilaksanakan pada tahun 2013. Dimulai dari profil Pustekbang yang juga meliputi perkembangan SDM tahun 2013. Dilanjutkan dengan Penelitian dan Pengembangan Teknologi LSA, Penelitian dan Pengembangan Teknologi LSU, Program Pengembangan Pesawat Transport N219, Kegiatan dan Seminar, Kerjasama dengan Instansi Lain, serta Diseminasi Pengetahuan Kedigrantaraan.&nbsp;</p>', '1420613296_LAP_TAHUNAN_PUSTEKBANG_2013.pdf', 5, NULL, 7, 2014, '2014-07-18 10:54:13.411643', 1, '1420613296_LAP_TAHUNAN_PUSTEKBANG_2013.pdf', 1, 0);
