INSERT INTO note VALUES (196, 277, 'Pemanfaatan Kamera ADC Air Pada Pesawat LSA', '<p style="text-align: justify;">Telah dilakukan perancangan dan desain kamera tetracam ADC air untuk <br />pemotretan lahan pertanian daerah Subang, Jawa Barat. Kamera yang digunakan adalah <br />kamera jenis ADC Air berupa multi spektrum kamera yang didesain dapat membaca <br />panjang gelombang lebih dari 560 nm sampai panjang gelombang near infrared 920nm <br />serta dapat dilengkapi dengan GPS u blox6 sehingga diperoleh foto wilayah pertanian <br />dengan informasi altitude, longitude, dan latitude.</p>', '1412665094_TN_-_LSA.pdf', 1, NULL, 7, 2014, '2014-07-24 11:15:01.439087', 1, '1412665094_TN_-_LSA.pdf', 1, 0);
