INSERT INTO note VALUES (203, 364, 'ANALISA KONDISI TRIM PADA PEMODELAN LSU-01 (LAPAN SURVEILLANCE UAV - 01) UNTUK UJI TERBANG', '<p>LSU-01(LAPAN Surveillance UAV-01) adalah pesawat tanpa awak variasi pertama yang dikembangkan oleh LAPAN untuk dapat terbang secara autonomous atau terbang secara otomatis tanpa ada pengaruh pilot dari luar. Banyak sekali misi terbang yang telah dilakukan oleh pesawat ini diantaranya adalah untuk memotret gunung Merapi pasca erupsi dan banjir di Jakarta. Spesifikasi dari LSU-01yaitu memiliki wingspan atau panjang sayap 1900 mm dan panjang fuselage atau bodi 1150 mm. LSU-01 dibuat dengan bahan styrofoam sehingga sangat ringan dan mampu membawa payload seberat 1.5 kg dengan lama terbang sekitar 50 menit. Penelitian ini dilakukan untuk menganalisa kondisi trim dari LSU-01 sebagai masukan awal pada bidang kendali pesawat sebelum melakukan uji terbang. Metode yang dilakukan adalah dengan memberikan spesifikasi kondisi terbang LSU-01 yaitu terbang pada ketinggian 250 m dpl dengan kecepatan 13,57 m/s. Karakteristik dan geometri pesawat diolah dengan menggunakan software DATCOM untuk menghitung stabilitas dan karakteristik kendali aerodinamika sebagai pemodelan LSU-01. Hasil perhitungan dengan software tersebut digunakan untuk menentukan kondisi trim. Didapatkan perubahan sudut elevator (detrim) sebesar - 2,330 dan sudut serang (&alpha;trim) sebesar -10. Nilai tersebut merupakan rekomendasi untuk bahan acuan menseting bidang kendali LSU-01 pada saat uji terbang, sehingga kondisi terbang yang sudah ditentukan sebelumnya tercapai.</p>', 'KTI-Yanuar_Prabowo(11-07-2014).pdf', 0, NULL, 8, 2014, '2014-08-28 10:58:58.600141', 2, 'KTI-Yanuar_Prabowo(11-07-2014).pdf', 1, 0);
INSERT INTO note VALUES (197, 460, 'Pengujian Engine LSU05 DLE170', '<p>Mesin yang juga dipersiapkan dan akan dipasang pada pesawat LSU 05 adalah jenis DLE170 yang memiliki volume ruang bakar 170 cc diproduksi oleh negara Cina. Mesin ini memiliki 2 silinder dan air intake carburator menghadap kebawah diantara&nbsp; dua pembuangan exhoust. Mampu memberikan gaya dorong pada pesawat LSU 05</p>', '1412147537_TN_DLE170.pdf', 2, NULL, 8, 2014, '2014-08-04 10:11:05.117299', 1, '1412147537_TN_DLE170.pdf', 1, 0);
