INSERT INTO note VALUES (200, 334, 'Sistem Avionik N-219', '<p>Dalam proses perancangan pesawat harus sesuai dengan regulasi yang ada dan berlaku di negara tersebut. Di Indonesia berlaku regulasi CASR (Civil Aviation Safety Regulation) yaitu peraturan keselamatan penerbangan sipil yang mengatur segala macam hal teknis salah satu diantaranya adalah Sistem Avionik.</p>
INSERT INTO note VALUES (201, 334, 'Sistem Avionik N-219', '<p>Avionik adalah peralatan elektronik penerbangan yang mencakup seluruh sistem<br />elektronik yang dirancang untuk digunakan di pesawat terbang. Sistem Avionik<br />yang akan digunakan tersebut harus sesuai dengan fungsi dan jenis pesawat yang<br />akan dibuat, sehingga dari tipe pesawat tersebut dan regulasi yang diperuntukkan<br />untuk tipe pesawat tersebut maka dapat diketahui komponen avionik apa saja yang<br />akan dipasang pada pesawat yang akan dikembangkan.</p>', '1412213189_Laporan_Avionik_-_Yanuar_-_April.pdf', 2, NULL, 8, 2014, '2014-08-27 13:11:25.338804', 1, '1412213189_Laporan_Avionik_-_Yanuar_-_April.pdf', 1, 0);
