INSERT INTO note VALUES (299, 310, 'Pembuatan Aileron Vane LE Rib 2, 3, 4 dan  Aileron Vane Rib 2, 3, 4', '<p style="text-align: left;">Pada kegiatan di atas digunakan software catia V5R22 yang telah dilengkapi <br />dengan feature Aerospace Sheet Metal Design sebagai alat bantu dalam <br />merancang komponen / part yang akan digunakan pada pesawat N219 dalam hal <br />ini adalah Aileron Vane LE Rib. Dimana part ini merupakan bagian dari flapron <br />sebagi control surface dari wing.<br />Part ini mempunyai nomor L116ND50061-102 yang telah ditentukan sebelumnya <br />oleh tim Structure Design.</p>', 'TN-1-maret14.pdf', 1, NULL, 10, 2014, '2014-10-08 11:03:01.582053', 1, 'TN-1-maret14.pdf', 1, 0);
