INSERT INTO note VALUES (204, 334, 'Konfigurasi Sistem Avionik N-219', '<p>Avionik adalah peralatan elektronik penerbangan yang mencakup seluruh sistem<br />elektronik yang dirancang untuk digunakan di pesawat terbang. Sistem Avionik<br />yang akan digunakan tersebut harus sesuai dengan fungsi dan jenis pesawat yang<br />akan dibuat. Proses penyeleksian sistem avionik yang akan digunakan dengan<br />metode RFI (Request for Information) yaitu menyeleksi beberapa supplier peralatan<br />avionik dari beberapa produk yang masuk ke PT.DI untuk diambil yang terbaik dan<br />sesuai dengan regulasi N-219. Dari hasil seleksi maka untuk pesawat N-219 ini<br />menggunakan Sistem Avionik dari produk Garmin yaitu Garmin 1000.</p>', 'Laporan_Avionik_-_Yanuar_-_Mei.pdf', 1, NULL, 8, 2014, '2014-08-28 11:00:57.188153', 1, 'Laporan_Avionik_-_Yanuar_-_Mei.pdf', 1, 0);
INSERT INTO note VALUES (205, 334, 'Konfigurasi Sistem Avionik N-219', '<p>Sistem G1000 adalah sistem kontrol penerbangan terpadu yang menyediakan<br />instrumentasi penerbangan, posisi, navigasi, komunikasi, dan identifikasi informasi<br />kepada pilot di cockpit. Pada konfigurasi sistem avionik N-219 dengan<br />menggunakan Garmin 1000 dapat dibagi menjadi lima konfigurasi besar yaitu :<br />1. Communication and Audio System<br />2. Navigation System<br />3. Indicating and Recording System<br />4. Automatic Flight Control<br />5. Additional Air Data Sensor</p>', 'Laporan_Avionik_-_Yanuar_-_Juni.pdf', 2, NULL, 8, 2014, '2014-08-29 08:39:02.857893', 1, 'Laporan_Avionik_-_Yanuar_-_Juni.pdf', 1, 0);
