INSERT INTO note VALUES (66, 324, 'Analisis Kekuatan Wing body fairing Pesawat N219', '<p>Struktur <em>wing body fairing </em>merupakan salah satu struktur komposit pada pesawat N219. Struktur ini berfungsi untuk menutupi celah antara badan dan sayap pesawat agar menghasilkan <em>drag </em>yang kecil. Oleh karena itu struktur ini dibuat sedemikian rupa untuk mendapatkan bentuk yang <em>smooth</em> dan aerodinamis. Sedangkan dalam proses manufakturnya, struktur ini akan dikerjakan secara <em>dry laminate</em> dengan menggunakan material <em>prepreg</em>.</p>
