INSERT INTO note VALUES (20, 432, 'judul', '<p>Pusat Teknologi Penerbangan LAPAN telah melakukan penelitian dan pengembangan<br />UAV untuk tujuan surveillance, kegiatan tersebut dinamakan LSU (LAPAN Surveillance UAV)<br />yang telah dimulai pada tahun 2012 sampai sekarang. Pengembangkan berbagi fariasi dari LSU<br />(LAPAN Surveillance UAV), diawali dari LSU-01 sampai dengan LSU-05. Fariasi tipe LSU<br />tersebut berdasarkan beban payload yang mampu dibawa oleh UAV sesuai dengan misi terbang<br />yang akan dilaksanakan.<br />Dalam melaksanakan setiap misi terbang diperlukan suatu sistem Avionik dan TTC<br />(Telemetry Telecomand dan Communication) yang handal. Sistem tersebut tidak lapas dari<br />teknologi RF (Radio Frekuensi) dan kontrol untuk autopilot karena UAV yang digunakan adalah<br />bergerak dengan jangkauan tertentu, maka data-data yang dikirimkan dan diterima dari UAV ke<br />ground control station atau sebaliknya harus menggunakan teknologi tanpa kabel, sehingga<br />peran Radio Frekuensi ini muncul. Jangkauan sistem TTC long range sangat diperlukan untuk<br />mengkover misi terbang dari LSU yang semakin jauh, selain itu diperlukan juga suatu GCS<br />mobile yang dapat selalu siap digunakan kapan saja dengan support sistem yang terintegrasi<br />baik itu untuk sistem TTC maupun pengolahan data payload.</p>', '1412213140_Sistem_Avionik_LSU-05.pdf', 1, NULL, 6, 2014, '2014-06-18 13:07:40.607425', 1, '1412213140_Sistem_Avionik_LSU-05.pdf', 1, 0);
