INSERT INTO note VALUES (300, 310, 'Pembuatan Aileron Vane Rib 2, 3, 4 Pembuatan part Aileron Upper Skin Vane Editing part Flap Vane LE Rib 3-12 dan Flap Vane Rib 3-12', '<p>Pada kegiatan di atas masih digunakan software catia V5R22 dimana pada <br />pembuatan Aileron Vane Rib 2, 3, 4 melanjutkan kegiatan sebelumnya.<br />Untuk part Vane Upper Skin tidak digunakan feature aerospace sheet metal design<br />jadi dalam pembuatan part ini ada feature :<br />1. Mechanical Design : Sketcher &ndash; Wireframe and Surface Design <br />2. Shape : Generative Shape Design<br />Sedangkan untuk Editing part Flap Vane LE Rib dan Flap Vane masih <br />menggunakan feature aerospace sheet metal design.</p>', 'TN-2-april14.pdf', 2, NULL, 10, 2014, '2014-10-08 11:04:10.174971', 1, 'TN-2-april14.pdf', 1, 0);
INSERT INTO note VALUES (301, 310, 'EDITING GAMBAR PART FLAPVANE RIB DAN LE RIB 6  12  DENGAN SKIN RELEASE KEDUA DAN PEMBUATAN GAMBAR PART AILERON RH', '<p>Pada kesempatan ini dari PT. DI memberikan tugas kepada Engineer LAPAN untuk <br />membantu pembuatan gambar design part dari pesawat N219 pada bagian control <br />surface yaitu FLAPVANE dan AILERON.<br />Pada komponen FlapVane hanya diberikan tugas untuk mengedit sketch yang telah <br />dibuat oleh Engineer PT. DI dengan sketch yang baru dan surface yang baru <br />sehingga struktur pada FlapVane akan berubah. Sementara untuk komponen pada <br />Aileron diberikan tugas untuk membuat komponen &ndash; komponen pada bagian RH <br />(Right Hand) karena untuk bagian LH (Left Hand) telah dikerjakan oleh Engineer <br />PT. DI dengan software CATIA V5 R22.</p>', 'TN-3-mei14.pdf', 3, NULL, 10, 2014, '2014-10-08 11:05:43.362819', 1, 'TN-3-mei14.pdf', 1, 0);
