INSERT INTO note VALUES (318, 345, 'Power Management System', '<p style="text-align: justify;">Dengan memanfaatkan wahana LSU 01 yang dimiliki LAPAN, akan dibuat suatu sistem desain power UAV menggunakan panel surya untuk mendapatkan energy tambahan guna menambah waktu terbang pesawat. Besarnya intensitas matahari mempengaruhi keluaran daya yang dihasilkan panel surya. Oleh karena itu, untuk mendapatkan nilai daya maksimum dari solar panel dibutuhkan suatu pengontrol daya maksimum dari panel surya atau biasa disebut Maximum Power Point Tracker (MPPT).</p>', 'TN1-_Manajemen_Daya_Solar_Panel-_Imas_Tri_S.pdf', 1, NULL, 10, 2014, '2014-10-08 15:22:18.925598', 1, 'TN1-_Manajemen_Daya_Solar_Panel-_Imas_Tri_S.pdf', 1, 0);
