INSERT INTO note VALUES (401, 369, 'Technical Report Jaring dan Tailhook', '<p>Sebuah sistem pendaratan merupakan salah satu bagian yang penting dalam sebuah misi penerbangan baik itu untuk pesawat penerbangan tanpa awak maupun penerbangan berpenumpang. Sering dalam misi penerbangannya LSU mengalami hambatan dan kesulitan terutama yang berhubungan dengan landasan pacu. Dimana banyak diantara lokasi-lokasi terbang tidak terdapat lancasan pacu yang memadai sehingga pilot akan kesulitan untuk <em>take off</em> maupun <em>landing, </em>seperti hal-nya ketika melakukan misi penerbangan dari atas kapal angkatan laut yaitu KRI Diponegoro. Kerena operasi dek pendaratan tergantung untuk tingkat besarnya sudut dan pada kemampuan pesawat menangkap kait untuk mengaitkan pada lintas sling tali ditengah dek tengah kapal.<em>Landing system</em> pada dek kapal adalah salah satu hal yang paling sulit dilakukan dalam penerbangan tanpa awak.</p>', 'TR_Jaring_dan_Tail_Hook.pdf', 1, NULL, 10, 2014, '2014-10-10 16:20:20.789218', 1, 'TR_Jaring_dan_Tail_Hook.pdf', 1, 0);
