INSERT INTO note VALUES (1170, 576, 'Avionik Instruments Server EFS N219', 'EFS N219 terdiri dari sekumpulan hardware dan software yang dikonfigurasikan sedemikian rupa sehingga dapat berfungsi untuk mendemontrasikan pesawat seperti aslinya. Konfigurasi awal yang telah dibuat ketika 2014 saat ini telah diaplikasikan dalam hardware yang telah diadakan di PT Dirgantara Indonesia. Avionik Instruments Server adalah salah satu bagian diantara konfigurasi tersebut.
INSERT INTO note VALUES (416, 347, 'Desain Manajemen Power', '<p>Pengembangan LSU 01 Hybrid merupakan terobosan baru untuk pengembangan pesawat terbang tanpa awak. LSU 01 Hybrid bertujuan mendapatkan nilai optimal penerbangan dengfan menambahkan sumber daya selain baterai pada LSU 01. Power utama dari LSU 01 sebelumnya hanya batterai dan mampu terbang sekitar 1 jam. Dengan pengembangan LSU 01 Hybrid diharapkan LSU 01 bisa terbang lebih lama dalam menjalankan misinya. Bagian dari LSU 01 Hybrid yang paling penting adalah manajemen power untuk mengatur proses pemberian daya dan mengatur konektivitas antar solar panel dan baterai untuk optimalisasi energi yang di gunakan dan di serap dari matahari.</p>', 'Desain_manajemen_power_.pdf', 1, NULL, 10, 2014, '2014-10-13 09:13:39.79634', 1, 'Desain_manajemen_power_.pdf', 1, 0);
