INSERT INTO note VALUES (418, 317, 'Laporan Juli 2014 - WTT Report HTP Position Effect Exp180', '<p>PT Dirgantara Indonesia (Persero) dan Lembaga Penerbangan Dan Antariksa Nasional (LAPAN) telah sepakat untuk bekerja sama dalam pengembangan pesawat N219. Pesawat N219 adalah pesawat dengan 19 penumpang&nbsp; twin-turboprop yang dapat dioperasikan di wilayah penerbangan perintis. Salah satu dari beberapa tahapan program ini adalah pengujian model pesawat N219 di terowongan angin untuk mempelajari efek dari berbagai parameter desain, uji terowongan angin power off dan power on.</p>
