INSERT INTO note VALUES (434, 545, 'Penentuan Berat Pesawat LSU Highspeed', '<p>Penentuan berat dimaksudkan untuk mendapatkan berat awal pesawat. Berat yang dimaksudkan adalah berat <em>takeoff </em>atau WTO (takeoff weight). <em>Takeoff weig</em>ht adalah berat ketika pesawat akan lepas landas yang merupakan jumlah keseluruhan dari berat kosong operasional pesawat, berat muatan, dan berat bahan bakar. Berat <em>takeoff</em> maksimum menentukan berat <em>takeoff</em> &nbsp;terberat yang bisa diterbangkan oleh pesawat</p>', 'Technical_Note_ES_Design_LSU_Highspeed_rev1.1.pdf', 1, NULL, 10, 2014, '2014-10-14 13:14:36.466261', 1, 'Technical_Note_ES_Design_LSU_Highspeed_rev1.1.pdf', 1, 0);
