INSERT INTO note VALUES (440, 445, 'Laporan Resin Cotent Actual', '<p>Resin content actual adalah merupakan kandungan resin yang sebenarnya &nbsp;dibutuhkan suatu laminasi serat sehingga dapat terbasahi/terlaminasi dengan sempurna. Penelitian resin content ini perlu dilakukan karena kemampuan serap setiap jenis serat berbeda-beda dan disamping itu juga tergantung pada viskositas resin. Untuk itu perlu dilakukan penelitian ini sehingga kelak dapat ditentukan resin content yang diperlukan saat akan dimanufaktur. Selain resin content melalui penelitian ini juga akan diperoleh besar ketebalan tiap jenis serat dengan menggunakan 2 metoda proses manufaktur yaitu metoda hand lay-up dan vacuum bagging. Jenis serat yang diteliti disesuaikan dengan kebutuhan LSU-05 karena jenis serat sangat banyak. LSU-05 saat ini baru menggunakan serat GFRP (Glass Fiber Reinforced Plastic) yaitu WR 185 &amp; WR 200. Sementara untuk CFRP (Carbon Fiber Reinforced Plastic) yang diaplikasikan adalah serat carbon Twill 2x2. Untuk resin yang diaplikasikan adalah jenis resin&nbsp; epoxy+hardener.</p>', 'Laporan_Resin_Content_Actual.pdf', 1, NULL, 10, 2014, '2014-10-15 13:28:45.422832', 1, 'Laporan_Resin_Content_Actual.pdf', 1, 0);
INSERT INTO note VALUES (441, 355, 'Laporan Kegiatan Embeded Sistem', '<p>Embeded sistem merupakan sebuah sistem (rangkaian elektronika) digital yang merupakan bagian dari sebuah sistem yang lebih besar. Embeded sendiri menunjukkan bahwa merupakan bagian yang tidak dapat berdiri sendiri. Embeded sistem juga banyak diartikan sebagai suatu perangkat tertentu yang bertujuan melakukan suatu fungsi atau tugas khusus. &nbsp;</p>', 'TN_1_Embeded_Program.pdf', 1, NULL, 10, 2014, '2014-10-15 14:35:17.135853', 1, 'TN_1_Embeded_Program.pdf', 1, 0);
