INSERT INTO note VALUES (452, 445, 'Laporan Uji Densitas  dan Uji Tarik Material LSU-05', '<p>Uji Densitas merupakan karaterisasi yang dilakukan pada bahan baik padat maupun cair untuk mengetahui massa jenis masing-masing. Pada pengujian ini akan dilakukan karakterisasi pada bahan serat-serat gelas dan carbon, sementara untuk resin akan dilakukan pengujian pada bahan epoxy dan hardener. Untuk melakukan pengujian ini dilakukan dengan menggunakan <strong>Density Kit</strong>. Dengan menggunakan alat ini maka dapat diperoleh density dari tiap masing-masing serat dan resin, sehingga nantinya data ini dapat menjadi salah satu acuan untuk densitas material yang akan dipakai untuk stress analisis struktur LSU-05.</p>
