INSERT INTO note VALUES (489, 270, 'LAPORAN  KONSYINYERING PENYUSUNAN FEED-IN TARIFF PEMBANGKIT LISTRIK TENAGA BAYU (PLTB)', '<p style="text-align: justify;">Seperti harga listrik dari energi fosil sudah dihitung harga per KWHnya, sehingga masyarakat sudah bisa menikmati/melakukan pemebelian energi listrik melalui jaringan listrik PLN. Pengelolaan pemanfaatan teknologi Sistem Konversi Energi Angin PLTB skala besar on greed jaringan PLN perlu dihitung harga keekonomiannya. Telah dibahas Feed &ndash;in Tariff PLTB yaitu harga energi listrik PLTB perKWH. Pembahasan Feed-in Tariff oleh para pengembang yang hadir SKEA skala besar untuk menjual energi listrik per Kwh dari PLTB ke Pemerintah/PLN. Kehadiran LAPAN&nbsp; dalam hal ini Ka Pustekbang sebagai intansi yang pernah dan telah berpengalaman dalam pengelolaan pemanfaatan teknologi SKEA.&nbsp;</p>', 'LAPORAN_FEED-IN_TARIFF_PLTB.pdf', 5, NULL, 10, 2014, '2014-10-29 13:54:59.714882', 1, 'LAPORAN_FEED-IN_TARIFF_PLTB.pdf', 1, 0);
