INSERT INTO note VALUES (515, 277, 'Laporan Kegiatan Pemantauan Lahan di Subang', '<p>Tujuan dari kegiatan ini adalah untuk mendapatkan foto udara pada lahan pertanian di<br />daerah Subang. Penggunaan kamera pada kegiatan ini adalah kamera Tetracam ADC<br />Air yang didesain untuk manned aircraft (pesawat berawak). Penggunaan kamera<br />Tetracam ini dimaksudkan untuk dapat mengetahui indeks kesehatan tanaman prinsip<br />kerja kamera ini adalah membaca spektrum yang dihasilkan dari proses fotosintesis<br />sehingga diperoleh indikasi masih produktif atau tidaknya suatu vegetasi.</p>', 'Laporan_Kegiatan_LSA_di_Subang_(rev_1).pdf', 3, NULL, 11, 2014, '2014-11-04 08:44:45.734839', 1, 'Laporan_Kegiatan_LSA_di_Subang_(rev_1).pdf', 1, 0);
