INSERT INTO note VALUES (519, 318, 'Testimoni dan Saran Kegiatan ToT N219', '<p>ToT kepanjangan dari Transfer of Teknology, adalah salah satu program dari Pustekbang tahun 2014. Program ini merupakan salah satu kontrak kerja PTDI dengan LAPAN terkait dengan pendanaan perancangan dan pembuatan pesawat N219. Program ini bertujuan untuk memberikan gambaran secara umum tentang proses perancangan pesawat pada fase preliminary, detail design, manufacture, assembly,&nbsp; flight test, dan certification</p>', 'Testimoni_Kegiatan_ToT_N219_-_Arifin_RS.pdf', 6, NULL, 11, 2014, '2014-11-10 13:59:19.632745', 1, 'Testimoni_Kegiatan_ToT_N219_-_Arifin_RS.pdf', 1, 0);
INSERT INTO note VALUES (520, 328, 'Revisi Laporan April', '<p>Matlab (MATrix LABoratory) merupakan bahasa pemrograman yang dikembangkan oleh The Mathwork Inc. (<a href="http://www.mathworks.com/">http://www.mathworks.com</a>). Bahasa ini banyak digunakan untuk perhitungan numerik keteknikan, komputasi simbolik, visualisasi, grafis, analisis data matematis, statistika, simulasi, pemodelan dan desain GUI.</p>', 'Laporan_april_rev.pdf', 2, 1, 11, 2014, '2014-11-10 14:01:19.35452', 1, 'Laporan_april_rev.pdf', 1, 0);
INSERT INTO note VALUES (521, 328, 'Revisi Laporan Mei', '<p>Bahasa pemrograman ada berbagai macam dari mulai desktop sampai dengan web base. Akan tetapi pemrograman secara global terbagi dari 2 rumpun besar yaitu struktur dan objek. Untuk membangun EFS tidak hanya dibutuhkan hardware akan tetapi juga di dukung dengan pemrograman sebagai bagiannya. Didalam pembuatan EFS N219 ini pemrograman yang di gunakan untuk membangun adalah pemrograman C++.&nbsp;</p>', 'Laporan_EFS_MEI_rev.pdf', 3, 1, 11, 2014, '2014-11-10 14:21:27.508277', 1, 'Laporan_EFS_MEI_rev.pdf', 1, 0);
INSERT INTO note VALUES (322, 328, 'Pengenalan VAPS XT 4.0.1 untuk Pembuatan Glass Cocpit Instrument (Laporan JULI)', '<p>Garmin 1000 digunakan untuk glass cocpit instrument pada pesawat N219. Akan tetapi dalam simulator jika digunakan komponen asli maka biaya yang dikeluarkan menjadi besar. Untuk itu komponen Garmin 1000 tersebut dibuat menggunakan software bantu Pressagis VAPS XT 4.0.1 sehingga dapat menghasilkan tampilan yang serupa aslinya.</p>', 'Laporan_JULI.pdf', 5, NULL, 10, 2014, '2014-10-08 17:04:28.920378', 1, 'Laporan_JULI.pdf', 1, 0);
INSERT INTO note VALUES (522, 328, 'Pembuatan Komponen Glass Cocpit Instrument Table 2.6 Flight Control and Mechanical System Indication dengan VAPS XT 4.0.1 (Laporan September)', '<p>Garmin 1000 digunakan untuk glass cocpit instrument pada pesawat N219. Akan tetapi dalam simulator jika digunakan komponen asli maka biaya yang dikeluarkan menjadi besar. Untuk itu komponen Garmin 1000 tersebut dibuat menggunakan software bantu Pressagis VAPS XT 4.0.1 sehingga dapat menghasilkan tampilan yang serupa aslinya.<br />Berdasarkan dokumen N219 - ENGINE INDICATION AND CREW ALERTING SYSTEM INTERFACE REQUIREMENT yang dikeluarkan PT Dirgantara Indonesia terdapat bermacam-macam glass cocpit. Diantara komponen itu terdapat komponen table 2.6 yang terdiri dari beberapa display untuk Primary Flight Display.</p>', 'Laporan_SEPTEMBER.pdf', 6, NULL, 11, 2014, '2014-11-10 15:24:19.715739', 1, 'Laporan_SEPTEMBER.pdf', 1, 0);
INSERT INTO note VALUES (1089, 563, '', '', 'Laporan_Mei_2015_[Dana_Herdiana,_Aerodinamika].pdf', 2, NULL, 6, 2015, '2015-06-15 08:10:28.756251', 1, 'Laporan_Mei_2015_[Dana_Herdiana,_Aerodinamika].pdf', 1, 0);
INSERT INTO note VALUES (523, 328, 'Testimoni TOT', '<p>Bolehlah komponen di table 2.6 Flight Control and Mechanical System Indication dalam EFS menjadi sebuah akselerasi pembelajaran akan tetapi sebuah harapan muncul bagaimana jika ilmu yang telah di dapat itu bisa menjadi sumbangsih tersendiri untuk Pusat Teknologi Penerbangan dalam mencoba memulai pembuatan avionik-avionik display di kemudian hari. Untuk mendukung hal tersebut walaupun di Flight Control and Mechanical System Indication tidak terdapat komunikasi data dari dan keluar serta tidak terdapat maps , saya mencoba mendiskusikan dan menggali informasi tentang kedua hal tersebut dengan harapan kelak bisa mengkombinasikan MAPS dan display avionik untuk Pusat Teknologi Penerbangan. Besar harapannya Pusat Teknologi Penerbangan mempunyai lisensi terhadap software Pressagis VAPS XT dan juga Pressagis Flight Simulator sehingga EFS yang ada kelak bisa kita kembangkan tidak hanya kita operasikan saja.</p>', 'testimony.pdf', 7, NULL, 11, 2014, '2014-11-10 15:56:03.554368', 1, 'testimony.pdf', 1, 0);
