INSERT INTO note VALUES (526, 403, 'Desain Awal Airfoil LRN1015 Untuk High Speed UAV', '<p>Pada tanggal 20 Oktober diadakan rapat untuk mendengarkan presentasi dari narasumber Bpk. Endri Rachman tentang penelitian dan pengembangan perekayasaan pesawat High Speed UAV dan Ground Control System UAV. Pada pemaparan tersebut dilakukan studi kasus dengan menggunakan global hawk. Dengan dasar pemaparan tersebut dibuatlah perekayasaan lanjutan dengan melakukan reverse engineering dengan menggunakan airfoil yang sesuai dengan UAV global hawk yang sesuai dengan perekayasaan High Speed UAV.</p>
