INSERT INTO note VALUES (547, 330, 'Laporan TOT Bulan November', '<p style="text-align: justify;">Kegiatan ToT Bulan November diisi dengan menghitung iluminasi yang dihasilkan oleh landing light jika dipasang pada gondola pesawat. Dengan referensi dokumen pesawat CN 235, diharapkan dapat dibuat model yang sama untuk N219.&nbsp;Landing light pada pesawat CN 235 yang pada awalnya didesain untuk pemasangan pada wing, kemudian dipindah ke gondola pada landing gear. Persayaratan iluminasi menurut dokumen MI-L-6503H menyaratkan tidak kurang dari 2ft candela atau 21.52 lux pada jarak 400 feet. Adapun spesifikasi beam spread pada jarak vertical adalah sebesar 8 degrees, dan 12 degrees pada horizontal.</p>', 'November-Design_Concept_Lighting_System_Report_Imas_TS.pdf', 7, NULL, 11, 2014, '2014-11-18 08:02:43.521795', 1, 'November-Design_Concept_Lighting_System_Report_Imas_TS.pdf', 1, 0);
