INSERT INTO note VALUES (566, 464, 'Design and Analysis of Main Landing Gear Frame of LSU-05 By Finite Element Methode', '<p>LSU-05 is an unmanned aircraft that is currently being developed by LAPAN (Lembaga Penerbangan dan Antariksa Nasional). Aircraft with a body length of 2.400mm and 5.500mm wingspan has a maximum takeoff weight 735 N that has to be supported by the Main Landing Gear Frame. Through Finite Element Method, has conducted a research comparing several materials and combinations of that materials to design the Main Landing Gear Frame. The analysis conclude that the combination of balsa wood 8mm coated by Carbon UD 0<sup>o</sup> 4mm and&nbsp; Carbon UD&nbsp; 45<sup>o</sup>/-45<sup>o</sup> 2mm on both sides top and bottom each is the most suitable design for the Main Landing Gear Frame LSU-05.</p>
