INSERT INTO note VALUES (550, 330, 'Testimoni Kegiatan TOT', '<p style="text-align: justify;">Kegiatan ToT N219 memberikan banyak ilmu dan pengalaman baik untuk pengembangan<br />diri pribadi pada khususnya dan pengembangan pustekbang pada umumnya. Pada<br />kegiatan ini selain belajar dari PT DI yang sudah berpengalaman dalam mengembangkan<br />pesawat terbang, disini kami juga saling bertukar informasi baik yang sifatnya teknis atau<br />non teknis. Selama 9 bulan kegiatan TOT ini berlangsung banyak hal-hal baru yang kami<br />pelajari, mulai dari proses pembuatan pesawat, perancangan dan desain, regulasi serta<br />sertifikasi pesawat. Selain dari itu, disini saya belajar bagaimana bekerja secara sistematis<br />dan terstruktur, bekerja sesuai dengan SOP yang telah dibuat dan bagaimana<br />mendokumentasikan setiap hasil pekerjaan yang telah diperoleh.</p>', 'Testimoni_ToT_N219_di_PT_DI.pdf', 9, NULL, 11, 2014, '2014-11-18 08:05:42.762811', 1, 'Testimoni_ToT_N219_di_PT_DI.pdf', 1, 0);
