INSERT INTO note VALUES (568, 469, 'Design and Analysis of Main Landing Gear Frame of LSU-05 By Finite Element Methode', '<p>LSU-05 is an unmanned aircraft that is currently being developed by LAPAN (Lembaga Penerbangan dan Antariksa Nasional). Aircraft with a body length of 2.400mm and 5.500mm wingspan has a maximum takeoff weight 735 N that has to be supported by the Main Landing Gear Frame. Through Finite Element Method, has conducted a research comparing several materials and combinations of that materials to design the Main Landing Gear Frame. The analysis conclude that the combination of balsa wood 8mm coated by Carbon UD 0<sup>o</sup> 4mm and&nbsp; Carbon UD&nbsp; 45<sup>o</sup>/-45<sup>o</sup> 2mm on both sides top and bottom each is the most suitable design for the Main Landing Gear Frame LSU-05.</p>
INSERT INTO note VALUES (569, 328, 'Testimoni TOT Revisi', '<p>Bolehlah komponen di table 2.6 Flight Control and Mechanical System Indication dalam EFS menjadi sebuah akselerasi pembelajaran akan tetapi sebuah harapan muncul bagaimana jika ilmu yang telah di dapat itu bisa menjadi sumbangsih tersendiri untuk Pusat Teknologi Penerbangan dalam mencoba memulai pembuatan avionik-avionik display di kemudian hari. Untuk mendukung hal tersebut walaupun di Flight Control and Mechanical System Indication tidak terdapat komunikasi data dari dan keluar serta tidak terdapat maps , saya mencoba mendiskusikan dan menggali informasi tentang kedua hal tersebut dengan harapan kelak bisa mengkombinasikan MAPS dan display avionik untuk Pusat Teknologi Penerbangan. Besar harapannya Pusat Teknologi Penerbangan mempunyai lisensi terhadap software Pressagis VAPS XT dan juga Pressagis Flight Simulator sehingga dari EFS yang ada kelak bisa kita kembangkan N219 tidak hanya kita operasikan saja. Selama di PT Dirgantara Indonesia saya juga mencoba mencreate sebuah maps dengan VAPS XT dalam bimbingan personil PT Dirgantara Indonesia yang mungkin suatu saat bisa kita gunakan untuk Ground Control System UAV.</p>', 'testimony_revisi.pdf', 7, 1, 11, 2014, '2014-11-18 11:25:32.81857', 1, 'testimony_revisi.pdf', 1, 0);
