INSERT INTO note VALUES (615, 328, 'Laporan Oktober Ncom Connection', '<p>Dalam Pressagis VAPS XT mempunyai banyak fungsi untuk pembuatan avionik display. Akan tetapi sering kita berhubungan dengan sensor ataupun data input yang lain ketika berbicara dalam sebuah konteks avionik display. Display yang dibuat akan berfungsi ketika ada sebuah data dari sensor ataupun dari sistem lain. Untuk menghubungkan VAPS XT dengan sensor dan sistem lain tersebut dibutuhkan sebuah koneksi data yang disebut NCOM connection.&nbsp;</p>
INSERT INTO note VALUES (636, 316, 'laporan elevator deflection effect exp #180 N219', '<p>laporan ini merupakan ekperimen yang berbeda dengan 179, dimana letak pegangan pesawat di titik pusat CG dan power engine dinyalakan. akibat adanya penyalaan engine terjadi aliran udara di bagian ekor HTP dan VTP yang dipengaruhi oleh aliran tersebut, oleh karena itu diambil data kembali untuk parameter elevator defleksi efek dan parameter yang lainnya.</p>', 'LAPORAN_elevator_EFFECT_exp_180.pdf', 6, NULL, 12, 2014, '2014-12-30 08:25:57.095282', 1, 'LAPORAN_elevator_EFFECT_exp_180.pdf', 1, 0);
INSERT INTO note VALUES (643, 330, 'Laporan TOT ', '<p>Electrical Technical Description of Emergency Lighting CN 235-220M NRK1 Harus memenuhi requirement FAR 25.812. Rangkaian diidentifikasi sebagai WH. Emergency light disuplai &nbsp;oleh 4 power pack 6 Vdc dan dikontrol oleh EMER. LTS switch yang diinstal oleh Internal LTG panel dan EMER.EXT switch yang dipasang pada masing masing ATTENDANT panel.</p>', 'Laporan_7-Design_Concept_Lighting_System_Report_Imas_TS.pdf', 11, NULL, 12, 2014, '2014-12-31 09:57:50.383253', 1, 'Laporan_7-Design_Concept_Lighting_System_Report_Imas_TS.pdf', 1, 0);
INSERT INTO note VALUES (616, 334, 'Konfigurasi Sistem Avionik N-219 : Communication and Audio System (2)', '<p class="p0">VHF&nbsp;diperuntukan&nbsp;pengiriman&nbsp;dan&nbsp;penerimaan&nbsp;suara&nbsp;dan&nbsp;kode/data.&nbsp;Sistim&nbsp;komunikasi&nbsp;VHF&nbsp;bersifat&nbsp;Line&nbsp;of&nbsp;Sight&nbsp;atau&nbsp;segarisdengan&nbsp;pandangan&nbsp;mata&nbsp;dan&nbsp;bekerja&nbsp;pada&nbsp;daerah&nbsp;getaran&nbsp;118,0&nbsp;sampai&nbsp;136,975&nbsp;MHZ.&nbsp;Dalamsuatu&nbsp;sistim&nbsp;Line&nbsp;Of&nbsp;Sight&nbsp;gelombang&nbsp;radio&nbsp;bergerak&nbsp;dalam&nbsp;garis&nbsp;lurus&nbsp;dari&nbsp;pemancar&nbsp;menuju&nbsp;kepenerima.&nbsp;Komunikasi&nbsp;VHF&nbsp;dipilih&nbsp;untuk&nbsp;pengaturan&nbsp;lalu-lintas&nbsp;udara&nbsp;karena&nbsp;getaran&nbsp;inisangat&nbsp;sedikit&nbsp;mengalami&nbsp;gangguan. </p>
