INSERT INTO note VALUES (628, 316, 'aeleron deflection effect N219 hasil wind tunnel test exp #180', '<p>laporan ini adalah hasil training on the job di PT DI dalam rangka membuat pesawat N219. laporan berfokus pada hasil uji terowongan angin pada kasus defleksi aileron. semakin besar moment roll yang dihasilkan pada defleksi aeleron maka semakin efektif.</p>', 'laporan_Aeleron_efek_N219.pdf', 1, NULL, 12, 2014, '2014-12-29 15:58:02.054691', 1, 'laporan_Aeleron_efek_N219.pdf', 1, 0);
INSERT INTO note VALUES (629, 318, 'LAPORAN PENGOLAHAN DAN ANALISIS DATA  PRESTASI TERBANG PESAWAT N219 B10 : LANDING DISTANCES', '<p>Jarak horisontal yang diperlukan untuk tanah dan datang ke berhenti lengkap dari titik 50 meter di atas permukaan pendaratan harus ditentukan, untuk suhu standar pada setiap berat dan ketinggian dalam batas-batas operasional yang ditetapkan untuk mendarat. Mendarat dengan dan tanpa dorongan sebaliknya akan dipelajari dalam bab ini. Pendaratan diasumsikan dibagi menjadi dua tahap: pendekatan dari ketinggian layar sampai touchdown, dan tanah fase dijalankan.</p>', 'laporan_bulan_nov.pdf', 7, NULL, 12, 2014, '2014-12-29 16:06:54.361227', 1, 'laporan_bulan_nov.pdf', 1, 0);
INSERT INTO note VALUES (630, 316, 'elevator efek N219', '<p>laporan ini adalah uji terowongan angin desain pesawat N219 di PT DI khususnya tentang elevator efek. banyak data grafik yang dihasilkan sebagai fungsi defleksi elevator seperti koefisient moment pitch, koefisien moment roll dan yaw. data tersebut sangat bermanfaat dalam menentukan efektifitas dari surface yang dibuat.</p>', 'laporan_Elevator_Efek_N219.pdf', 2, NULL, 12, 2014, '2014-12-29 16:11:39.729843', 1, 'laporan_Elevator_Efek_N219.pdf', 1, 0);
INSERT INTO note VALUES (631, 316, 'analisa efektifitas elevator N219', '<p>laporan ini membahas tentang analisa dari efektifitas defleksi elevator pada pesawat N219 berdasarkan data uji terowongan angin. semakin efektif defleksi artinya semakin besar nilai moment yang dihasilkan akibat defleksi elevator khususnya moment pitch.&nbsp;</p>', 'laporan_analisa_elevator_efektiveness_N219.pdf', 3, NULL, 12, 2014, '2014-12-29 16:13:56.499076', 1, 'laporan_analisa_elevator_efektiveness_N219.pdf', 1, 0);
INSERT INTO note VALUES (632, 442, 'komunikasi c# dan xplane pada gcs lsu-05', '<p>perancangan pesawat lsu05 membutuhkan desain gcs terbaru yang mampu menampilkan data attitude terbang, posisi terbang dan display muatan seperti video atau radar. pada laporan kali ini akan dibahas tentang bagaimana komunikasi antara software c# sebagai pengembang GCS bisa dilakukan untuk display ke xplane untuk attitude terbangnya.</p>', 'Technical_Note_GCS_LSU_05_Agus_Hendra_Wahyudi.pdf', 1, NULL, 12, 2014, '2014-12-29 16:20:28.564481', 1, 'Technical_Note_GCS_LSU_05_Agus_Hendra_Wahyudi.pdf', 1, 0);
INSERT INTO note VALUES (633, 328, 'MAPS 2D ', '<p>Map adalah sebuah instrument yang tidak bisa terlepaskan dalam instrument glass cocpit. Peran map cukup penting dalam navigasi pesawat. Jika tanpa map maka pesawat seperti kehilangan arah navigasi. Dengan map pesawat bisa mengetahui posisinya pada titik mana. Dalam vaps xt juga tersedia fitur map. Map ada map 3d dan map 2d akan tetapi dalam vaps xt versi ini hanya tersedia map 2d saja. Topik map2d tidak bisa dipisahkan dari topic sebelumnya yaitu ncom conection karena map juga memerlukan inputan posisi dari luar aplikasi vaps xt.</p>', 'Laporan_november.pdf', 9, NULL, 12, 2014, '2014-12-29 19:41:47.045931', 1, 'Laporan_november.pdf', 1, 0);
INSERT INTO note VALUES (634, 316, 'analisa kestabilan akibat adanya landing gear effect percobaan #179 pesawat N219', '<p>Laporan ini merupakan analisa kestabilan pada sumbu longitudinal dan lateral dari pesawat N219 akibat adanya landing gear. dari analisa data yang diperoleh diambil kesimpulan bahwa landing gear tidak terlalu berpengaruh pada kestabilan longitudinal dan lateral baik pada kondisi take off dan landing khususnya yaitu flap 10 dan 30/40 dimana flap tersebutlah kondisi takeoff dan landing dilakukan.</p>', 'LAPORAN_analisa_landing_gear_efek_experimen_#179.pdf', 4, NULL, 12, 2014, '2014-12-30 08:17:45.816047', 1, 'LAPORAN_analisa_landing_gear_efek_experimen_#179.pdf', 1, 0);
INSERT INTO note VALUES (652, 336, 'MoM Review CCL', '', 'PTDI-DGCA_MOM_CCL_Review_P0.pdf', 10, NULL, 12, 2014, '2014-12-31 12:22:13.818776', 1, 'PTDI-DGCA_MOM_CCL_Review_P0.pdf', 1, 0);
INSERT INTO note VALUES (635, 316, 'Analisa Posisi HTP Effect N219 hasil Wind Tunnel Test Exp #179  Pada Neutral Pointnya', '<p>neutral point menjadi syarat dalam perancangan pesawat, begitu pula N219 pesawat ini harus memiliki neutral point 35% dari MAC (mean aerodynamic chord) sehingga pesawat masih bisa dikendalikan dan stabil. penempatan HTP di pesawat N219 dicoba dilakukan di sepanjang VTP (vertical tail plane) yaitu didasar, tengah dan agak keatas (H61-H62-H63) dari ketiganya dimana posisi yang tepat terhadap kriteria neutral point akan dibahas di laporan ini.</p>', 'laporan_HTP_effect_analisa_stabilitas_eksperimen_179.pdf', 5, NULL, 12, 2014, '2014-12-30 08:22:53.278082', 1, 'laporan_HTP_effect_analisa_stabilitas_eksperimen_179.pdf', 1, 0);
