INSERT INTO note VALUES (640, 327, 'Laporan ToT Juli 2014', '<p>Untuk software pengembangan EFS N219 di gunakan flightsim 13 yang di desain khusus untuk pengembangan pesawat. Flightsim 13 merupakan software keluaran dari presagis kanada yang memeilki beberapa fitur dan dapat di fungsikan sampai bisa dilakukan simulasi terbang dengan pesaweat yang di kembangkan dalam hal ini pesawata n219.</p>', 'Laporan_ToT_Juli_2014__EFS,_AGUS_WIYONO_.pdf', 7, NULL, 12, 2014, '2014-12-30 14:41:24.300922', 1, 'Laporan_ToT_Juli_2014__EFS,_AGUS_WIYONO_.pdf', 1, 0);
INSERT INTO note VALUES (641, 327, 'Laporan ToT Oktober - Akhir  2014', '<p>Untuk software pengembangan EFS N219 di gunakan flightsim 13 yang di desain khusus untuk pengembangan pesawat. Flightsim 13 merupakan software keluaran dari presagis kanada yang memeilki beberapa fitur dan dapat di fungsikan sampai bisa dilakukan simulasi terbang dengan pesawat yang di kembangkan dalam hal ini pesawat n219. Model N219 dari hasil uji wind tunnel dimasukkan pada software flightsim 13 yang mempunyai fitur desain model pesawat.</p>', 'Laporan_ToT_Agustus_-_Akhir_2014__EFS,_AGUS_WIYONO_.pdf', 8, NULL, 12, 2014, '2014-12-30 15:55:14.162261', 1, 'Laporan_ToT_Agustus_-_Akhir_2014__EFS,_AGUS_WIYONO_.pdf', 1, 0);
INSERT INTO note VALUES (645, 277, 'Laporan Hasil Pemotoan LSA ', '<p style="text-align: justify;">Kamera yang digunakan adalah kamera Tetracam Agricultural Digital Camera (ADC) Air dan Canon S100. Tetrcam ADC Air berupa &nbsp;multi spektral kamera yang didesain dapat membaca panjang gelombang lebih dari 560 nm hingga panjang gelombang dekat infra merah (near infrared/NIR) 920 nm serta dapat dilengkapi dengan GPS. Dengan kelengkapan tersebut, diperoleh foto vegetasi dengan informasi utc, altitude, longitude, dan latitude.&nbsp;</p>', 'TN_-_LSA_Akhir.pdf', 4, NULL, 12, 2014, '2014-12-31 10:17:53.751119', 1, 'TN_-_LSA_Akhir.pdf', 1, 0);
INSERT INTO note VALUES (1171, 565, 'Pengembangan Aplikasi Pengolahan & Analisis Prestasi Terbang Pesawat Transport : Kasus Multi-Engine Propeller Driven', 'Kegiatan ini bertujuan untuk membuat program yang berfungsi untuk mengkalkulasi dan menganalisis prestasi terbang atau performa dari pesawat. Perangkat lunak yang digunakan adalah MATLAB. Setiap pesawat terbang harus memenuhi spesifikasi prestasi terbang yang telah ditentukan sebelumnya pada persyaratan dan misi rancangan atau design requirements and objectives (DRO). Suatu pesawat terbang dikatakan laik terbang apabila pesawat tersebut telah memenuhi persyaratan prestasi dan keselamatan terbang. Pada perancangan pesawat nirawak belum ada peraturan atau hukum yang mengatur masalah keselamatan, tetapi hal tesebut perlu dipertimbangkan. Metode analisa prestasi terbang mencakup prestasi pesawat transport dengan multi-engine propeller driven', 'WP131_TN2.pdf', 1, NULL, 8, 2015, '2015-08-18 10:13:50.321101', 1, 'WP131_TN2.pdf', 1, 0);
