INSERT INTO note VALUES (646, 356, 'Pengenalan Mekanika Terbang', '<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Mekanika terbang adalah disiplin ilmu teknik penerbangan yang mempelajari, meneliti dan mengembangkan Olah gerak pesawat terbang, dalam penerbangannya yang meliputi prestasi terbang, dinamika terbang, kendali terbang, navigasi dan panduan terbang di udara maupun di antariksa.</p>
INSERT INTO note VALUES (648, 349, 'Laporan Akhir Pengembangan Embedded system Autopilot 2014', '<p>Aplikasi pemantauan dengan pesawat tanpa awak semakin berkembang. Beberapa pemanfaatan pesawat tanpa awak yaitu untuk pemetaan lahan pertanian, pemantauan untuk mendukung mitigasi bencana, dan juga urban mapping. Untuk pengendalian pesawat tanpa awak diperlukan sistem embedded yang berfungsi sebagai autopilot. Beberapa sistem autopilot sudah dikembangkan di dunia di antaranya Micropilot, Picolo, FeYutech, PX4, MultiwII, dan Ardupilot Mega(APM). Dari beberapa macam sistem autopilot Ardupilot Mega merupakan sistem Autopilot yang pengembangannya secara opensource dan hardware embeddednya lumayan mudah didapatkan dan relatof murah. APM sudah memeiliki fitur yang lumayan lengkap untuk menjalankan misi terbang dengan pesawat tanpa awak</p>', 'Laporan_RE_embedded_2014.pdf', 7, NULL, 12, 2014, '2014-12-31 11:28:13.833209', 1, 'Laporan_RE_embedded_2014.pdf', 1, 0);
