INSERT INTO note VALUES (668, 390, 'komunikasi serial visual c# GCS dengan autopilot', '<p>dalam pengembangan GCS dibutuhkan komunikasi serial untuk menerima data dari autopilot dan menampilkannya di komputer bumi atau GCS. pada laporan ini akan dibahas tentang mekanisme visual C# dalam mengakses serial port dan menerima data dari autopilot UAV.</p>', 'laporan_eng_staff_GCS.pdf', 1, NULL, 1, 2015, '2015-01-02 09:26:40.716131', 1, 'laporan_eng_staff_GCS.pdf', 1, 0);
INSERT INTO note VALUES (673, 412, 'Laporan pemotretan Lokasi Longsor Karangkobar banjarnegara dengan LSU -01', '<p>Pesawat LSU-01 merupakan pesawat tanpa awak yang di kembangkan di LAPAN Pustekbang dengan sumber energi terbang memakai baterai. Pesawat LSU 01 memiliki kemampuan membawa muatan yang menjadikan berat total pesawat sampai 3 kg. Dengan kemampuan membawa kamera ini maka pesawat LSU 01 dimanfaatkan untuk melakukan pemotretan udara Lokasi bencana longsong di Karangkobar Banjarnegara. Untuk keberhasilan pemotretan udara Lokasi bencana longsong di Karangkobar Banjarnegara ada beberapa hal yang di desain dan di hitung mengenai konfigurasi dari LSU 01.</p>', 'Teknikal_Repot_Banjar_negara.pdf', 2, NULL, 1, 2015, '2015-01-02 11:04:12.431786', 1, 'Teknikal_Repot_Banjar_negara.pdf', 1, 0);
