INSERT INTO note VALUES (655, 385, 'Membuat Pemodelan Pesawat Menggunakan Plane Maker 8.4', '<p>Plane maker 8.4 adalah sebuah software (perangkat lunak) yang berguna untuk merancang dan membuat pesawat untuk X-Plane. Perangkat lunak ini adalah bagian dari sistem software X-Plane 8.4, yang mana seri beta (ujicoba, trial) nya dapat diunduh dari website resmi X-Plane. Pemodelan pesawat dilakukan untuk memperoleh model yang dapat disimulasikan di software X-Plane. Pesawat yang digunakan untuk pemodelan ini adalah UAV yang digunakan untuk program High Speed UAV yaitu MQ-9 Reaper.&nbsp;</p>', 'TN_2_GCS.pdf', 2, NULL, 12, 2014, '2014-12-31 16:18:57.353583', 1, 'TN_2_GCS.pdf', 1, 0);
