INSERT INTO note VALUES (681, 389, 'KONEKSI VAPS XT DAN X-PLANE', '<p><span style="font-family: Calibri; font-size: 14pt; color: #000000; font-style: normal; font-variant: normal;">Dalam Pressagis VAPS XT mempunyai banyak fungsi untuk pembuatan avionik<br /><span style="font-family: Calibri; font-size: 14pt; color: #000000; font-style: normal; font-variant: normal;">display. Di dalam GCS diperlukan beberapa avionic display , diantaranya<br /><span style="font-family: Calibri; font-size: 14pt; color: #000000; font-style: normal; font-variant: normal;">adalah maps atau peta. Untuk membuat koneksi data antara VAPS XT dengan<br /><span style="font-family: Calibri; font-size: 14pt; color: #000000; font-style: normal; font-variant: normal;">X-PLANE yang sebenarnya tidak terdapat port langsung diantara keduanya<br /><span style="font-family: Calibri; font-size: 14pt; color: #000000; font-style: normal; font-variant: normal;">maka akan dibutuhkan beberapa program tambahan yang akan saya jelaskan<br /><span style="font-family: Calibri; font-size: 14pt; color: #000000; font-style: normal; font-variant: normal;">lebih lanjut. </span></span></span></span></span><br style="font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: -webkit-auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px;" /><br class="Apple-interchange-newline" /></span></p>', 'Laporan_GCS.pdf', 1, NULL, 1, 2015, '2015-01-05 15:10:36.76542', 1, 'Laporan_GCS.pdf', 1, 0);
