INSERT INTO note VALUES (711, 335, 'Propeller System', '<p>Sebelum menginjak lebih jauh mengenai<em> propeller </em>dan gaya dorongnya (<em>thrust</em>) makaharus dipelajari Sistem Propeler (<em>Propeller System</em>) yang digunakan pada pesawat terbang. <em>Propeller System</em> mempelajari mengenai konfigurasi sistem propeler secara umum, sistem kontrol fungsi dan operasi, performansi propeler dan lain-lain.</p>', 'Propulsion_Report_Awang_Rahmadi_Juni.pdf', 5, NULL, 1, 2015, '2015-01-09 17:00:30.723926', 1, 'Propulsion_Report_Awang_Rahmadi_Juni.pdf', 1, 0);
