INSERT INTO note VALUES (698, 303, 'Pemodelan Gaya dan Momen Sting Balance', '<p>Hasil kalibrasi beban untuk <em>sting balance </em>yang didapatkan berguna untuk melakukan perhitungan gaya dan momen aerodinamika pada pengujian terowongan angin supersonik LAPAN. Namun belum ada penjelasan detail mengenai mekanisme gaya dan momen yang pada <em>sting balance</em> karena proses kalibrasi yang dilaksanakan memperlakukan <em>sting balance </em>seperti <em>black box </em>di mana kita tidak perlu mengerti proses yang terjadi di dalam sistem <em>sting balance</em>, tetapi hanya memperdulikan <em>input</em> dan <em>output </em>dari sistem tersebut. Tulisan ini bertujuan untuk menjelaskan proses pembangunan model matematika yang mampu menjelaskan mekanisme gaya dan momen yang terjadi pada <em>sting balance</em>. Metode yang ditempuh terdiri dari beberapa tahap yaitu penjelasan terhadap konsep penginderaan pada <em>sting balance</em> kemudian dilanjutkan penjelasan terhadap akuisisi data, konsep kalibrasi, dan hasil yang didapatkan. Tahap berikut yaitu pembangunan model matematika dari analisis gaya dan momen pada <em>sting balance</em>. Hasil yang didapatkan yaitu model matematika untuk gaya dan momen aerodinamika pada sting balance dan persamaan matriks kalibrasi untuk pengujian terowongan angin supersonik LAPAN.</p>
INSERT INTO note VALUES (699, 303, 'Pemodelan dan Analisis Kalibrasi pada External Balance', '<p>Prosedur pelaksanaan kalibrasi pada terowongan angin subsonik LAPAN tidak menjelaskan secara lengkap mekanisme gaya dan momen pada <em>external balance</em> yang memiliki enam derajat kebebasan dan bekerja secara independen. Hasil kalibrasi yang diperoleh sulit untuk diinterpretasi dan dianalisis karena independensi masing-masing <em>load cell</em> tidak terlihat. Hampir setiap <em>load cell </em>yang dikalibrasi tidak hanya menghasilkan respon dari <em>load cell </em>yang diinginkan namun juga menghasilkan respon dari <em>load cell</em> lain. Tulisan ini bertujuan untuk menjelaskan proses pembangunan model matematika yang mampu menjelaskan mekanisme gaya dan momen yang terjadi ketika pelaksanaan kalibrasi <em>external balance</em>. Metode yang ditempuh terbagi menjadi beberapa tahap, yaitu penjelasan tentang sistem <em>external balance</em>, pemodelan sistem <em>external balance </em>dan kalibrasi gaya dan momen, dan kemudian pelaksanaan kalibrasi dan analisis kalibrasi berdasarkan model kalibrasi yang telah dibangun. Hasil yang diperoleh adalah model matematika untuk gaya dan momen aerodinamika pada <em>external balance</em> dan persamaan matriks kalibrasi untuk pengujian terowongan angin subsonik LAPAN.</p>
