INSERT INTO note VALUES (722, 384, 'Technical Note-01: Review Mekanika Terbang', '<p>Untuk mendesain algoritma system kerja dalam suatu Ground Control System (GCS) untuk aircraft atau UAV (Unmanned Aerial Vehicle) memerlukan pemahaman konsepsi dasar tentang Mekanika Terbang. Ilmu mekanika terbang mempelajari karakteristik benda/wahana bergerak di udara yang meliputi <strong>definisi&amp;sasaran, ilmu-ilmu yang terkait dengan mekanika terbang, gerak pesawat terbang, tata acuan koordinat &amp; Orientasi, prestasi terbang, dinamika terbang, kendali terbang, navigasi &amp; panduan Terbang dan metode pengkajian mekanika terbang.</strong></p>', 'TN001GCS.pdf', 2, NULL, 1, 2015, '2015-01-12 12:21:40.620456', 1, 'TN001GCS.pdf', 1, 0);
