INSERT INTO note VALUES (708, 418, 'Pemotretan Puncak Gunung Merapi', '<p>Sebelum melaksanakan suatu misi terbang diperlukan sebuah perencanaan penerbangan yang akan dilaksanakan untuk penerbangan semua tipe LSU.</p>
INSERT INTO note VALUES (709, 369, 'PENGUJIAN JARING DAN TAIL HOOK LSU-HAN', '<p>Sebuah sistem pendaratan merupakan salah satu bagian yang penting dalam sebuah misi penerbangan baik itu untuk pesawat penerbangan tanpa awak maupun penerbangan berpenumpang. Sering dalam misi penerbangannya LSU mengalami hambatan dan kesulitan terutama yang berhubungan dengan landasan pacu. Dimana banyak diantara lokasi-lokasi terbang tidak terdapat lancasan pacu yang memadai sehingga pilot akan kesulitan untuk <em>take off</em> maupun <em>landing, </em>seperti hal-nya ketika melakukan misi penerbangan dari atas kapal angkatan laut yaitu KRI Diponegoro. Kerena operasi dek pendaratan tergantung untuk tingkat besarnya sudut dan pada kemampuan pesawat menangkap kait untuk mengaitkan pada lintas sling tali ditengah dek tengah kapal.<em>Landing system</em> pada dek kapal adalah salah satu hal yang paling sulit dilakukan dalam penerbangan tanpa awak.</p>', 'TR_Jaring_dan_Tail_Hook-Pengujian.pdf', 2, NULL, 1, 2015, '2015-01-09 13:28:22.735767', 1, 'TR_Jaring_dan_Tail_Hook-Pengujian.pdf', 1, 0);
INSERT INTO note VALUES (710, 432, 'FIRST FLIGT TEST LSU-05  SISTEM AVIONIK ', '<p>Flight Test adalah suatu tahapan uji terbang dari suatu pesawat terbang yang harus dilalui untuk mendapatkan data-data karakteristik pesawat baik itu aerodinamik, struktur, propulsi, avionik maupun kestabilan pesawat terbang.</p>
