INSERT INTO note VALUES (712, 335, 'Perhitungan Thrust berdasarkan Koefisien Thrust', '<p><em>Propeller </em>merupakan bagian dari sistem propulsi yang menghasilkan gaya dorong (<em>thrust</em>) yang dihasilkan dari energi putar (poros yang berputar) yang dihasilkan oleh mesin/ <em>engine</em>. <em>Engine</em> yang digunakan oleh pesawat N219 adalah engine turboprop <em>Pratt &amp; Whitney</em> jenis PT6A-42.</p>
