INSERT INTO note VALUES (723, 384, 'Technical Note-2: Konsepsi kendali terbang dan Review Matlab', '<p>Konsepsi kendali terbang harus difahami dengan baik untuk mendesain parameter-parameter yang dibutuhkan dalam rancangan GCS untuk melakukan proses kendali perilaku pesawat/UAV dan menvisualisasikannya. Untuk memahami konsepsi kendali terbang harus memahami bagian-bagian sangat penting dalam kendali terbang yaitu dinamika terbang, persamaan gerak pesawat udara, gerak karakteristik pesawat udara dan persamaan gerak &amp; gerak karakteristik pesawat antariksa.</p>', 'TN002WP2GCS.pdf', 3, NULL, 1, 2015, '2015-01-12 12:23:15.76414', 1, 'TN002WP2GCS.pdf', 1, 0);
INSERT INTO note VALUES (725, 384, 'Konsep Awal Ground Control Station(GCS) [menentukan tujuan dan kebutuhan desain]', '<p>GCS (Ground Control Station) pasti dibutuhkan untuk memonitor dan melakukan kontrol misi UAV yang dikembangkan oleh Pustekbang LAPAN. Namun bagaimana rancangan dan kebutuhan apa saja yang dibutuhkan dalam desain agar sesuai dengan kebutuhan itu yang menjadi tantangan tersendiri untuk direalisasikan. Makanya dibutuhkan Konsep Awal yang bisa mengakomodir kebutuhan-kebutuhan yang ada dan bisa mudah dikembangkan lebih lanjut. Untuk konsep awal GCS pada perancangan saat ini diberi nama GCS LAPAN v1.0 yang dirancang memiliki kemampuan monitoring sikap pesawat dari data modul ardupilot mega dan menampilkan sikap pesawat tersebut di di software X-Plane &nbsp;3 dimensi. Dengan mengembangkan konsep GCS dari awal, harapannya bisa lebih mudah untuk melakukan trouble shooting dan pengembangan berikutnya.</p>', 'TN003WP2GCS.pdf', 4, NULL, 1, 2015, '2015-01-14 15:21:40.890329', 1, 'TN003WP2GCS.pdf', 1, 0);
INSERT INTO note VALUES (1185, 915, ' Analisa Beban Aerodinamika Sayap & Ekor Pesawat Nirawak LSU-03 dengan Simulasi CFD (Bag Analisis & Pengolahan Data)', 'Dalam merancang pesawat, analisis beban aerodinamika sangat perlu dilakukan untuk memperoleh data beban yang akan digunakan pada perancangan struktur. Pada design awal beban yang dialami struktur dianggap terdistribusi merata, sehingga design kekuatan struktur dibuat sama sepanjang span sayap tersebut. akibatnya, struktur sayap menjadi tidak optimal karena beban yang dialami oleh sayap tersebut pada kenyataannya tidak terdistribusi merata. 
INSERT INTO note VALUES (726, 335, 'Engine Mounting', '<p>Pembahasan dalam laporan ini adalah mengenai &ldquo;<em>Engine Mounting</em>&rdquo; yaitu berisi suatu informasi yang perlu dipelajari sehingga diketahui informasi apa saja yang membantu produsen <em>airframe</em> pesawat untuk mendesain instalasi pemasangan sistem dudukan <em>engine</em> (<em>engine mounting</em>) yang cocok. <em>Engine Mounting</em> sebagai suatu sistem dudukan dapat mempengaruhi pengoperasian engine, semua detail sistem mounting yang diusulkan harus diserahkan ke Pratt &amp; Whitney Canada Corp. untuk dimintai komentarnya.</p>
