INSERT INTO note VALUES (777, 713, 'Merakit Pesawat Sky Walker (LSU  01)', '<p>Lapan Surveilance UAV &ndash; 01 ( LSU &ndash; 01 ) adalah sebuah wahana terbang tidak berawak, atau disebut juga UAV ( Unmanned Aircraft Vehicle ), saat ini Lapan telah banyak uji coba pesawat LSU-01 dan sudah diaplikasikan untuk keperluan pemotretan pesawahan atau untuk kerja sama dengan instansi sipil maupun militer. Pesawat terbang LSU - 01 ini memiliki berbagai fungsi, namun secara umum memiliki komponen utama yang sama dengan pesawat nirawak lainnya. Pesawat LSU &ndash; 01 memiliki komponen yakni : Fuselage (badan), sayap (wing) dan Ekor.</p>', 'LAPORAN_KEGIATAN_deden_03_2015.pdf', 1, NULL, 3, 2015, '2015-03-30 10:02:04.133655', 1, 'LAPORAN_KEGIATAN_deden_03_2015.pdf', 1, 0);
