INSERT INTO note VALUES (732, 705, 'Flight Control Pesawat Tanpa Awak LSU', '<p>Wahana pesawat tanpa awak banyak digunakan dalam kehidupan untuk misi sipil dan militer. salah satu misinya adalah surveilance pada lahan padi, surveilance banjir dan bencana alam lainnya. pergerakan pesawat saat melakukan misinya bisa terjadi karena adanya sistem flight control pesawat oleh karena itu perlu adanya pengkajian sistem flight control lebih lanjut. pada laporan ini dibahas secara umum tentang flight control pesawat pada umumnya dan pada pesawat tanpa awak pada khususnya. pengujian sistem flight control pada LSU dilakukan secara simulasi terbang di X-Plane sehingga menghemat waktu dan biaya pengujian. hasil dari pengujian menunjukkan grafik pulsa pada yoke aileron diberikan untuk menstabilkan sikap roll pesawat dan adanya delay akibat moment inersia pesawat itu sendiri. waktu untuk mencapai stabil roll pada model LSU tipe glider 8-10 detik, dengan pulse aileron aktif selama 1-2 detik.</p>', 'Flight_Control_LSU.pdf', 1, NULL, 3, 2015, '2015-03-13 10:28:56.331153', 1, 'Flight_Control_LSU.pdf', 1, 0);
