INSERT INTO note VALUES (1188, 907, 'Finishing Pembuatan Model Uji Lapan Surveillance UAV 05 (LSU-05)', 'Saat ini LAPAN mengembangkan Pesawat tanpa awak yaitu Lapan Surveillance UAV 05. LSU-05 merupakan varian baru dari pesawat tanpa awak buatan Pusat Teknologi Penerbangan (Pustekbang) Lapan. Pesawat ini dirancang untuk mampu membawa muatan seberat 25 hingga 30 kilogram. Pembuatan Model uji LSU-05 adalah menggunakan bahan baku styrofoam. Styrofoam atau plastik busa merupakan salah satu jenis plastik dari sekian banyak bahan lainnya. Styrofoam lazim digunakan sebagal bahan pelindung dan penahan getaran barang-barang yang fragile, seperti elektronik. Namun, saat ini bahan tersebut juga banyak digunakan sebagai bahan pembuatan model uji. Adapun spesifikasi dari model uji LSU-05 adalah panjang sayap total 196 cm, dan panjang bodi 69 cm. Sekarang dilanjutkan untuk finishing pembuatan model LSU-05.', 'Laporan_Pelaksanaan_Kegiatan_aGUSTUS_2015_DodotP.pdf', 3, NULL, 8, 2015, '2015-08-31 15:22:31.706099', 1, 'Laporan_Pelaksanaan_Kegiatan_aGUSTUS_2015_DodotP.pdf', 1, 0);
INSERT INTO note VALUES (736, 703, 'TN01:Menetapkan Acuan Studi Banding dengan mereview ArduPilot Mega ', '<p>Penguasaan secara mandiri sistem <em>embedded</em> controller adalah mutlak harus dilakukan karena merupakan kunci keberhasilan dalam rancang bangun sistem kendali terbang bahkan sistem autopilot LSU (Lapan Surveillance UAV). Dalam mengembangkan sistem <em>embedded</em> tidak bisa terpisahkan antara pengembangan <em>software</em> (perangkat lunak) kendali terbang dan <em>hardware</em>(perangkat) keras. <em>Software</em> berupa algoritma program yang ditulis dalam bahasa pemrograman disiapkan mengikuti rancangan alur program kendali terbang/autopilot yang akan ditanamkan ke dalam <em>hardware</em> sistem <em>embedded</em>, sedangkan <em>hardware</em> berupa rancangan sistem elektronika terdiri dari modul-modul <em>hardware</em> berdasarkan fungsi yang diinginkan perancang.</p>
INSERT INTO note VALUES (737, 703, 'Desain Awal Hardware Embedded Autopilot System', '<p>Penguasaan sistem embedded yang mengacu dengan APM2.5 untuk menguasai teknologi kendali terbang dan autopilot LSU. Agar mudah dalam troubleshooting dalam pengembangan reverse engineering ini menggunakan metode modular, yaitu dipisah antar modul controller, modul sensor dan modul interfacing. Dalam TN02 ini dilaporkan rancangan awal modul sensor.</p>', 'TN002HardwareEmbedded_rev1.pdf', 2, NULL, 3, 2015, '2015-03-16 15:40:16.591685', 1, 'TN002HardwareEmbedded_rev1.pdf', 1, 0);
INSERT INTO note VALUES (738, 687, 'Progress report 1', '<p>Dalam perancangan pesawat, hal yang sangat penting untuk diperhatikan yaitu sayap. Sayap adalah penghasil gaya angkat (<em>lift</em>) pada pesawat sehingga pesawat dapat terbang di udara. Untuk itu dalam memperoleh konfigurasi sayap yang sesuai dengan kebutuhan dari DR&amp;O yang telah ditentukan maka diperlukan pemilihan dari airfoil yang sesuai dengan kebutuhan pesawat. Untuk memperoleh airfoil yang sesuai maka pilihlah beberapa jenis airfoil yang kiranya dapat memenuhi kebutuhan gaya angkat dari pesawat yang akan dirancang. Airfoil yang akan dijadikan kandidat yaitu NACA 4415, Eppler 395, Epler 210, dan NACA 6412</p>', 'Technical_Note_1_WP_1.1._Airfoil.pdf', 1, NULL, 3, 2015, '2015-03-17 13:16:40.765599', 1, 'Technical_Note_1_WP_1.1._Airfoil.pdf', 1, 0);
