INSERT INTO note VALUES (779, 614, 'Menyusun Rencana Pembuatan Tangki Bahan Bakar pesawat terbang tanpa awak  LSU 03', '<p>Dalam &nbsp;menyusun rencana pembuatan <strong>Tangki Bahan Bakar LSU 03 </strong>harus dilakukan sesuai dengan disain yang sudah ditentukan, sehingga dapat mendukung dan mensukseskan program LAPAN. Berbagai struktur komposit dibuat dengan fiberglass atau carbonfiber yang saat ini mulai diperkenalkan untuk pesawat tanpa awak (LSU 03). &nbsp;Bahan komposit fiberglass dapat dibuat dalam waktu beberapa hari dengan hasil yang memiliki kepresisian yang tinggi, khususnya &nbsp;jika telah dibuatkan cetakan atau moold yang betul-betul presisi.</p>', 'LAPORAN_PELAKSANAAN_RENCANA_PEMBUATAN_TANGKI.pdf', 1, NULL, 3, 2015, '2015-03-30 13:46:54.704028', 1, 'LAPORAN_PELAKSANAAN_RENCANA_PEMBUATAN_TANGKI.pdf', 1, 0);
