INSERT INTO note VALUES (744, 685, 'Flight Mechanics Model in MATLAB: Aerodynamic Model', '<p><span style="font-size: 12pt; color: #000000; font-style: normal; font-variant: normal;">This technical note explains about the activity LSA-UAV team during January until<span style="font-size: 12pt; color: #000000; font-style: normal; font-variant: normal;"> February. During these months Wolfram Meyer Br&uuml;gel as an engineer from TU Berlin<span style="font-size: 12pt; color: #000000; font-style: normal; font-variant: normal;"> come to PUSTEKBANG LAPAN. He comes to assist LSA-UAV team to do some<span style="font-size: 12pt; color: #000000; font-style: normal; font-variant: normal;"> exercises about mathematical model using MATLAB. There are three sub model which<span style="font-size: 12pt; color: #000000; font-style: normal; font-variant: normal;"> have been created: Aerodynamic model, engine model and actuator model.<br style="font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: -webkit-auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px;" /></span></span></span></span></span></p>', 'TN1_-_RF.pdf', 1, NULL, 3, 2015, '2015-03-19 10:17:00.860852', 1, 'TN1_-_RF.pdf', 1, 0);
