INSERT INTO note VALUES (760, 683, 'Desain Sistem Pengujian Solar LSU', '<p>Technical note ini menjelaskan mengenai perancangan sistem<br />pengujian Solar LSU. Pengujian meliputi pengujian penggunaan daya dengan<br />mengkur tegangan dan arus. Selain itu diuji juga daya dorong yang dihasilkan oleh<br />LSU Solar dengan mengukur menggunakan sensor load cell.</p>', 'TN1_-_AW.pdf', 1, NULL, 3, 2015, '2015-03-26 11:25:38.14685', 1, 'TN1_-_AW.pdf', 1, 0);
INSERT INTO note VALUES (762, 771, 'Konsep Komunikasi Data Maritim Surveillance UAV', '<p>Pada laporan ini dibahas tentang konsep komunikasi data maritim surveillance system dengan UAV. dimulai dari pengertian komunikasi data sampai analisa teknologi komunikasi wireless radio modem IP microhard dan komunikasi satelit untuk mendukung jangkauan wilayah perairan Indonesia yang luas. teknologi ini bisa diimplementasikan ke UAV di Lapan dengan cukup efektif untuk MSS.</p>', 'TN_Konsep_KOmunikasi_Data_MSS.pdf', 1, NULL, 3, 2015, '2015-03-26 14:30:31.217803', 1, 'TN_Konsep_KOmunikasi_Data_MSS.pdf', 1, 0);
INSERT INTO note VALUES (758, 644, 'KONFIGURASI DATA LINK COMMUNICATION', '<p>Pusat Teknologi Penerbangan LAPAN telah melakukan penelitian dan pengembangan UAV untuk tujuan surveillance, kegiatan tersebut dinamakan LSU (LAPAN <em>Surveillance</em> UAV) yang telah dimulai pada tahun 2012 sampai sekarang.&nbsp; Pengembangkan berbagi fariasi dari LSU (LAPAN Surveillance UAV), diawali dari LSU-01 sampai dengan LSU-05. Fariasi tipe LSU tersebut berdasarkan beban payload yang mampu dibawa oleh UAV sesuai dengan misi terbang yang akan dilaksanakan.</p>
