INSERT INTO note VALUES (785, 640, 'Desain Skema Kendali Terbang Avionik LSU 02/03', '<p>Aplikasi pemantauan dengan pesawat tanpa awak semakin berkembang. Beberapa pemanfaatan pesawat tanpa awak yaitu untuk pemetaan, pemantauan dengan video. Untuk pengendalian pesawat tanpa awak diperlukan sistem elektronik yang berupa sistem avionik. Di Program Pustekbang sistem avionik merupakan keseluruhan sistem elektronik yang berhubungan dengan kendali terbang pesawat LSU 02/03. Dengan dituntutnya hilirisasi produk teknologi maka perlu dilakukan desain skema avionik yang mudah digunakan oleh user dan tetap memilki spesifikasi yang sesuai standar avionik untuk LSU02/03.</p>', 'Laporan_LSU02-03_Maret_2015.pdf', 1, NULL, 3, 2015, '2015-03-31 09:33:53.725264', 1, 'Laporan_LSU02-03_Maret_2015.pdf', 1, 0);
INSERT INTO note VALUES (903, 561, 'Sistem Kendali Terbang N219', 'Kendali terbang utama akan terdiri dari aileron, elevator dan rudder, dan kendali sekunder akan terdiri dari flap, trim tab dan servo tab.', 'Laporan_ToT_N219_April.pdf', 1, NULL, 4, 2015, '2015-04-30 10:19:13.229601', 1, 'Laporan_ToT_N219_April.pdf', 1, 0);
