INSERT INTO note VALUES (761, 770, 'ANALISA KEKURANGAN SISTEM AVIONIK LSU-05', '<p class="p0">usat&nbsp;Teknologi&nbsp;Penerbangan&nbsp;LAPAN&nbsp;telah&nbsp;melakukan&nbsp;penelitian&nbsp;dan&nbsp;pengembangan&nbsp;UAV&nbsp;untuk&nbsp;tujuan&nbsp;surveillance,&nbsp;kegiatan&nbsp;tersebut&nbsp;dinamakan&nbsp;LSU&nbsp;(LAPAN&nbsp;Surveillance&nbsp;UAV)&nbsp;yang&nbsp;telah&nbsp;dimulai&nbsp;pada&nbsp;tahun&nbsp;2012&nbsp;sampai&nbsp;sekarang.&nbsp;&nbsp;Pengembangkan&nbsp;berbagi&nbsp;fariasi&nbsp;dari&nbsp;LSU&nbsp;(LAPAN&nbsp;Surveillance&nbsp;UAV),&nbsp;diawali&nbsp;dari&nbsp;LSU-01&nbsp;sampai&nbsp;dengan&nbsp;LSU-05.&nbsp;Fariasi&nbsp;tipe&nbsp;LSU&nbsp;tersebut&nbsp;berdasarkan&nbsp;beban&nbsp;payload&nbsp;yang&nbsp;mampu&nbsp;dibawa&nbsp;oleh&nbsp;UAV&nbsp;sesuai&nbsp;dengan&nbsp;misi&nbsp;terbang&nbsp;yang&nbsp;akan&nbsp;dilaksanakan.</p>
