INSERT INTO note VALUES (770, 756, 'Pembuatan program antar muka kalibrasi balance supersonik', '<p><span>LAPAN memiliki terowongan angin supersonik yang sampai saat ini masih beroperasi.<br /><span>Kecepatan yang dihasilkan dari terowongan angin supersonik adalah 1- 3.5 mach. Terowongan<br /><span>angin ini beroperasi dengan cara menghembuskan angin yang sudah diisi pada storage tank.</span></span><br /><br class="Apple-interchange-newline" /></span></p>', 'jep_Report_maret_(skp).pdf', 1, NULL, 3, 2015, '2015-03-29 17:19:18.107573', 1, 'jep_Report_maret_(skp).pdf', 1, 0);
INSERT INTO note VALUES (771, 798, 'PEMBUATAN MAL MOULDING FUSELAGE LSU-05', '<p>Lapan Surveilance UAV-05 (LSU-05) adalah sebuah wahana terbang tidak berawak, dalam bahasa asing sering disebut dengan istilah UAV ( Unmanned Aircraft Vehicle ) atau pesawat udara nir awak.</p>', 'LAPORAN_KEGIATAN_pa_sri.pdf', 1, NULL, 3, 2015, '2015-03-30 09:03:42.075168', 1, 'LAPORAN_KEGIATAN_pa_sri.pdf', 1, 0);
