INSERT INTO note VALUES (787, 640, 'TERM OF REFERENCE (TOR) PROGRAM PENELITIAN EMBEDDED SYSTEM PUSAT TEKNOLOGI PENERBANGAN', '<p>TOR ini disusun sebagai dasar pelaksanaan kegiatan penelitian dan pengembangan Embedded System di Pusat Teknologi Penerbangan, Sistematikanya terdiri dari Judul, Abstrak, pendahuluan, permasalahan, hipotesa/kegunaan khusus, metodologi, lingkup kegiatan, hasil yang diharapkan disertai lampiran-lampiran : anggaran dan kebutuhan bahan serta jadwal kegiatan, disertai juga lampiran kebutuhan peralatan pendukung penelitian TA 2015.</p>', 'TOR_Embedded_System_2015.pdf', 3, NULL, 3, 2015, '2015-03-31 09:36:36.226373', 1, 'TOR_Embedded_System_2015.pdf', 1, 0);
