INSERT INTO note VALUES (774, 737, 'Rancang Bangun Test Bed Vibration Engines Untuk Pengujian Engine LSU 02, 03 dan 05', '<p>Sebelum pengujian terhadap struktur wahana dilakukan, kita harus mengetahui karakteristik mesin yang akan digunakan pada wahana tersebut. Untuk mengetahui karakteristik mesin yang akan digunakan, tentunya kita harus melakukan pengujian terhadap mesin tersebut. Oleh karena itu diperlukan sarana penunjang untuk mengetahui karakteristik mesin tersebut. Sarana ini biasa disebut sebagai dudukan tempat pengujian mesin (Testbed engine). Sarana atau alat ini harus kaku dan rigid agar tidak menimbulkan resonansi ketika mesin diuji.</p>
INSERT INTO note VALUES (775, 716, 'Merakit Pesawat Sky Walker (LSU  01) ', '<p>Lapan Surveilance UAV &ndash; 01 ( LSU &ndash; 01 ) adalah sebuah wahana terbang tidak berawak, atau disebut juga UAV ( Unmanned Aircraft Vehicle ), saat ini Lapan telah banyak uji coba pesawat LSU-01 dan sudah diaplikasikan untuk keperluan pemotretan pesawahan atau untuk kerja sama dengan instansi sipil maupun militer. Pesawat terbang LSU - 01 ini memiliki berbagai fungsi, namun secara umum memiliki komponen utama yang sama dengan pesawat nirawak lainnya. Pesawat LSU &ndash; 01 memiliki komponen yakni : Fuselage (badan), sayap (wing) dan Ekor.</p>', 'LAPORAN_KEGIATAN_deden_03_2015.pdf', 1, NULL, 3, 2015, '2015-03-30 09:58:29.78966', 1, 'LAPORAN_KEGIATAN_deden_03_2015.pdf', 1, 0);
