INSERT INTO note VALUES (786, 640, 'Desain Hardware Autopilot Mandiri', '<p>Aplikasi pemantauan dengan pesawat tanpa awak semakin berkembang. Beberapa pemanfaatan pesawat tanpa awak yaitu untuk pemetaan, pemantauan dengan video. Untuk pengendalian pesawat tanpa awak diperlukan sistem embedded yang berfungsi sebagai autopilot. Beberapa sistem autopilot sudah dikembangkan di dunia di antaranya Micropilot, Picolo, FeYutech, PX4, MultiwII, dan Ardupilot Mega(APM). Dari beberapa macam sistem autopilot Ardupilot Mega merupakan sistem Autopilot yang pengembangannya secara opensource dan hardware embeddednya lumayan mudah didapatkan serta relatif murah (low cost). APM sudah memiliki fitur yang lumayan lengkap untuk menjalankan misi terbang dengan pesawat tanpa awak.</p>', 'Laporan_Embedded_Maret_2015.pdf', 2, NULL, 3, 2015, '2015-03-31 09:35:12.959161', 1, 'Laporan_Embedded_Maret_2015.pdf', 1, 0);
