INSERT INTO note VALUES (790, 652, 'KONFIGURASI PITOT TUBE  AIR SPEED', '<p class="p0">Laporan&nbsp;ini&nbsp;merupakan&nbsp;laporan&nbsp;observasi&nbsp;terhadapat&nbsp;alat&nbsp;pitot&nbsp;tube&nbsp;untuk&nbsp;menentukan&nbsp;air&nbsp;speed&nbsp;Solar&nbsp;LSU&nbsp;pada&nbsp;saat&nbsp;ji&nbsp;terbang.&nbsp;Pada&nbsp;laporan&nbsp;ni&nbsp;juga&nbsp;akan&nbsp;diberikan&nbsp;desain&nbsp;konfigurasi&nbsp;pemasangan&nbsp;pitot&nbsp;tube&nbsp;pada&nbsp;modul&nbsp;Auto&nbsp;pilot&nbsp;APM.2.6</p>', 'TN_Pitot_Tube_LSU_Solar.pdf', 1, NULL, 3, 2015, '2015-03-31 11:45:35.045408', 1, 'TN_Pitot_Tube_LSU_Solar.pdf', 1, 0);
