INSERT INTO note VALUES (794, 762, 'LAPORAN PELAKSANAAN PELAYANAN KEGIATAN  L-01', '<p style="text-align: justify;">Cluster computer adalah suatu sistem perangkat keras dan perangkat lunak yang menggabungkan beberapa komputer dalam suatu jaringan dimana komputer tersebut dapat bekerjasama dalam pemrosesan suatu masalah. dari penggabungan beberapa komputer dalam satu jaringan tentu komputer tersebut dapat menghasilkan kecepatan yang sangat tinggi dalam prosesnya.</p>
INSERT INTO note VALUES (793, 695, 'LAPORAN PELAKSANAAN PELAYANAN KEGIATAN 1', '<p style="text-align: justify;">Karena begitu pentingnya cluster komputer untuk bisa on satu hari 24 jam, maka diperlukan alat pendukung pula yaitu sumber daya cadangan yang bisa membackup bilamana terjadi gangguan pada sumber daya yang disediakan oleh PLN. Cluster komputer pustekbang mempunyai kapasitas komputer 100 unit komputer yang di terhubung secara paralel dan dioperasikan secara bersamaan dalam instalasi listriknya dibagi menjadi 10 kelompok dan masing-masing kelompok berjumlah 10 unit komputer.&nbsp;</p>
