INSERT INTO note VALUES (815, 602, 'Usulan revisi Perpres 54 tahun 2010 tentang Pengadaan Barang/Jasa Pemerintah', '<p>Pelaksanaan Perpres 54 tahun 2010 tentang Pengadaan Barang/Jasa Pemerintah banyak sekali kelemahannya dalam pelaksanaan di lapangan, khususnya di Lembaga yang bergerak dibidang litbangyasa. Aturan seperti : tidak boleh "mengarah" ke sebuah merk, program yang ditekankan untuk dilaksanakan sistem single year dan beberapa masalah lainnya sangat menghambat proses kegiatan litbangyasa sehingga hasilnya kurang maksimal.</p>
