INSERT INTO note VALUES (799, 692, 'Laporan Kegiatan Maret 2015, Perawatan Instalasi Daya Listrik Cluster Komputer', '<p>Cluster computer kapasitas 100 unit computer yang di install secara paralel dan dioperasikan secara bersamaan, dalam instalasi listriknya dibagi menjadi 10 kelompok dan masing-masing kelompok berjumlah 10 unit computer. Untuk mengoperasikan &nbsp;&nbsp;sistem tersebut dibutuhkah daya listrik sekitar 22 KW yang diambilkan dari Gardu-SR5 melalui gedung Subsonic dan di back-up dengan diesel kapasitas 60 KVA yang dioperasikan secara otomat, bila terjadi gangguan listrik maka genset akan start secara otomat dalam waktu 30 detik, dan kebutuhan power listrik selama genset starting sekitar 30 detik, akan disuplay oleh baterai yang ada dalam UPS. Demikian juga bila power listrik PLN sudah normal kembali, maka genset akan Off secara otomat.</p>
