INSERT INTO note VALUES (861, 783, 'Laporan Pengembangan Instrumentasi Pengujian Propulsi LSU', 'Pengujian system propulsi pesawat tanpa awak diperlukan guna mengetahui performa dari mesin. Pesawat LSU 02, 03 dan 05 masing-masing menggunakan mesin dengan kapasitas berbeda, mulai dari 30 cc sampai 170 cc untuk 05. Ada beberapa parameter yang perlu diketahui yaitu gaya dorong mesin, besar konsumsi bahan bakar, temperature mesin, RPM, getaran mesin, dan kebisingan yang ditimbulkan. Pengembangan Instrumentasi pengujian propulsi ini bertujuan untuk membuat suatu system pengukuran sehingga data-data parameter yang diterima oleh sensor dapat ditampilkan pada satu interface dan tersimpan dalam suatu database.', 'Laporan_Pengembangan_Instrumentasi_Propulsi_LSU.pdf', 1, NULL, 4, 2015, '2015-04-09 09:52:56.675273', 1, 'Laporan_Pengembangan_Instrumentasi_Propulsi_LSU.pdf', 1, 0);
INSERT INTO note VALUES (862, 597, 'DESAIN SLIDER UNTUK DUDUKAN POD  PEMBAWA KAMERA UDARA PADA PESAWAT LSA ', 'Desain slider dudukan kamera udara ini harus mampu menahan aliran udara yang datang pada saat pesawat melakukan penerbangan, sehingga perlu dilakukan simulasi kekuatan alat tersebut agar memiliki kekuatan yang cukup dengan berat yang ringan.', 'Laporan_Program_Pengoperasian_dan_Perawatan_LSA_Maret.pdf', 1, NULL, 4, 2015, '2015-04-09 11:11:50.104727', 1, 'Laporan_Program_Pengoperasian_dan_Perawatan_LSA_Maret.pdf', 1, 0);
