INSERT INTO note VALUES (873, 410, 'Optimasi LSU-01', 'Diseminasi LSU-01 pada tahun 2014 difokuskan pada kemandirian dalam mengaplikasikan LSU-01 dalam berbagai kondisi peliputan. Yang pertama LSU-01 diaplikasikan untuk memotret puncak gunung Merapi bekerja sama dengan Pusat Studi Bencana Alam (PSBA) UGM sebagai pengguna data. Dalam pemotretan ini baik perencanaan, pengoperasian dan pilot seluruhnya dilakukan oleh karyawan Pustekbang. Selanjutnya peliputan kejadian longsong di daerah Bajarnegara yang menelan banyak korban juga coba dilakukan secara mandiri. Peliputan ini tidak mencakup daerah yang begitu luas namun kemiringan topografi yang diliput dan ketinggian tempat yang sulit dijangkau memberikan pengalaman tersendiri untuk dilakukan. Kemudian untuk meningkatkan kemampuan aplikasi LSU-01 juga dilakukan perancangan teknik penyebaran kupon berhadiah dari UAV. Aplikasi ini telah diterapkan dalam acara perayaan hari ulang tahun LAPAN yang ke 51 tahun 2014 di Pustekbang, Rumpin, Bogor.', 'Diseminasi_LSU-01_Tahun_2014.pdf', 1, NULL, 4, 2015, '2015-04-17 11:19:45.870811', 1, 'Diseminasi_LSU-01_Tahun_2014.pdf', 1, 0);
