INSERT INTO note VALUES (906, 695, 'Pengujian LSU-03 pada Terowongan Angin Subsonik LAPAN. ', 'Dalam proses perancangan Unmanned Aerial Vehicle atau disingkat UAV / Pesawat tanpa awak  diperlukan analisa aerodinamika untuk mengetahui sejauh mana hasil perancangan memenuhi karakteristik terbang yang diinginkan. Dalam mendukung analisa aerodinamika dilakukan pengujian wind tunnel (terowongan angin) untuk mengetahui besaran-besaran aerodinamika. Hasil dari pengujian tersebut digunakan untuk perbandingan terhadap hasil-hasil perhitungan prediktif (VLM, VS Aero dan Datcom). Selanjutnya, perbandingan juga dilakukan dengan kajian hasil perancangan konfigurasi terutama dari sisi aerodinamika untuk memperoleh karakteristik aerodinamika yang diinginkan.', 'Laporan1_Pelaksanaan_Kegiatan_April_2015_DodotPr.pdf', 2, NULL, 4, 2015, '2015-04-30 10:39:30.155246', 1, 'Laporan1_Pelaksanaan_Kegiatan_April_2015_DodotPr.pdf', 1, 0);
