INSERT INTO note VALUES (915, 765, 'Melakukan perawatan Mesin Kompresor Kapasitas 132 KW', 'Mesin Kompresor kapasitas 132 KW adalah jenis baru yang berfungsi mengisi tangki dengan tekanan tinggi. Agar udara yang dihasilkan benar2 bersih, kompresor ini dilengkapi dengan pengering udara  yang mampu bekerja pada tekanan tinggi, untuk itu komponen pada harus selalu diperiksa jangan sampai udara tersumbat karena kotoran atau posisi katup2 nya yang tidak sesuai. Komponen filter pada kompresor dan filter pada pengering udara harus sering di periksa dan dibersihkan setiap pegujian. ', 'LAPORAN_KEGIATAN_SOFIAN_SYAHRANI_aprilP.pdf', 2, NULL, 4, 2015, '2015-04-30 11:16:35.350475', 1, 'LAPORAN_KEGIATAN_SOFIAN_SYAHRANI_aprilP.pdf', 1, 0);
