INSERT INTO note VALUES (942, 724, 'Laporan Spek sensor pengujian', 'RTD atau Resistance Thermal Detector merupakan salah satu jenis sensor temperature yang memiliki tingkat keakurasian lebih tinggi dibanding sensor temperatur lain seperti termokopel. RTD yang dipilih adalah jenis mount surface yang dapat ditempel langsung pada bidang yang akan diukur temperaturnya. Pada aplikasinya sensor ini akan ditempelkan pada engine untuk mengetahui panas yang dihasilkan selama engine running', 'LaporanSA1-RTD_spek.pdf', 1, NULL, 4, 2015, '2015-04-30 16:15:36.119768', 1, 'LaporanSA1-RTD_spek.pdf', 1, 0);
