INSERT INTO note VALUES (932, 737, 'Rancang Bangun Universal Test Fixture Untuk Pengujian Struktur Pesawat LSU 02, 03 dan 05', 'Untuk menerbangkan suatu wahana tanpa awak beserta seluruh sistemnya, diperlukan beberapa persyaratan uji kelayakan bagi seluruh sistem wahana tersebut. Uji kelayakan tersebut dilakukan untuk mengetahui kehandalan seluruh sistem terhadap pengaruh-pengaruh lingkungan internal maupun eksternal dengan pengukuran-pengukuran yang dilaukan secara simultan. Hal ini termasuk kemungkinan bekerjanya seluruh sistem elektronik terkait dengan sistem mekanik, hidrolik atau pneumatik dan ketergantungan umur alat, waktu operasi pada kondisi internal dan eksternal terhadap pengaruh lingkungan yang akan diterima oleh seluruh sistem wahana secara terintegrasi. Termal dan getaran merupakan pengaruh dari dua parameter lingkungan yang secara bersamaan akan dialami oleh suatu wahana pada saat terbang mengangkasa. Kedua buah parameter ini sangatlah berpengaruh terhadap seluruh sistem wahana, oleh karena itu sangatlah penting pengujian termal dan getaran ini dilakukan sebelum suatu wahana tanpa awak diterbangkan.', 'TR2.pdf', 4, NULL, 4, 2015, '2015-04-30 14:38:08.60211', 1, 'TR2.pdf', 1, 0);
