INSERT INTO note VALUES (926, 611, 'Melakukan pembuatan struktur pesawat UAV LSU-02 untuk Desiminasi', 'Untuk mendukung program lapan dalam pengembangan pesawat UAV untuk desiminasi maka di lakukan pembuatan pesawat LSU 02 menggunakan bahan komposit .dalam pembuatan bias dilakukan dengan cara di ceta atau langsung di laminasi,contoh seperti pembuatan bodi pesawat itu akan lebih mudah bila langsung di cetak karena bodi pesawat ini harus mempunyai permukaan luar dan dalam yang halus. Beda dengan rudder dan sayap ,rudder dan sayap yang di perlukan kehalusan hanya permukaan yang luar saja.', 'lap_april_15.pdf', 1, NULL, 4, 2015, '2015-04-30 13:49:06.676524', 1, 'lap_april_15.pdf', 1, 0);
INSERT INTO note VALUES (1189, 909, 'Melakukan Pembuatan Model Pesawat LSU-05', 'Pembuatan model pesawat LSU-05 adalah untuk diuji di terowongan angin subsonik, untuk itu maka ukuran dan konstruksinya disesuaikan dengan ruang seksi uji terowongan angin terutama pada bagian bawah yaitu untuk penempatan model pada internal balance di dalam ruang seksi uji. Agar model bisa dipasang pada posisi yang bervariasi, maka dudukan ini harus dibuat yang flexible namun tetap kuat ', 'L_K_agus_sb___lsu_agustus.pdf', 3, NULL, 9, 2015, '2015-09-01 07:17:48.600604', 1, 'L_K_agus_sb___lsu_agustus.pdf', 1, 0);
INSERT INTO note VALUES (928, 614, 'Melakukan Pembuatan Tangki Bahan Bakar LSU 03', 'Pembuatan Tangki Bahan Bakar LSU 03  dilakukan dengan peralatan dan fasilitas yang ada di Pustekbang LAPAN. Kegiatan ini untuk mendukung program LAPAN. Struktur komposit  dengan fiberglass atau carbonfiber  menjadi bahan utama dalam pembuatan struktur tangki bahan bakar yang saat ini mulai diperkenalkan untuk pesawat tanpa awak (LSU 03).  Bahan komposit fiberglass dapat dibuat dalam  waktu yang lebih cepat  jika dibanding dengan bahan yang lain dan memiliki kepresisian yang tinggi, karena menggunakan cetakan atau moold yang betul-betul presisi', 'LAPORAN_PELAKSANAAN_Pembuatan_1Tangki_Bahan_Bakar_LSU_03.pdf', 2, NULL, 4, 2015, '2015-04-30 14:02:30.937462', 1, 'LAPORAN_PELAKSANAAN_Pembuatan_1Tangki_Bahan_Bakar_LSU_03.pdf', 1, 0);
