INSERT INTO note VALUES (930, 712, 'Melakukan pembuatan tripod antenna GCS', 'Untuk mendukung program lapan dalam pengembangan UAV maka di lakukan pembuatan tripod antena dengan baha pipa besi ,rencananya pipa pipa tiang ini nanti akan bias di lipat seperti antenna untuk mempermudah dalam pengangkutan dan pemasanganya. Tripod antenna ini bisa menopang beban kurang lebih 10 kilo gram .dalam pembuatan bias dilakukan dengan cara di las atau di bor langsung menggunakan baut. tripod ini mempunyai tiga kaki yang untuk menopang semua tiang, dan antenna yang akan di pasang', 'LAPORAN_GCS_1_april_2015_-_Copy.pdf', 1, NULL, 4, 2015, '2015-04-30 14:17:36.142846', 1, 'LAPORAN_GCS_1_april_2015_-_Copy.pdf', 1, 0);
