INSERT INTO note VALUES (960, 715, 'Melakukan integrasi tripod antena GCS', 'Maritim Surveillance system (MSS) adalah system monitoring pengawasan jarak jauh berbasis telemetri dengan background kelautan atau perbatasan. Untuk mendukung program PUSTEKBANG dalam pengembangan UAV yang terintegrasi MSS, diperlukan antenna yang berperan penting dalam misi ini. Tracking antenna dengan pondasi tiang tripod adalah prosedur untuk mendukung kegiatan Maritim Surveillance System.', 'LAPORAN_GCS_April_(riki).pdf', 1, NULL, 5, 2015, '2015-05-04 11:45:24.107296', 1, 'LAPORAN_GCS_April_(riki).pdf', 1, 0);
