INSERT INTO note VALUES (966, 586, 'KONFIGURASI ICD SISTEM AVIONIK', 'Saat ini desain dari sistem avionik sudah menyelesaikan konfigurasi ICD (Interface Control Document). ICD adalah dokumen yang menerangkan bagaimana seharusnya sistem avionik diintegrasikan di pesawat. Dokumen tersebut mencakup integrasi antar sistem avionik, integrasi dengan sistem electric, installasi (mechanical), juga kebutuhan proteksi environmental (cooling). Dokumen ini dijadikan acuan oleh group Design Integration untuk diterapkan menjadi production drawing. Juga dijadikan acuan bagi group system analysis untuk mengembangkan design. Konfigurasi keseluruhan dari Sistem Avionik yang sudah release dapat dilihat pada gambar di bawah ini', 'Laporan_Avionik_-_Yanuar_-_April.pdf', 1, NULL, 5, 2015, '2015-05-04 13:27:01.882981', 1, 'Laporan_Avionik_-_Yanuar_-_April.pdf', 1, 0);
INSERT INTO note VALUES (973, 559, 'Minutes of Meeting Rapat Pimpinan Terbatas N219', 'Rapat yang dipandu oleh Kepala Lapan dihadiri oleh para pejabat struktural Lapan dan Direksi PT DI membahas penyelesaian pekerjaan tahun 2014 dan agenda langkah selanjutnya dari tahun 2015 hingga target produksi massal pesawat N219 tahun 2017. Agenda rapat diutamakan untuk penyelesaian pekerjaan tahun 2014, penganggaran dan penyelesaian masalah administrasi terkait dengan Biro Renor Lapan dan Inspektorat. ', 'MoM_Rapat_Terbatas_Pimpinan_N219_02042015.pdf', 1, NULL, 5, 2015, '2015-05-05 11:02:00.176988', 1, 'MoM_Rapat_Terbatas_Pimpinan_N219_02042015.pdf', 1, 0);
