INSERT INTO note VALUES (967, 664, 'Perancangan ground test sistem solar LSU', 'Sebelum melakukan uji terbang solar cell pada airframe pesawat diperlukan suatu uji ground test untuk mengukur daya yang dihasilkan oleh solar cell dan beberapa parameter yang diperlukan. Parameter pengukuran meliputi arus dan tengangan keluaran PV solar cell, arus dan tegangan yang masuk ke motor serta besarnya RPM dan gaya dorong yang dihasilkan terhadap variasi bukaan throtle.  Sistem monitoring data dibuat dengan menggunakan piranti lunak open source dari arduino. Data dari sensor arus, RPM dan loadcell masuk ke arduino dan dikirimkan ke PC secara serial. Monitoring data ditampilkan menggunakan hyperterminal dan disimpan dalam suatu database excel.', 'Laporan_April-2015Perancangan_ground_test_sistem_solar_LSU.pdf', 1, NULL, 5, 2015, '2015-05-04 14:11:51.872238', 1, 'Laporan_April-2015Perancangan_ground_test_sistem_solar_LSU.pdf', 1, 0);
