INSERT INTO note VALUES (1029, 575, 'JALUR KOMUNIKASI ANTAR SUB BAGIAN KOMPUTER  PADA KONFIGURASI EFS N219 VERSI 1.2', 'Pengembangan EFS N219 dimaksudkan untuk mempelajari lebih dalam pengembangan pesawat N219. Untuk membangun EFS N219 dirancang sistem yang terdiri dari hardware-hardware berupa komputer dan lainnya. Bagian bagian ini disusun menjadi sebuah konfigurasi yang di sebut konfigurasi hardware EFS N219. Bagian Hardware pembentuk EFS n219 merupakan komputer yang saling terhubung. Desain Komunikasi antar komputer tersebut penting diperhatikan karena mempengaruhi pengiriman data dari satu bagian ke bagian lainnya', 'Laporan_ToT_Mei___EFS,_AGUS_WIYONO_.pdf', 2, NULL, 6, 2015, '2015-06-01 14:31:07.536669', 1, 'Laporan_ToT_Mei___EFS,_AGUS_WIYONO_.pdf', 1, 0);
