INSERT INTO note VALUES (1033, 640, 'Desain Skema Autopilot Box Kendali Terbang Avionik  LSU 02/03', 'Aplikasi pemantauan dengan pesawat tanpa awak semakin berkembang. Beberapa pemanfaatan pesawat tanpa awak yaitu untuk pemetaan, pemantauan dengan video. Untuk pengendalian pesawat tanpa awak diperlukan sistem elektronik yang berupa sistem avionik. Di Program Pustekbang sistem avionik merupakan keseluruhan sistem elektronik yang berhubungan dengan kendali terbang pesawat LSU 02/03. Dengan dituntutnya standarisasi produk teknologi maka perlu dilakukan desain skema avionik yang mudah digunakan oleh user dan tetap memilki spesifikasi yang sesuai standar avionik untuk LSU02/03.', 'Laporan_LSU02_Mei_2015.pdf', 7, NULL, 6, 2015, '2015-06-01 16:50:27.276414', 1, 'Laporan_LSU02_Mei_2015.pdf', 1, 0);
