INSERT INTO note VALUES (1034, 647, 'KARAKTERISTIK STOKIOMETRI BAHAN BAKAR UNTUK MENGHASILKAN GAYA DORONG PESAWAT NIR AWAK LSU-05', 'Bahan bakar merupakan penghasil energi akibat terjadinya perubahan energi, dari energi kimia menjadi energi panas dan tekanan di dalam ruang bakar, pada saat bahan bakar bereaksi dengan oksigen dan panas, selama pembakaran berlangsung. Pada motor bakar piston yang digunakan sebagai pembangkit energi dorong pesawat nir awak LSU-05 adalah energi yang dihasilkan pembakaran bahan bakar di dalam silinder ruang bakar. Pembakarannya berlangsung sangat cepat, tetapi operasional motor bakar piston perlu waktu  sekitar seratus sampai dengan seribu detik, atau tergantung jenis mesinnya. Motor bakar yang menggunakan sistem karburator atau pun sistem injeksi sebagai sarana untuk pencampuran bahan bakar dan oksigen yang berasal dari udara, sebelum masuk ke dalam silinder ruang bakar, diperlukan bahan bakar yang mudah menguap pada temperatur atmosfir dan membentuk campuran dengan udara menjadi campuran yang mudah terbakar.   Energi dorong sebagai hasil pembakaran ini, selanjutnya digunakan  untuk menggerakkan piston dalam arah translasi bolak balik, kemudian diteruskan ke batang hubung dan poros engkol menjadi gerakan putar, yang selanjutnya dapat memutar baling-baling propeler untuk menghasilkan gaya dorong dan menjadikan sayap pesawat terbang nir awak menghasilkan gaya angkat. Gaya dorong dan gaya angkat ini berfungsi untuk mewujudkan misi pesawat LSU-05 menjadi pesawat pembawa muatan. Dari uraian di atas dapat diketahui bahwa bahan bakar merupakan sumber energi dari sistem pembangkit tenaga melalui motor bakar piston. Tentunya untuk mendapatkan motor bakar piston yang andal dalam  menghasilkan gaya dorong, diperlukan bahan bakar yang andal juga. Keandalan bahan bakar ini dapat diketahui melalui analisis stokiometri pembakaran. Oleh sebab itu untuk memenuhi keandalan tersebut, dirasa perlu dilakukan penelitian tentang kinerja bahan bakar berhubungan dengan karakteristik stokiometri pembakaran  bahan bakar sebagai penghasil gaya dorong pesawat LSU-05.', '01_Laporan_Litbangyasa_Mei_2015_Bahan_bakar.pdf', 1, NULL, 6, 2015, '2015-06-01 17:17:27.164996', 1, '01_Laporan_Litbangyasa_Mei_2015_Bahan_bakar.pdf', 1, 0);
