INSERT INTO note VALUES (1044, 684, 'Hardware-in-the-Loop Simulator Concept Development', 'The Hardware-in-the-Loop Simulation (HILS) is a system that is use to test the plant or electronic control unit. For this case the plant is the aircraft Flight Control Computer (FCC). To design the HILS system, first a concept of the HILS needs to be determined.
INSERT INTO note VALUES (1046, 650, 'Hardware-in-the-Loop Simulation: Concept Development; FCC: Concept and Specification; Flight Mechanics Simulation: Expansion of Equations of Motion, Power plant Modeling and Data base; Flight Control Law: overview of autopilot tasks', 'The TR will discuss several topics. It starts with concept development of Hardware-in-the-Loop (HiL) Simulation and the progress of Flight Control Computer (FCC) concept and specification. Then, it continues with Flight Mechanical Model (FMM) development, i.e. expansion of equations of motion and power plant modeling and data base. Lastly, there is an overview of autopilot tasks for Flight Control Law (FCL) development.
INSERT INTO note VALUES (1047, 682, 'Powerplant Modelling and Data Base', 'In order to develop flight mechanical model, there are three sub models have to be build, which are aircraft sub model, actuator and control linkage sub model and sensors sub model. Inside each sub model, there are sub systems which have to define and to be built. For example, inside the aircraft sub model there is a power plant sub system have to be built.
INSERT INTO note VALUES (1060, 602, 'Draft Organisasi Fungsional Kerekayasaan (OFK) revisi ', 'Organisasi Fungsional Kerekayasaan (OFK) program MSS direvisi untuk mengakomodir keterbatasan SDM karena pada tahun ini sebagian besar akan melanjutkan pendidikan ke jenjang yang lebih tinggi.
INSERT INTO note VALUES (1048, 683, 'FCC Concept and Specification', 'Flight control computer (FCC) system is consist of two duplex systems which is redundant and independent each other. Each systems has a duplex input/output module (IOM) and a duplex core processing module (CPM). The FCC system monitors all of the EFCS components including sensors, actuators, software etc. Redundancy system manage the system components in case of failure.
