INSERT INTO note VALUES (1058, 602, 'PEMILIHAN JENIS PEREDAM (DAMPER) PADA MOUNTING ENGINE PESAWAT  LSU-03 UNTUK MEREDAM GETARAN YANG TERJADI', 'Getaran yang terjadi pada pesawat Unmanned Aerial Vehicle (UAV) LSU-03 khususnya pada saat terbang cukup tinggi dilihat dari perhitungan amplitudo dan frekuensi yang terjadi. Asal sumber getar yang terjadi pada pesawat cukup banyak terutama dari engine yang bekerja. Getaran yang terjadi bisa berakibat fatal pada struktur pesawat maupun instrumentasi pesawat. Struktur pesawat bisa rusak sedangkan instrumentasi yang terganggu bisa mengakibatkan pesawat tidak terkontrol sesuai rencana dan jatuh. Pemasangan peredam (damper) pada mounting engine pesawat LSU-03 harus mempertimbangkan banyak hal, terutama jumlah dan posisinya karena ruang (space) yang tersedia untuk pemasangan yang relatif sempit. Makalah ini berisi perhitungan dari beberapa jenis peredam yang bisa dipasang pada mounting engine pesawat LSU-03 untuk meredam getaran yang terjadi sehingga bisa dipilih jenis dan jumlah peredam yang akan dipasang sesuai dengan kebutuhan. Dari hasil perhitungan yang dilakukan diketahui bahwa jika dipilih damper jenis CR2-400 bisa dipasang 3 atau 4 buah damper, sedangkan jika dipilih damper jenis CR1-100 harus dipasang 5 atau 6 buah.', 'PEMILIHAN_JENIS_PEREDAM_VIBRASI_LSU03.pdf', 0, NULL, 6, 2015, '2015-06-05 10:27:12.382088', 2, 'PEMILIHAN_JENIS_PEREDAM_VIBRASI_LSU03.pdf', 1, 0);
