INSERT INTO note VALUES (1107, 907, 'Pembuatan Model Uji Lapan Surveillance UAV 05 (LSU-05)', 'Pembuatan Model Uji Lapan Surveillance UAV 05 (LSU-05)menggunakan bahan baku Styrofoam atau plastik busa yang merupakan salah satu jenis plastik dari sekian banyak bahan lainnya. Adapun spesifikasi dari model uji LSU-05 adalah panjang sayap total 196 cm, dan panjang bodi 69 cm.Untuk pengaturan sudut Aeleron dan flap pada sayap digunakan servo, jumlah servo yang digunakan pada sayap kiri dan kanan sebanyak 6 (enam) buah servo, 2 (dua) servo untuk pengaturan sudut Aeleron (kiri dan kanan) dan 4 (empat) servo untuk pengauran sudut flap (kiri dan kanan.', 'Laporan_Pelaksanaan_Kegiatan_Juni_2015_DodotPDF.pdf', 1, NULL, 6, 2015, '2015-06-30 12:34:00.353036', 1, 'Laporan_Pelaksanaan_Kegiatan_Juni_2015_DodotPDF.pdf', 1, 0);
INSERT INTO note VALUES (1108, 912, 'Melakukan perawatan Genset kapasitas 60 KVA, untuk back-up komputer cluster', 'Genset kapasitas 60 KVA berfungsi untuk back-up listrik komputer    cluster yang harus operasi 24 jam , untuk itu genset harus selalu siap bila terjadi gangguan listrik atau pemadaman dari PLN. Genset tersebut sudah di instalasi secara otomat jadi bila terjadi gangguan listrik, maka genset akan start secara otomat. Untuk menjaga kondisi instalasi tsbt, maka harus dilakukan perawatan secara berkala, baik kondisi fisik maupun instalasinya.   ', 'L_K_SOFIAN_SYAHRANI_GENSET.pdf', 1, NULL, 6, 2015, '2015-06-30 12:43:45.695625', 1, 'L_K_SOFIAN_SYAHRANI_GENSET.pdf', 1, 0);
INSERT INTO note VALUES (1109, 909, 'Melakukan Pembuatan Model Pesawat LSU-05', 'Pembuatan model pesawat LSU-05 adalah untuk diuji di terowongan angin subsonik, untuk itu maka ukuran dan konstruksinya disesuaikan dengan ruang seksi uji terowongan angin terutama pada bagian bawah yaitu untuk penempatan model pada internal balance di dalam ruang seksi uji. Agar model bisa dipasang pada posisi yang bervariasi, maka dudukan ini harus dibuat yang flexible namun tetap kuat.                               ', 'L_K_agus__sakti__bangun__lsu.pdf', 1, NULL, 6, 2015, '2015-06-30 12:48:51.622544', 1, 'L_K_agus__sakti__bangun__lsu.pdf', 1, 0);
INSERT INTO note VALUES (1110, 912, 'Melakukan Pembuatan Model Pesawat LSU-05', 'Pembuatan model pesawat LSU-05 adalah untuk diuji di terowongan angin subsonik, untuk itu maka ukuran dan konstruksinya disesuaikan dengan ruang seksi uji terowongan angin terutama pada bagian bawah yaitu untuk penempatan model pada internal balance di dalam ruang seksi uji. Agar model bisa dipasang pada posisi yang bervariasi, maka dudukan ini harus dibuat yang flexible namun tetap kuat.', 'L_K_SOFIAN_SYAHRANI_juni_lsu_badan.pdf', 2, NULL, 6, 2015, '2015-06-30 12:57:54.45636', 1, 'L_K_SOFIAN_SYAHRANI_juni_lsu_badan.pdf', 1, 0);
