INSERT INTO note VALUES (1113, 640, 'Desain Skema Receiver Remote Control Untuk  LSU 02/03', 'Aplikasi pemantauan dengan pesawat tanpa awak semakin berkembang. Beberapa pemanfaatan pesawat tanpa awak yaitu untuk pemetaan, pemantauan dengan video. Untuk pengendalian pesawat tanpa awak diperlukan sistem elektronik yang berupa sistem avionik. Di Program Pustekbang sistem avionik merupakan keseluruhan sistem elektronik yang berhubungan dengan kendali terbang pesawat LSU 02/03. Dengan dituntutnya standarisasi produk teknologi maka perlu dilakukan desain skema avionik yang mudah digunakan oleh user dan tetap memilki spesifikasi yang sesuai standar avionik untuk LSU02/03. ', 'Laporan_LSU02_Juni_2015.pdf', 8, NULL, 7, 2015, '2015-07-01 08:53:48.454382', 1, 'Laporan_LSU02_Juni_2015.pdf', 1, 0);
