INSERT INTO note VALUES (1128, 811, 'Kelanjutan riset bahan bakar Mesin UAV', 'Energi dorong sebagai hasil pembakaran bahan bakar, selanjutnya digunakan  untuk menggerakkan piston dalam arah translasi bolak balik, kemudian diteruskan ke batang hubung dan poros engkol menjadi gerakan putar, yang selanjutnya dapat memutar baling-baling propeler untuk menghasilkan gaya dorong dan menjadikan sayap pesawat terbang nir awak menghasilkan gaya angkat. Gaya dorong dan gaya angkat ini berfungsi untuk mewujudkan misi pesawat LSU-05 menjadi pesawat pembawa muatan', '01_Laporan_Litbangyasa_Juni_2015_Stokiometri.pdf', 3, NULL, 7, 2015, '2015-07-10 14:27:03.403699', 1, '01_Laporan_Litbangyasa_Juni_2015_Stokiometri.pdf', 1, 0);
INSERT INTO note VALUES (1144, 909, 'Melakukan Perawatan Fasilitas Uji Terowongan Angin Subsonik', 'Pengopersian Terowongan Angin Subsonik, membutuhkan peralatan dan personil yangcukup,karena untuk setiap model akan diuji sampai berkali-kali hingga mendapatkan data yang diinginkan.  Untuk itu perlu kesiapan peralatan seperti tools mekanik, tools listrik dan instrument pengujian serta fesilitas lain yang diperlukan pada saat pengujian. Peralatan serta fasilitas tersebut harus terus di monitor dan dikondisikan agar selalu dalam keadaan siap pakai. ', 'L_K_agus_Sakti_Bangun_juli.pdf', 2, NULL, 8, 2015, '2015-08-03 09:17:27.233546', 1, 'L_K_agus_Sakti_Bangun_juli.pdf', 1, 0);
