INSERT INTO note VALUES (1245, 908, 'Pemeriksaan instalasi Gedung Terowongan Angin Subsonik ', 'Renovasi gedung terowongan angin subsonik menjadi Gedung Disain Center masih berjalan, hal yang perlu diperhatikan diantaranya mengenai power listrik yaitu ada peralatan yang harus tetap operasi walaupun fisik sedang dibongkar.', 'LAPORAN_TEKNIS_Oktober_2015_Rahardjo.pdf', 5, NULL, 11, 2015, '2015-11-27 10:41:32.364203', 1, 'LAPORAN_TEKNIS_Oktober_2015_Rahardjo.pdf', 1, 0);
INSERT INTO note VALUES (1132, 927, 'Konsep dan Metodologi Pengujian Untuk Struktur Pesawat LSU 02, 03 dan 05 (Lanjutan)', 'Pusat Teknologi Penerbangan Khususnya Bidang Teknologi Aerostruktur, merupakan pusat baru dan bidang baru yang mempunyai tugas pokok dan fungsi yang baru dalam dunia penerbangan (baik pesawat berawak maupun pesawat tanpa awak). Padahal untuk menerbangkan suatu wahana tanpa awak beserta seluruh sistemnya, diperlukan beberapa persyaratan uji kelayakan bagi seluruh sistem wahana tersebut. Uji kelayakan tersebut dilakukan untuk mengetahui kehandalan seluruh sistem terhadap pengaruh-pengaruh lingkungan internal maupun eksternal dengan pengukuran-pengukuran yang dilakukan secara simultan. Oleh karena itu diperlukan suatu studi awal untuk menguasai permasalahan yang terkait dengan metodologi dan teknik pengujian getaran struktur pesawat UAV tersebut. Techninac Report ini merupakan studi literatur yang diambil dari beberapa sumber (tulisan para pakar yang sudah ahli dalam bidangnya) yang menjelaskan rincian penyelidikan secara eksperimental suatu pesawat tanpa awak (UAV) yang terbuat dari bahan komposit super ringan.', 'TR3-2.pdf', 1, NULL, 7, 2015, '2015-07-30 09:57:33.727308', 1, 'TR3-2.pdf', 1, 0);
