INSERT INTO note VALUES (1133, 891, 'Hasil Pengujian Muatan Video Realtime Menggunakan LSU-03 ', 'Telah dikembangkan antena tracking yang salah satu tujuannya adalah untuk mencapai komunikasi terjauh pada misi LSU. Selain data-data telemetri yang harus diterima dengan baik di GCS, ada misi penting yang dikembangkan untuk kegiatan survei oleh UAV yaitu video realtime. Muatan video realtime sangat dibutuhkan pada misi penerbangan LSU, oleh karena itu perlu dilakukan penelitian, perekayasaan,pengujian dan implementasi muatan video untuk mendukung kesuksesan misi survei LSU.
