INSERT INTO note VALUES (1136, 907, 'Perawatan sumber daya listrik untuk backup cluster komputer', 'Karena begitu pentingnya cluster komputer untuk bisa on satu hari 24 jam, maka diperlukan alat pendukung pula yaitu sumber daya cadangan yang bisa membackup bilamana terjadi gangguan pada sumber daya yang disediakan oleh PLN. Cluster komputer pustekbang mempunyai kapasitas komputer 100 unit komputer yang di terhubung secara paralel dan dioperasikan secara bersamaan dalam instalasi listriknya dibagi menjadi 10 kelompok dan masing-masing kelompok berjumlah 10 unit komputer. Untuk mengoperasikannya sistem tersebut membutuhkan daya listruk sekitar 22 KW yang diambilkan dari gardu-SR5 melalui gedung subsonik dan di backup dengan diesel kapasitas 60 KWA.', 'LAPORAN_PELAKSANAAN_PELAYANAN_KEGIATAN_Juli_2015_dodotPDF.pdf', 2, NULL, 7, 2015, '2015-07-31 12:47:39.146629', 1, 'LAPORAN_PELAKSANAAN_PELAYANAN_KEGIATAN_Juli_2015_dodotPDF.pdf', 1, 0);
