INSERT INTO note VALUES (1150, 947, 'Design of EFCS and Testing Tools of LSA 02 UAV Demonstrator', 'The TR will discuss several topics. Flight Control Law design will cover the system analysis of longitudinal and lateral motion of utility aircraft S15 with the topic of investigation of CG distance effect on the Eigen values. The EFCS hardware will discuss the revision of BEFCS concept and will continue with consideration of environmental condition for FCC. Test tools will discuss the requirement of HiLS computer.', 'TR3_-_SB.pdf', 1, NULL, 8, 2015, '2015-08-04 08:56:40.146964', 1, 'TR3_-_SB.pdf', 1, 0);
