INSERT INTO note VALUES (1152, 949, 'EFCS Concept: Revision of BEFCS Concept', 'BEFCS with main FCL inside provide basic control and basic autopilot function. Besides of that, it also provide monitoring function of the experimental system (XS). In order to keep safety, the BEFCS monitor the command from experimental FCL to the actuators. In case of the XS FCL send dangerous command, then the BEFCS will cut the command and take over to control the aircraft. Also, BEFCS provide envelope protection for the XS. It limit maximum and minimum value of the controller to prevent the XS exceed maximum and minimum value of the main controller. If it happen, the main controller cant do a recovery.', 'TN5_-_TM.pdf', 1, NULL, 8, 2015, '2015-08-04 09:07:03.592794', 1, 'TN5_-_TM.pdf', 1, 0);
INSERT INTO note VALUES (1153, 950, 'Environmental condition for FCC', 'Flight control computer (FCC) system will be installed in aircraft and it will work at specific condition on environmental condition of aircraft operation area. To insure that FCC system will work without any problem regarding environmental condition, the FCC must be comply with RTCA/DO-160 standard.
