INSERT INTO note VALUES (1174, 915, 'VERIFICATION OF AERODYNAMICS CHARACTERISTIC ON TWIN TAIL-BOOM PUSHER UNMANNED AIRCRAFT MODEL USING NUMERICAL METHOD', 'The twin tailboom pusher-type unmanned aerial vehicles (UAV)  is one of research aircraft which have been developed at Aeronautics Technology Center  LAPAN. The choice of this design type is expected to support a mission for research and dissemination activities. Aircraft are designed to meet the requirements of the various flying profiles, ie take-off and landing profiles. One of the aerodynamics characteristic to be analyzed in order to meet these requirements is the drag polar characteristic. These characteristics can be obtained using empirical and numerical method. In this study, LAPAN Surveillance UAV (LSU-03) has been chosen to represent an aerodynamics analysis on generic twin tail-boom pusher type unmanned aircraft. Aerodynamic analysis has been conducted using XFLR5; a semi empiric-numeric software using vortex lattice - 3d panels method and for numerical computation using ANSYS CFX ; a computational fluid dynamics (CFD) software. The result shows the aerodynamics analysis using 3d panels - vortex lattice method (VLM) has not been able to model turbulent flow and stall effect cannot be identified. Nevertheless, the XFLR simulation result shows similarity with the CFX simulation on linear region of the lift coefficient curve. So the two results have been verified on analysis of lift coefficient
