INSERT INTO note VALUES (1176, 598, 'Laporan Terbang Penyegaran', 'Dalam rangka menjaga kemampuan terbang personil Penerbang LAPAN, Pustekbang senantiasa menyiapkan personil yang berkompeten dan selalu siap dalam melaksanakan misi-misi penerbangan. Sebagai langkah nyata, Pustekbang bekerjasama dengan Alfa Flying School dalam melaksanakan Latihan Terbang Penyegaran. Hal ini bertujuan agar kemampuan (skill) serta pengetahuan (knowledge) personil penerbang tidak luntur. Kegiatan berlangsung di Pangkalan Udara TNI-AU Adisumarmo, Solo dari tanggal 28 Juni-04 Juli 2015. Latihan rutin menjadi sangat penting mengingat saat ini kesiapan pesawat yang dimiliki oleh LAPAN belum sepenuhnya dapat di operasikan dikarenakan beberapa kendala. Meskipun demikian, Pustekbang tidak ingin kemampuan penerbangnya menurun, sehingga dengan latihan yang rutin diharapkan kesiapan personil penerbang dapat terus terjaga.', 'LAPORAN_LATIHAN_TERBANG_PENYEGARAN.pdf', 2, NULL, 8, 2015, '2015-08-21 16:19:32.585808', 1, 'LAPORAN_LATIHAN_TERBANG_PENYEGARAN.pdf', 1, 0);
INSERT INTO note VALUES (1177, 598, 'Laporan Terjun Penyegaran Freefall', 'Dalam rangka melaksanakan pembinaan dan latihan personil penerbang agar senantiasa mampu mengoperasikan parasut darurat, maka Pustekbang mengirimkan personil untuk melaksanakan latihan terjun freefall yang dilaksanakan di Batujajar (vertical wind tunnel) dan Tasikmalaya (praktek terjun).
