INSERT INTO note VALUES (1181, 927, 'Konsep dan Metodologi Pengujian Untuk Struktur Pesawat LSU 02, 03 dan 05 (Lanjutan)', 'Sebelum pengujian terhadap struktur wahana dilakukan, kita harus mengetahui karakteristik mesin yang akan digunakan pada wahana tersebut. Untuk mengetahui karakteristik mesin yang akan digunakan, tentunya kita harus melakukan pengujian terhadap mesin tersebut. Oleh karena itu diperlukan sarana penunjang untuk mengetahui karakteristik mesin tersebut. Sarana ini biasa disebut sebagai dudukan tempat pengujian mesin (Testbed engine). Sarana atau alat ini harus kaku dan rigid agar tidak menimbulkan resonansi ketika mesin diuji.
