INSERT INTO note VALUES (1200, 927, 'Konsep dan Metodologi pengujian Untuk Struktur Pesawat LSU 02, 03 dan 05 ( Sebagai studi perbandingan/kajian )', 'Pusat Teknologi Penerbangan Khususnya Bidang Teknologi Aerostruktur, merupakan pusat baru dan bidang baru yang mempunyai tugas pokok dan fungsi yang baru dalam dunia penerbangan (baik pesawat berawak maupun pesawat tanpa awak). Padahal untuk menerbangkan suatu wahana tanpa awak beserta seluruh sistemnya, diperlukan beberapa persyaratan uji kelayakan bagi seluruh sistem wahana tersebut. Uji kelayakan tersebut dilakukan untuk mengetahui kehandalan seluruh sistem terhadap pengaruh-pengaruh lingkungan internal maupun eksternal dengan pengukuran-pengukuran yang dilakukan secara simultan. Oleh karena itu diperlukan suatu studi awal untuk menguasai permasalahan yang terkait dengan metodologi dan teknik pengujian getaran struktur pesawat UAV tersebut. Techninac Report ini merupakan studi literatur yang diambil dari beberapa sumber (tulisan para pakar yang sudah ahli dalam bidangnya) yang menjelaskan rincian penyelidikan secara eksperimental suatu pesawat tanpa awak (UAV) yang terbuat dari bahan komposit super ringan.', 'TR3-4.pdf', 3, NULL, 9, 2015, '2015-09-30 14:59:55.256243', 1, 'TR3-4.pdf', 1, 0);
INSERT INTO note VALUES (1201, 565, 'Short Take-Off Landing (STOL) Analysis on N219 Commuter Transport Airplane ', ' N219 adalah pesawat transportasi komuter yang saat ini sedang dikembangkan di PT Dirgantara Indonesia (PTDI). N219 memiliki misi untuk beroperasi di landasan pacu tak beraspal siap atau di daerah terpencil dan daerah pegunungan; sehingga dalam pengembangan konfigurasi pesawat N219 ada persyaratan opsional dari lepas landas pendek dan kemampuan mendarat (STOL), membutuhkan tanah jangka pendek untuk mendapatkan udara dan roll tanah pendek ketika mendarat. Dalam penelitian ini, kinerja bidang tanah dari konfigurasi akhir telah dianalisis. Parameter yang take-off dan landing jarak dihitung dengan Tujuan penelitian ini adalah untuk memprediksi kemampuan STOL dari konfigurasi akhir pesawat. Hasil menunjukkan N219 telah bertemu persyaratan dari STOL dengan beberapa teknik telah diperkenalkan ke perhitungan
INSERT INTO note VALUES (1202, 907, 'Pengujian LSU-05 pada Terowongan Angin Subsonik LAPAN', 'Dalam proses perancangan Unmanned Aerial Vehicle atau disingkat UAV / Pesawat tanpa awak  diperlukan analisa aerodinamika untuk mengetahui sejauh mana hasil perancangan memenuhi karakteristik terbang yang diinginkan. Dalam mendukung analisa aerodinamika dilakukan pengujian wind tunnel (terowongan angin) untuk mengetahui besaran-besaran aerodinamika. Hasil dari pengujian tersebut digunakan untuk perbandingan terhadap hasil-hasil perhitungan prediktif (VLM, VS Aero dan Datcom). Selanjutnya, perbandingan juga dilakukan dengan kajian hasil perancangan konfigurasi terutama dari sisi aerodinamika untuk memperoleh karakteristik aerodinamika yang diinginkan.', 'Laporan1_Pelaksanaan_Kegiatan_September_2015_Uji_LSU05_Dodot_Prastowo.pdf', 4, NULL, 10, 2015, '2015-10-01 10:01:00.911424', 1, 'Laporan1_Pelaksanaan_Kegiatan_September_2015_Uji_LSU05_Dodot_Prastowo.pdf', 1, 0);
INSERT INTO note VALUES (1203, 912, 'Melakukan Pembuatan Model Pesawat LSU-05', 'Pembuatan model pesawat LSU-05 adalah untuk diuji di terowongan angin subsonik, untuk itu maka ukuran dan konstruksinya disesuaikan dengan ruang seksi uji terowongan angin terutama pada bagian bawah yaitu untuk penempatan model pada internal balance di dalam ruang seksi uji. Agar model bisa dipasang pada posisi yang bervariasi, maka dudukan ini harus dibuat yang flexible namun tetap kuat     ', 'L_K_SOFIAN_SYAHRANI__lsu_05.pdf', 6, NULL, 10, 2015, '2015-10-01 10:06:55.083686', 1, 'L_K_SOFIAN_SYAHRANI__lsu_05.pdf', 1, 0);
