INSERT INTO note VALUES (1217, 811, 'KARAKTERISTIK STOKIOMETRI BAHAN BAKAR UNTUK MENGHASILKAN GAYA DORONG PESAWAT NIR AWAK LSU-05', 'Bahan bakar merupakan penghasil energi akibat terjadinya perubahan energi, dari energi kimia menjadi energi panas dan tekanan di dalam ruang bakar, pada saat bahan bakar bereaksi dengan oksigen dan panas, selama pembakaran berlangsung. Pada motor bakar piston yang digunakan sebagai pembangkit energi dorong pesawat nir awak LSU-05 adalah energi yang dihasilkan pembakaran bahan bakar di dalam silinder ruang bakar. Pembakarannya berlangsung sangat cepat, tetapi operasional motor bakar piston perlu waktu  sekitar seratus sampai dengan seribu detik, atau tergantung jenis mesinnya. Motor bakar yang menggunakan sistem karburator atau pun sistem injeksi sebagai sarana untuk pencampuran bahan bakar dan oksigen yang berasal dari udara, sebelum masuk ke dalam silinder ruang bakar, diperlukan bahan bakar yang mudah menguap pada temperatur atmosfir dan membentuk campuran dengan udara menjadi campuran yang mudah terbakar. ', '01_Laporan_Litbangyasa_September_2015_Stokiometri.pdf', 0, NULL, 10, 2015, '2015-10-05 11:07:59.691178', 2, '01_Laporan_Litbangyasa_September_2015_Stokiometri.pdf', 1, 0);
INSERT INTO note VALUES (1218, 811, 'PEMBINAAN PENELITIAN DAN PENULISAN KTI', 'Karya hasil litbang telah banyak dimiliki oleh Pusat Teknologi Penerbangan (Pustekbang), Lembaga Penerbangan dan Antariksa Nasional (LAPAN), diantaranya meliputi mulai dari disain engineering sampai dengan prototip teknologi pesawat terbang. Tentunya hasil litbang ini perlu didokumentasikan dan dipublikasikan ke masyarakat, baik ke masyarakat umum maupun ke masyarakat ilmiah, salah satunya dalam bentuk Karya Tulis Ilmiah hasil litbang (KTI). Untuk mendapatkan jumlah maupun kualitas KTI yang diperlukan masyarakat ilmiah, minimal harus memenuhi syarat ilmiah, yaitu Logis, obyektif, sistematis, andal tak terbantah, dirancang, dapat dibuktikan kembali, dan mempunyai kontribusi dalam pengembangan iptek pesawat terbang. Oleh karena itu untuk memenuhi hal ini diperlukan pembinaan penelitian dan penulisan KTI hasil litbang di lingkungan Pustekbang. ', '01_Laporan_Pembinaan_KTI_September_2105.pdf', 1, NULL, 10, 2015, '2015-10-05 11:09:32.910025', 1, '01_Laporan_Pembinaan_KTI_September_2105.pdf', 1, 0);
