INSERT INTO note VALUES (1225, 570, 'HOFFMAN FAILURE CRITERION FOR MAIN LANDING GEAR FAIRING OF N-219 AIRCRAFT DUE TO AERODYNAMIC LOAD', 'The N-219 aircraft is a-19-passenger aircraft that now is being manufactured at PTDI. This aircraft has both metallic and composite structure. This paper focuses on analysis of the main landing gear fairing which is made of composite materials due to aerodynamic load. There are five cases of aerodynamic loads which represent loads when the aircraft is operated. The main landing gear fairing structure is modeled as a surface and then it is analyzed using MSC PATRAN/NASTRAN software. Eventually, Hoffman failure criterion result from simulation is used to see whether failure has occurred or not due to aerodynamic loads.
