INSERT INTO note VALUES (1233, 737, 'METODOLOGI PENGUJIAN GETARAN UNTUK STRUKTUR PESAWAT LSU 02, 03 dan 05', 'Pusat Teknologi Penerbangan Khususnya Bidang Teknologi Aerostruktur, merupakan pusat baru dan bidang baru yang mempunyai tugas pkok dan fungsi yang baru dalam dunia penerbangan (baik pesawat berawak maupun pesawat tanpa awak). Padahal untuk menerbangkan suatu wahana tanpa awak beserta seluruh sistemnya, diperlukan beberapa persyaratan uji kelayakan bagi seluruh sistem wahana tersebut. Uji kelayakan tersebut dilakukan untuk mengetahui kehandalan seluruh sistem terhadap pengaruh-pengaruh lingkungan internal maupun eksternal dengan pengukuran-pengukuran yang dilakukan secara simultan. Oleh karena itu diperlukan suatu studi awal untuk menguasai permasalahan yang terkait dengan metodologi dan teknik pengujian getaran struktur pesawat UAV tersebut. Makalah ini merupakan studi kasus (berdasarkan pada karya tulis J. Simsiriwong dan R. W. Sullivan, yang berjudul Vibration Testing of a Carbon Composite Fuselage) yang menjelaskan rincian penyelidikan secara eksperimental suatu pesawat tanpa awak (UAV) yang terbuat dari bahan komposit super ringan dengan fokus pada karakteristik getaran struktur rangka pesawat. Struktur rangka pesawat ini terdiri atas badan pesawat dengan stabilizer vertikal yang terintegrasi. Karakteristik struktur rangka pesawat ditentukan untuk konfigurasi bebas-bebas yang disimulasikan dengan menahan struktur uji menggunakan suatu pegas pada titik serang sayap. Untuk mengetahui karakteristik struktur pesawat UAV ini digunakan 19 buah accelerometer dua sumbu sebagai sensor. Dari hasil pengujian diperoleh frekwensi alami dibawah 50 Hz, ini berarti bahwa metodologi yang digunakan cukup bagus mengingat frekwensi operasional pesawat berada di atas frekwensi tersebut.', 'TR3-5.pdf', 7, NULL, 10, 2015, '2015-10-30 15:59:06.848768', 1, 'TR3-5.pdf', 1, 0);
INSERT INTO note VALUES (1234, 907, 'Pengujian LSU-05 pada Terowongan Angin Subsonik LAPAN.  (lanjutan)', 'Dalam proses perancangan Unmanned Aerial Vehicle atau disingkat UAV / Pesawat tanpa awak  diperlukan analisa aerodinamika untuk mengetahui sejauh mana hasil perancangan memenuhi karakteristik terbang yang diinginkan. Dalam mendukung analisa aerodinamika dilakukan pengujian wind tunnel (terowongan angin) untuk mengetahui besaran-besaran aerodinamika. Hasil dari pengujian tersebut digunakan untuk perbandingan terhadap hasil-hasil perhitungan prediktif (VLM, VS Aero dan Datcom). Selanjutnya, perbandingan juga dilakukan dengan kajian hasil perancangan konfigurasi terutama dari sisi aerodinamika untuk memperoleh karakteristik aerodinamika yang diinginkan.', 'L_Pelaksanaan_Kegiatan_Oktober_2015_Uji_LSU05_Dodot.pdf', 5, NULL, 10, 2015, '2015-10-31 10:03:09.882777', 1, 'L_Pelaksanaan_Kegiatan_Oktober_2015_Uji_LSU05_Dodot.pdf', 1, 0);
