INSERT INTO note VALUES (1247, 907, 'Pengujian Model Smart Bom P-500L pada TA Subsonik LAPAN', 'Dalam proses perancangan diperlukan analisa aerodinamika untuk mengetahui sejauh mana hasil perancangan memenuhi karakteristik terbang yang diinginkan. Dalam mendukung analisa aerodinamika dilakukan pengujian wind tunnel (terowongan angin) untuk mengetahui besaran-besaran aerodinamika. Hasil dari pengujian tersebut digunakan untuk perbandingan terhadap hasil-hasil perhitungan prediktif. Selanjutnya, perbandingan juga dilakukan dengan kajian hasil perancangan konfigurasi terutama dari sisi aerodinamika untuk memperoleh karakteristik aerodinamika yang diinginkan.', 'L_Pelaksanaan_Kegiatan_November_2015_Uji_Smart_Bom_P500L_Dodot.pdf', 6, NULL, 11, 2015, '2015-11-30 12:32:04.025405', 1, 'L_Pelaksanaan_Kegiatan_November_2015_Uji_Smart_Bom_P500L_Dodot.pdf', 1, 0);
INSERT INTO note VALUES (1248, 927, 'PENGARUH BEBAN GETARAN PADA SISTEM PCB ELEKTRONIK DAN KOMPONENNYA', 'Metode pengujian gabungan akibat adanya siklus temperatur dan getaran telah dilakukan kajiannya berkaitan dengan efektivitas dalam mengevaluasi sambungan solder pada sistem PCB elektronik. Namun, ada beberapa kesulitan dalam mengukur mekanisme kerusakan yang diakibatkan oleh beban getaran pada PCB elektronik, khususnya dalam melakukan pengukuran di lingkungan dengan tingkat getaran yang tinggi dengan rentang frekuensi yang luas, seperti di dalam perangkat wahana. Dalam rangka meningkatkan akurasi, percepatan dan simulasi dalam metode pengujian generasi berikutnya, kita harus mampu mengukur mekanisme pengrusakan ini. Tulisan ini menyajikan metode pengukuran dan menjelaskan modus kegagalan yang terjadi selama resonansi getaran dengan menitik-beratkan pada pengaruh getaran terhadap perangkat elektronik wahana dengan tingkat getaran yang tinggi.', 'TR3-6.pdf', 4, NULL, 11, 2015, '2015-11-30 13:51:47.324169', 1, 'TR3-6.pdf', 1, 0);
INSERT INTO note VALUES (1249, 909, 'Melakukan Perawatan Fasilitas Uji TA. Subsonik', 'Pengopersian Terowongan Angin Subsonik, membutuhkan peralatan dan  personil yang cukup, karena untuk setiap model akan diuji sampai  berkali-kali hingga mendapatkan data yang diinginkan. Untuk itu perlu kesiapan peralatan seperti tools mekanik, tools listrik dan instrument pengujian serta fesilitas lain yang diperlukan pada saat pengujian. Peralatan serta fasilitas tersebut harus terus di monitor dan dikondisikan agar selalu dalam keadaan siap pakai. 
