INSERT INTO note VALUES (1260, 915, 'Persyaratan  Sasaran & Rancangan Awal Pesawat LSU-03', 'Kebutuhan terhadap pesawat ringan tanpa awak meningkatkan minat berbagai pihak untuk mengembangkan pesawat tanpa awak. Di Indonesia pengembangan pesawat tanpa awak masih dalam tahap awal kematangannya sehingga masih terdapat banyak ruang untuk berkembang. Beberapa pesawat tanpa awak yang telah ada masih memiliki batasan yang cukup signifikan dalam jangkauan terbang, endurance serta berat payload yang mampu dibawanya. Sehingga minat terhadap produk dalam negeri untuk keperluan sipil maupun militer dinilai masih kurang. LAPAN sebagai lembaga penelitian yang bergerak dibidang penerbangan dan antariksa memiliki kualifikasi yang memadai untuk turut mengembangkan dan menambah keragaman spesies pesawat tanpa awak. Oleh karena itu LAPAN diharapkan dapat memunculkan sebuah rancangan pesawat tanpa awak yang dibutuhkan. Dalam hal ini kebutuhan yang dimaksud adalah sebuah platform ringan tanpa awak yang misinya berupa kegiatan penelitian, observasi, patrol, dan pengawasan Secara khusus, pesawat ringan tanpa awak ini akan digunakan sebagai platform aerial photography', 'WP312_TN2_rev2015.pdf', 2, 1, 12, 2015, '2015-12-07 12:19:23.563915', 1, 'WP312_TN2_rev2015.pdf', 1, 0);
INSERT INTO note VALUES (1261, 915, 'Analisa Prestasi Terbang Pesawat LSU-03', 'Pesawat LSU-03 telah sampai pada tahap uji terbang pada tahun 2014. Pada tahun 2015 dilakukan deseminasi pada empat bidang teknologi yaitu pada bidang Aerodinamika, struktur, system propulsi, system kendali dan avionic. Setiap misi terbang yang dirancang tentunya akan menentukan jangkauan terbang, lama terbang, dan massa payload yang dibawa. Karakteristik tersebut masuk dalam kriteria performa dari pesawat terbang yang dibuat. Kriteria tersebut sangat penting, karena pada akhirnya akan dibandingkan dengan Design Requirements and Objective (DRO) yang dibuat.
