INSERT INTO note VALUES (1269, 927, 'KONSEP PENGUJIAN GETARAN PESAWAT UAV DAN MUATANNYA', 'Untuk menerbangkan suatu wahana tanpa awak beserta seluruh sistemnya, diperlukan beberapa persyaratan uji kelayakan bagi seluruh sistem wahana tersebut. Uji kelayakan tersebut dilakukan untuk mengetahui kehandalan seluruh sistem terhadap pengaruh-pengaruh lingkungan internal maupun eksternal dengan pengukuran-pengukuran yang dilaukan secara simultan. Hal ini termasuk kemungkinan bekerjanya seluruh sistem elektronik terkait dengan sistem mekanik, hidrolik atau pneumatik dan ketergantungan umur alat, waktu operasi pada kondisi internal dan eksternal terhadap pengaruh lingkungan yang akan diterima oleh seluruh sistem wahana secara terintegrasi. Termal dan getaran merupakan pengaruh dari dua parameter lingkungan yang secara bersamaan akan dialami oleh suatu wahana pada saat terbang mengangkasa. Kedua buah parameter ini sangatlah berpengaruh terhadap seluruh sistem wahana, oleh karena itu sangatlah penting pengujian termal dan getaran ini dilakukan sebelum suatu wahana tanpa awak diterbangkan.', 'TR3-7.pdf', 5, NULL, 12, 2015, '2015-12-30 11:29:03.248765', 1, 'TR3-7.pdf', 1, 0);
