INSERT INTO note VALUES (1276, 907, 'Pengujian Model Smart Bom BLA-125 pada TA Subsonik LAPAN', 'Dalam proses perancangan diperlukan analisa aerodinamika untuk mengetahui sejauh mana hasil perancangan memenuhi karakteristik terbang yang diinginkan. Dalam mendukung analisa aerodinamika dilakukan pengujian wind tunnel (terowongan angin) untuk mengetahui besaran-besaran aerodinamika. Hasil dari pengujian tersebut digunakan untuk perbandingan terhadap hasil-hasil perhitungan prediktif. Selanjutnya, perbandingan juga dilakukan dengan kajian hasil perancangan konfigurasi terutama dari sisi aerodinamika untuk memperoleh karakteristik aerodinamika yang diinginkan.', 'L_Pelaksanaan_Kegiatan_Desember_2015_Uji_Smart_Bom_BLA-125_Dodot.pdf', 7, NULL, 1, 2016, '2016-01-05 13:40:54.072205', 1, 'L_Pelaksanaan_Kegiatan_Desember_2015_Uji_Smart_Bom_BLA-125_Dodot.pdf', 1, 0);
INSERT INTO note VALUES (1277, 881, 'Optimasi Sayap Pesawat LSU 05', 'Dalam suatu kegiatan pada sebuah program dibutuhkan suatu rencana kegiatan yang akan dilakukan dalam waktu yang telah ditentukan. Kegiatan penyusunan untuk merancang suatu pesawat atau pun mengoptimalkan hasil rancangan dilakukan dengan beberapa tahap yaitu mulai dari observasi yang akan dijadikan objek untuk di optimalkan. Misalkan dalam sebuah perancangan pesawat, hal yang sangat penting untuk diperhatikan yaitu sayap. ', 'TD_1-Aerodinamika.pdf', 4, NULL, 1, 2016, '2016-01-05 14:53:51.300761', 1, 'TD_1-Aerodinamika.pdf', 1, 0);
