INSERT INTO note VALUES (1279, 912, 'Melakukan perawatan Mesin Kompresor Kapasitas 132 KW', 'Mesin Kompresor kapasitas 132 KW adalah jenis baru yang berfungsi mengisi tangki dengan tekanan tinggi. Agar udara yang dihasilkan benar2 bersih, kompresor ini dilengkapi dengan pengering udara  yang mampu bekerja pada tekanan tinggi, untuk itu komponen pada harus selalu diperiksa jangan sampai udara tersumbat karena kotoran atau posisi katup2 nya yang tidak sesuai. Komponen filter pada kompresor dan filter pada pengering udara harus sering di periksa dan dibersihkan setiap pegujian. ', 'L_K_SOFIAN_SYAHRANI_KOMPRESOR_desember.pdf', 9, NULL, 1, 2016, '2016-01-06 14:34:28.33578', 1, 'L_K_SOFIAN_SYAHRANI_KOMPRESOR_desember.pdf', 1, 0);
