INSERT INTO note VALUES (1288, 997, 'PENGUKURAN POISSON RATIO PADA BENDA UJI KOMPOSIT  KARBON UNIDIRECTIONAL MENGGUNAKAN STRAIN GAUGE', 'Poisson ratio merupakan perbandingan antara regangan lateral terhadap regangan yang terjadi pada arah pembebanannya. Nilai ini dapat ditentukan dengan melakukan pengukuran regangan lateral dan regangan aksial menggunakan sensor strain gauge. Pada pengukuran ini, terdapat beberapa parameter yang menjadi perhatian yaitu tipe strain gauge yang digunakan, dan ada atau tidaknya tabing pada benda uji komposit.', 'TN2016-Januari.pdf', 1, NULL, 2, 2016, '2016-02-05 10:12:13.882101', 1, 'TN2016-Januari.pdf', 1, 0);
