INSERT INTO note VALUES (1289, 1042, 'Laporan Kinerja Pustekbang 2015', 'Laporan Akuntabilitas Kinerja TA 2015 ini, disusun dengan mendasarkan pada pencapaian atas rencana-rencana yang telah ditetapkan pada awal tahun anggaran 2015. Rencana-rencana tersebut merupakan implementasi dari program-program yang telah disusun sebagai tahapan Pusat Teknologi Penerbangan menuju Pusat Unggulan Teknologi Penerbangan yang merupakan Visi Pustekbang hingga 25 tahun ke depan. 
INSERT INTO note VALUES (1290, 1042, 'Perjanjian Kinerja Tahun 2016', 'Perjanjian  kinerja  adalah lembar/dokumen  yang  berisikan  penugasan dari  pimpinan  instansi  yang  lebih  tinggi  kepada  pimpinan  instansi  yang lebih   rendah   untuk   melaksanakan   program/kegiatan   yang   disertai dengan   indikator   kinerja. Melalui   perjanjian   kinerja,   terwujudlah komitmen penerima  amanah  dan  kesepakatan  antara penerima  dan pemberi amanah atas kinerja terukur tertentu berdasarkan tugas, fungsi dan  wewenang  serta sumber  daya  yang  tersedia.', 'PK_PUSTEKBANG_2016.pdf', 2, NULL, 3, 2016, '2016-03-03 12:46:06.13986', 1, 'PK_PUSTEKBANG_2016.pdf', 1, 0);
INSERT INTO note VALUES (1293, 1042, 'Rencana Operasional Kegiatan Pustekbang tahun 2016', 'Perencanaan Operasional ( Operational Planning) adalah perencanaan jangka pendek yang dirancang untuk menerjemahkan rencana jangka panjang ke dalam serangkaian kegiatan yang lebih rinci. Ia merupakan terjemahan sekaligus penunjang rencana jangka panjang.
